INSERT INTO `evidence` VALUES (2445,NULL,'BRAF, an intracellular kinase, is frequently mutated in melanoma, thyroid and lung cancers among others.','GENE_SUMMARY',NULL,_binary '\0',NULL,'2023-06-22 11:21:36',NULL,NULL,NULL,NULL,'fb828c84-3a02-4f45-8721-01c20b7794d3',673,NULL),(2446,NULL,'BRAF is a serine/threonine kinase that plays a key role in the regulation of the mitogen-activated protein kinase (MAPK) cascade (PMID: 15520807), which under physiologic conditions regulates the expression of genes involved in cellular functions, including proliferation (PMID: 24202393). Genetic alterations in BRAF are found in a large percentage of melanomas, thyroid cancers and histiocytic neoplasms as well as a small fraction of lung and colorectal cancers. The most common BRAF point mutation is V600E, which deregulates the protein\'s kinase activity leading to constitutive BRAF activation, as BRAF V600E can signal as a monomer independently of RAS or upstream activation (PMID: 20179705). Other BRAF mutations have been found that affect the protein\'s propensity to dimerize (PMID: 16858395, 26343582, 12068308). The product of these alterations is a BRAF kinase that can activate MAPK signaling in an unregulated manner and, in some instances, is directly responsible for cancer growth (PMID: 15520807). Inhibitors of mutant BRAF, including vemurafenib and dabrafenib, are FDA-approved for the treatment of late-stage or unresectable melanoma.','GENE_BACKGROUND',NULL,_binary '\0',NULL,'2019-03-05 19:00:04',NULL,NULL,NULL,NULL,'56032b8d-22d9-4e78-97f4-6b3337c21d38',673,NULL),(2447,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2023-11-01 17:35:53',NULL,NULL,NULL,NULL,'1de14103-e502-40c7-a6a6-587f8fc53135',673,NULL),(2448,NULL,'The class I activating exon 15 BRAF V600E mutation is located in the kinase domain of the BRAF protein and is highly recurrent in melanoma, lung and thyroid cancer, among others (PMID: 28783719, 26091043, 25079552, 23833300, 25417114, 28783719, 12068308). This mutation has been comprehensively biologically characterized and has been shown to activate the downstream MAPK pathway independent of RAS (PMID: 15035987, 12068308, 19251651, 26343582), to render BRAF constitutively activated in monomeric form (PMID: 20179705), and to retain sensitivity to RAF monomer inhibitors such as vemurafenib and dabrafenib (PMID:26343582, 28783719, 20179705, 30351999).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-11-01 17:35:33',NULL,NULL,NULL,NULL,'a53f5aa8-a4bb-4e65-8e30-93cf7045029e',673,NULL),(2449,NULL,'The RAF-targeted inhibitors encorafenib, dabrafenib and vemurafenib alone or in combination with the MEK-targeted inhibitors binimetinib, trametinib and cobimetinib, respectively, are FDA-approved for the treatment of patients with BRAF V600E/K mutant melanoma.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2019-08-22 14:14:06',NULL,NULL,NULL,NULL,'814e645a-9256-493d-b2c7-6771d4328876',673,NULL),(2450,NULL,'Dabrafenib is an orally bioavailable RAF inhibitor that is FDA-approved for use in patients with BRAF V600E- and V600K-mutant metastatic melanoma. FDA approval is based on the randomized Phase III trial in which dabrafenib (150 mg orally twice daily) was compared with dacarbazine (1000 mg/m2 intravenously every three weeks) in 250 patients with BRAF V600E-mutated metastatic melanoma. Dabrafenib was associated with improved progression-free survival (median 5.1 months vs. 2.7 months with dacarbazine; hazard ratio = 0.30, p<0.0001) (PMID: 22735384). Dabrafenib may also be effective against brain metastases, as demonstrated by a Phase II trial in which approximately 40% of previously untreated and 30% of previously treated patients experienced an overall intracranial response and a separate trial in which nine out of ten patients had a reduction in the size of their brain metastases (PMID: 23051966, 22608338).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 16:40:21',NULL,'LEVEL_1','NO','LEVEL_3B','86887f5d-62df-429b-9968-7b73c31a9504',673,NULL),(2451,NULL,'Vemurafenib is an orally available kinse inhibitor of V600-mutant BRAF that is FDA-approved for treatment of patients with unresectable or metastatic melanoma with the BRAF V600E mutation. Vemurafenib has been shown to have nearly equivalent activity against melanomas with BRAF V600E and V600K mutations (PMID: 24508103). In a randomized Phase III trial comparing vemurafenib (960 mg orally twice daily) with dacarbazine (1000 mg/m2 i.v. every 3 weeks) for treatment-naive, metastatic, BRAF V600E-mutant melanoma, vemurafenib was associated with better overall survival (median survival 13.6 months vs. 9.7 months; hazard ratio 0.70, p=.0008) and longer median progression-free survival (6.9 months vs. 1.6 months) (PMID: 24508103). Final overall survival data from the BRIM-3 study showed that the survival advantage of vemurafenib over dacarbazine persisted through the 4-year landmark, with survival rates for vemurafenib and dacarbazine at the 4-year landmark being 17.0% and 15.6%, respectively (PMID: 28961848). However, a trial evaluating clinical outcomes in patients with melanoma treated with either combination therapy of dabrafenib and trametinib compared to those treated with vemurafenib monotherapy demonstrated improved survival outcomes in the combination-therapy group compared to the vemurafenib group (PMID: 25399551).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 16:40:30',NULL,'LEVEL_1','NO','LEVEL_3B','09c8f359-ae07-4746-a2b1-2cc3d948b09f',673,NULL),(2452,NULL,'The RAF-targeted inhibitors dabrafenib and encorafenib in combination with the MEK1/2-targeted inhibitors trametinib and binimetinib, respectively, are FDA-approved for the treatment of patients with BRAF V600E mutant non-small cell lung cancer.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2023-10-18 16:15:16',NULL,NULL,NULL,NULL,'dc939314-9786-4d02-942c-004c3444c33d',673,NULL),(2453,NULL,'Dabrafenib, an orally bioavailable RAF inhibitor, and trametinib, an orally bioavailable MEK1/2 inhibitor, are FDA-approved alone or in combination for the treatment of patients with metastatic non-small cell lung cancer (NSCLC) with BRAF V600E mutation. FDA approval was based on a Phase II, multicenter, non-randomized, open-label study of dabrafenib in combination with trametinib in patients with chemotherapy-pretreated, metastatic, stage IV BRAF(V600E)-mutant non-small cell lung cancer, in which 36 of 57 patients (63%) achieved overall tumor response, with two patients experiencing durable complete responses and 34 patients having durable partial responses (PMID: 27283860). In the third arm of that study, which included patients with untreated, metastatic, stage IV BRAF(V600E)-mutant non-small cell lung cancer, 23 of 26 patients (64%, 95% CI 46-79) had an overall response, with two patients (6%) having durable complete response and 21 (58%) having partial response (PMID: 28919011).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 16:40:54',NULL,'LEVEL_1','NO','LEVEL_3B','c63b34cb-c1fa-4784-c031-98566ad048bb',673,NULL),(2454,NULL,'Encorafenib, a small molecule inhibitor of RAF kinases, and binimetinib, a small molecule inhibitor of MEK1/2 kinases, are FDA-approved in combination for the treatment of patients with BRAF V600E mutant non-small cell lung cancer (NSCLC). FDA approval was based on the Phase II, open-label, multicenter, single-arm PHAROS study of encorafenib in combination with binimetinib in treatment-naïve (n=59) and previously treated (n=39) patients with BRAF V600E-mutant metastatic NSCLC (PMID: 37270692). In the Phase II PHAROS study, the objective response rate and duration of response for treatment-naïve patients were 72% (95% CI=62, 85) and 44 months (95% CI=23.1, NE), with 15% experiencing a complete response and 59% experiencing a partial response, compared to 46% (95% CI=30, 63) and 18 months (95% CI=7.4, NE) in previously treated patients, with 10% experiencing a complete response and 36% experiencing a partial response (PMID: 37270692).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-10-18 13:04:43',NULL,'LEVEL_1','NO','LEVEL_3B','f9d7a2ff-3395-49ac-b86f-a141d0337167',673,NULL),(2455,NULL,'The RAF-targeted inhibitor dabrafenib in combination with the MEK1/2-targeted inhibitor trametinib is FDA-approved for the treatment of patients with BRAF V600E mutant anaplastic thyroid cancer.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2019-08-22 14:15:08',NULL,NULL,NULL,NULL,'a3898773-037a-4e4b-8a58-41d07b189222',673,NULL),(2456,NULL,'Dabrafenib, an orally bioavailable RAF inhibitor, and trametinib, an orally bioavailable MEK1/2 inhibitor, are FDA-approved alone or in combination for the treatment of patients with locally advanced or metastatic anaplastic thyroid cancer (ATC) with BRAF V600E mutation and with no satisfactory locoregional treatment options. FDA approval was based on results of the Phase II study of dabrafenib combined with trametinib in patients with BRAF V600E-positive ATC in which the overall response rate in sixteen evaluable patients was 69% (11/16; 95% CI= 41%-89%)(PMID: 29072975).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 16:36:13',NULL,'LEVEL_1','NO','LEVEL_3B','87b2f23f-8d71-4664-b259-c2384202937b',673,NULL),(2457,NULL,'The RAF-targeted inhibitor encorafenib in combination with the anti-EGFR antibody cetuximab is FDA-approved for patients with previously treated BRAF V600E mutant colorectal cancer. The combination of the RAF-inhibitor encorafenib with the anti-EGFR antibody cetuximab and chemotherapy regimen FOLFOX is FDA-approved for patients with untreated metastatic BRAF V600E mutant colorectal cancer.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2025-02-05 16:57:49',NULL,NULL,NULL,NULL,'cfcc19a6-df02-4230-85fb-992ed74d464a',673,NULL),(2458,NULL,'Encorafenib, a small molecule RAF-targeted inhibitor, and cetuximab, an anti-EGFR antibody, are FDA-approved in combination for the treatment of adult patients with metastatic CRC with a BRAF V600E mutation, as detected by an FDA-approved test, after prior therapy. BRAF V600E mutations for treatment with encorafenib plus cetuximab were detected by the FoundationOne Liquid CDx, the MI Cancer Seek assay or the therascreen BRAF V600E RGQ PCR Kit. FDA approval was based on results of the Phase III BEACON (NCT02928224) study of encorafenib plus cetuximab (n=220) versus triplet treatment (including a MEK1/2 inhibitor) versus chemotherapy (n=221) in 665 patients with BRAF V600E-mutant colorectal cancer. \n\nIn the Phase III BEACON (NCT02928224) trial, the overall response rate (complete or partial response) was 20% (95% CI=13-29) in the doublet arm versus 2% (95% CI=<1%-7%) in the chemotherapy arm (n=221), with median overall survival of 8.4 months in the doublet arm (95% CI= 7.5-11.0) and 5.4 months in the chemotherapy arm (95% CI= 4.8-6.6) (PMID: 31566309).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2025-02-05 16:30:54',NULL,'LEVEL_1','NO','LEVEL_3B','5d3556f9-89b7-4be9-9fa8-69fee10f032b',673,NULL),(2459,NULL,'Encorafenib, a small molecule inhibitor of RAF kinase, and panitumumab, an antibody that targets EGFR, are NCCN-compendium listed in combination as level 2A therapy for patients with BRAF V600E-positive colorectal cancer. In the Phase III BEACON study of encorafenib + cetuximab, another EGFR antibody, versus triplet treatment (including a MEK1/2 inhibitor) versus chemotherapy in 665 patients with BRAF V600E-mutant colorectal cancer, the overall response rate (complete or partial response) was 20% (95% CI= 13-29) in the doublet arm (n=220) versus 2% (95% CI= <1%-7%) in the chemotherapy arm (n=221), with median overall survival of 8.4 months in the doublet arm (95% CI= 7.5-11.0) and 5.4 months in the control arm (95% CI= 4.8-6.6) (PMID: 31566309). Panitumumab has also been used in doublet and triplet combination therapy, with a response rate in one study of 26% (PMID: 29431699).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 16:37:14',NULL,'LEVEL_2','NO','LEVEL_3B','d9b444f3-76b2-4f91-a919-8b8b4d853846',673,NULL),(2460,NULL,'Encorafenib, a small molecule RAF-targeted inhibitor, and cetuximab, an anti-EGFR antibody, are FDA-approved in combination with FOLFOX6 for the treatment of patients with metastatic colorectal cancer (mCRC) with a BRAF V600E mutation, as detected by an FDA-approved test. BRAF V600E mutations were detected by the therascreen BRAF V600E RGQ PCR Kit. FDA approval was based on the results of the Phase III BREAKWATER (NCT04607421) trial of encorafenib plus cetuximab versus encorafenib plus cetuximab with FOLFOX6 versus standard-of-care in 479 patients with BRAF V600E-mutant mCRC.\n\nIn the Phase III BREAKWATER (NCT04607421) trial, the encorafenib plus cetuximab with FOLFOX6 cohort (n=110) demonstrated an overall response rate (ORR) of 60.9% (95% CI=51.6-69.5), with a 2.7% (n=3) complete response (CR) rate, 58.2% (n=64) partial response (PR) rate and 28.2% (n=31) stable disease (SD) rate, and a median duration of response (DOR) of 13.9 months (95% CI=8.5-NE) (PMID: 39863775). The standard-of-care cohort (n=110) demonstrated an ORR of 40.0% (95% CI=31.3-49.3) (odds ratio=2.443 [95% CI=1.403-4.253; 99.8% CI=1.019-5.855]; p=0.0008), with a 1.8% (n=2) CR rate, 38.2% (n=42) PR rate and 30.9% (n=34) SD rate, and a median DOR of 11.1 months (95% CI=6.7-12.7) (PMID: 39863775).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2025-02-06 09:45:42',NULL,'LEVEL_1','NO','LEVEL_3B','ece8443f-a430-410b-8ea1-8c6766046dea',673,NULL),(2461,NULL,'This assertion is supported by (PMID: 25422482, 26637772).','DIAGNOSTIC_IMPLICATION',NULL,_binary '\0',NULL,'2020-09-16 17:52:15',NULL,'LEVEL_Dx3',NULL,NULL,'9bf86162-5aab-4df2-bd5d-de3313c2e96f',673,NULL),(2462,NULL,'The presence of a BRAF V600E mutation may assist in the diagnosis of [[tumor type]].','DIAGNOSTIC_SUMMARY',NULL,_binary '\0',NULL,'2020-09-16 17:52:15',NULL,NULL,NULL,NULL,'d8ad6e9b-738e-47d1-a796-f3f27485813e',673,NULL),(2463,NULL,'The RAF-targeted inhibitor vemurafenib is NCCN-compendium listed for the treatment of patients with relapsed or refractory BRAF V600E-mutant hairy cell leukemia.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2019-08-22 12:28:23',NULL,NULL,NULL,NULL,'fe5e6dec-78e9-438d-9a22-762fcdc91ac2',673,NULL),(2464,NULL,'This assertion is supported by (PMID: 21663470, 25480661, 22072557, 22028477, 21910720, 22531170, 22210875, 23347903, 25120816, 26071465).','DIAGNOSTIC_IMPLICATION',NULL,_binary '\0',NULL,'2020-09-16 17:52:15',NULL,'LEVEL_Dx2',NULL,NULL,'565e1375-b008-47ab-9b14-5807616072fb',673,NULL),(2465,NULL,'The presence of a BRAF V600E mutation supports a diagnosis of [[tumor type]].','DIAGNOSTIC_SUMMARY',NULL,_binary '\0',NULL,'2025-04-16 17:05:19',NULL,NULL,NULL,NULL,'82098d7c-b495-46db-b841-ee584037f871',673,NULL),(2466,NULL,'Vemurafenib is an orally available kinse inhibitor of V600-mutant BRAF that is FDA-approved for treatment of patients with various BRAF V600-harboring tumors, including melanoma and Edheim-Chester Disease (ECD). Vemurafenib is listed as a 2A therapeutic in the NCCN guidelines for Hairy Cell Leukemia (HCL) based on data from two Phase II trials. In one study of vemurafenib in patients with BRAF V600E-mutant HCL (n=24), the overall response rate was 100%, with 42% of patients (10 of 24) having complete responses, with a response duration of 11.7 months and one year progression free and overall survival rates of 73% and 91%, repectively (PMID: 26352686). In another study of vemurafenib in patients with BRAF V600E-mutant HCL (n=26), the overall response rate was 96%, with 35% of patients (9 of 26) having complete responses (PMID: 26352686).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 16:40:00',NULL,'LEVEL_2','NO','LEVEL_3B','4e56b02d-394e-4397-9465-a3cc2c5026cd',673,NULL),(2467,NULL,'This assertion is supported by (PMID: 24938183, 20519626, 30157397, 26637772).','DIAGNOSTIC_IMPLICATION',NULL,_binary '\0',NULL,'2020-09-16 17:52:15',NULL,'LEVEL_Dx2',NULL,NULL,'97cde25b-b793-4cf6-b4e2-b787c0a398e9',673,NULL),(2468,NULL,'The presence of a BRAF V600E mutation supports a diagnosis of [[tumor type]].','DIAGNOSTIC_SUMMARY',NULL,_binary '\0',NULL,'2025-04-16 17:05:19',NULL,NULL,NULL,NULL,'086643d5-bb51-4e6d-815a-d39d2549d792',673,NULL),(2469,NULL,'The RAF inhibitor dabrafenib in combination with the MEK1/2 inhibitor trametinib is FDA-approved for the treatment of patients with BRAF V600E-mutant solid tumors.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2022-08-30 14:15:21',NULL,NULL,NULL,NULL,'114b09bd-f15e-4f71-a3dd-048c746b20c3',673,NULL),(2470,NULL,'The RAF inhibitor vemurafenib in combination with the MEK inhibitor cobimetinib is FDA-approved for patients with melanoma, non-small cell lung cancer, and anaplastic thyroid cancer, and is NCCN-compendium listed as recommended treatment of central nervous system cancers such as pilocytic astrocytoma, pleomorphic xanthoastrocytoma (PXA) and ganglioglioma. In a case series of two patients with BRAF V600E-mutant PXA, combination treatment of dabrafenib with trametinib led to partial responses by RANO criteria in both patients (PMID: 28984141). In a case report of a sixteen-year-old female with BRAF V600E-mutant anaplastic ganglioglioma, dabrafenib and trametinib in combination led to a significant response that was maintained at least six months after treatment initiation (PMID: 29380516). In a separate case report of a 28-year-old man with BRAF V600E-mutant anaplastic ganglioglioma, combination treatment of vemurafenib and cobimetinib led to a complete response after three months, with no evidence of recurrence after sixteen months of treatment (PMID: 30120137).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2023-02-15 16:41:32',NULL,'LEVEL_2','NO','LEVEL_3B','7f76d72e-ec85-4f42-91fe-b247dbe0e0e9',673,NULL),(2471,NULL,'The RAF-targeted inhibitor vemurafenib is FDA-approved for the treatment of patients with BRAF V600-mutant Erdheim-Chester Disease (ECD) and there is promising clinical data in patients with non-ECD BRAF V600E mutant histiocytic neoplasms treated with vemurafenib or dabrafenib as monotherapy.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2021-09-30 18:58:45',NULL,NULL,NULL,NULL,'92d5ed0f-6425-4b2b-9a75-b7f673840cee',673,NULL),(2472,NULL,'While the RAF-inhibitor dabrafenib in combination with the MEK1/2-targeted inhibitor trametinib is FDA-approved for the treatment of patients with BRAF V600E mutant solid tumors, the clinical utility of dabrafenib in combination with trametinib in patients with [[variant]] has yet to be defined.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2022-08-31 11:29:47',NULL,NULL,NULL,NULL,'215bd1c9-120d-4fc1-b906-5f317772b820',673,NULL),(2473,NULL,'The RAF inhibitor dabrafenib in combination with the MEK1/2 inhibitor trametinib is FDA-approved for the treatment of patients with BRAF V600E-mutant solid tumors.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2022-08-30 14:33:01',NULL,NULL,NULL,NULL,'06d6c080-3109-4164-9558-557d0f1d319f',673,NULL),(2474,NULL,'Selumetinib is a small molecule tyrosine kinase inhibitor of MEK1/2. In stratum one of the phase II PBTC study of selumetinib in 25 patients with pilocytic astrocytoma harboring a KIAA1549–BRAF fusion or BRAF V600E mutation, seven of eighteen patients with a KIAA1549–BRAF fusion had a partial response to treatment (PMID: 31151904). Additionally, the two year progression-free survival rate for the BRAF study population (n=25) was 70% (95% CI = 47–85) (PMID: 31151904).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 16:41:11',NULL,'LEVEL_2','NO','LEVEL_3B','9ae514fa-cea6-4a01-9f6e-ae9ca1a43049',673,NULL),(2475,NULL,'The RAF inhibitor dabrafenib in combination with the MEK1/2 inhibitor trametinib is FDA-approved for the treatment of patients with BRAF V600E-mutant solid tumors.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2022-08-30 14:02:21',NULL,NULL,NULL,NULL,'d9d2b475-f103-4960-a827-3a032f107402',673,NULL),(2476,NULL,'The RAF inhibitor vemurafenib in combination with the MEK inhibitor cobimetinib is FDA-approved for patients with BRAF V600E-positive melanoma, non-small cell lung cancer, and anaplastic thyroid cancer, and is NCCN-listed for patients with low-grade glioma, anaplastic glioma, and glioblastoma. Patients with various glioma subtypes harboring BRAF V600E mutations have shown responses to RAF and MEK inhibition. Three out of five patients with anaplastic astrocytoma had a response (one partial response, two stable disease) to vemurafenib monotherapy (PMID: 30351999). One patient with high-grade glioma (NOS) had stable disease in response to vemurafenib monotherapy (PMID:30351999). Four out of eight patients with glioma (NOS) had a response (one partial response, three stable disease, two progressive disease, two not evaluable) to vemurafenib monotherapy (PMID: 26287849). One patient with anaplastic oligoastrocytoma had stable disease in response to vemurafenib monotherapy (PMID: 30462564). Four of seven patients with glioblastoma multiforme had a response (one complete response, three stable disease, one progressive disease, two not evaluable) to vemurafenib monotherapy (PMID: 30351999, 24725538). Four patients with glioblastoma (including epithelioid glioblastoma) had a response (one “near-complete” response, three stable disease) to either dabrafenib monotherapy (n=2) or vemurafenib monotherapy (n=2) (PMID: 29621181, 29039591, 33117675, 34232949).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2023-02-15 16:39:14',NULL,'LEVEL_2','NO','LEVEL_3B','7b50f8a8-5662-4ad0-b63a-f2a0cf2c9fee',673,NULL),(2477,NULL,'The RAF inhibitor dabrafenib in combination with the MEK1/2 inhibitor trametinib is FDA-approved for the treatment of patients with BRAF V600E-mutant solid tumors.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2022-08-30 14:27:05',NULL,NULL,NULL,NULL,'5be59610-1305-4ace-a94c-30ef26d7523a',673,NULL),(2478,NULL,'The RAF inhibitor vemurafenib in combination with the MEK inhibitor cobimetinib is FDA-approved for patients with melanoma, non-small cell lung cancer, and anaplastic thyroid cancer, and is NCCN-listed for patients with low-grade glioma, anaplastic glioma, and glioblastoma. Patients with various glioma subtypes harboring BRAF V600E mutations have shown responses to RAF and MEK inhibition. Six patients with ganglioglioma had a partial response to either vemurafenib monotherapy (n=2), vemurafenib + cobimetinib (n=1), or dabrafenib monotherapy (n=​​3)(PMID: 25524464, 31985841, 26579623, 31502039). Twelve out of thirteen patients with pleomorphic xanthoastrocytoma had a response (one complete response, one “near-complete” response, six partial response, four stable disease) to either dabrafenib + trametinib (n=2) or vemurafenib monotherapy (n=11) (PMID: 28984141, 26287849, 30351999). Three patients with anaplastic pleomorphic xanthoastrocytoma had a response (one complete response, one “near-complete” response, one partial response) to either vemurafenib monotherapy (n=1) or dabrafenib monotherapy (n=2)(PMID: 25092772, 29039591). One patient with low-grade glioma, NOS had a partial response to dabrafenib monotherapy (PMID: 27398937). Two patients with pilocytic astrocytoma had a response (one partial response, one stable disease) to vemurafenib monotherapy (PMID: 30351999). Three of four patients with anaplastic ganglioglioma had a response (one partial response, one \"significant response\", one stable disease, one not evaluable) to either dabrafenib + trametinib (n=1) or vemurafenib monotherapy (n=3)(PMID: 29380516, 30351999). One patient with pilomyxoid astrocytoma had a partial response to vemurafenib monotherapy (PMID: 24821190).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2023-02-15 16:39:40',NULL,'LEVEL_2','NO','LEVEL_3B','8a864f31-163a-4868-bf67-6b1fc449a2c6',673,NULL),(2479,NULL,'The RAF inhibitor dabrafenib in combination with the MEK1/2 inhibitor trametinib is FDA-approved for the treatment of patients with BRAF V600E-mutant solid tumors.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2022-08-30 14:00:21',NULL,NULL,NULL,NULL,'26d2dac0-be4d-408b-9440-14131797c627',673,NULL),(2480,NULL,'Dabrafenib, an orally bioavailable RAF inhibitor, and trametinib, an orally bioavailable MEK1/2 inhibitor, are FDA-approved in combination for the treatment of patients with solid tumors other than colorectal harboring BRAF V600E mutation. FDA approval was based on data from 131 adult patients with solid tumors treated with dabrafenib and trametinib in the BRF117019 and NCI-MATCH trials and 36 pediatric patients treated with dabrafenib and trametinib in the CTMT212X2101 study. Of the 131 adult patients treated with dabrafenib and trametinib, the overall response rate was 41% (54/131; 95% CI = 33-50) and of the 36 pediatric patients treated with dabrafenib and trametinib (low-grade glioma, n=34; high-grade glioma, n=2), the overall response rate was 25% (95% CI = 12-24) (PMID: 32818466, 34838156, 32758030)(Abstract: Bouffet et al. Abstract# LGG-49, Neuro-Oncology 2020. https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7715318/). Approval was supported by results in COMBI-d, COMBI-v and BRF113928 studies in melanoma and lung cancer (PMID: 23020132, 25399551, 27283860). In the Phase II ROAR basket trial of dabrafenib + trametinib in patients with BRAF V600E-mutated rare cancers (biliary tract cancer, n=43), the overall response rate was 53%, the median progression-free survival was nine months (95% CI = 5.5, 9.4) and the median overall survival was 13.5 months (95% CI = 10.4, 17.6) (PMID: 37059834). Of the 43 patients with biliary tract cancer, 53% of patients (23/43) had a partial response and 37% (16/43) had stable disease (PMID: 37059834). Additionally, in subprotocol H of the NCI-MATCH basket trial of dabrafenib + trametinib in patients with BRAF V600E-mutant solid tumors (n=4 patients with intrahepatic cholangiocarcinoma), the overall response rate was 100%, with 4/4 patients achieving a partial response (PMID: 32758030).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-05-23 18:30:56',NULL,'LEVEL_1','NO','LEVEL_3B','6d286407-4acf-4feb-9649-472fbb1b95fe',673,NULL),(2481,NULL,'The RAF inhibitor dabrafenib in combination with the MEK1/2 inhibitor trametinib is FDA-approved for the treatment of patients with BRAF V600E-mutant solid tumors.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2022-08-30 14:36:04',NULL,NULL,NULL,NULL,'a1317432-a427-476c-86f1-84c15b50d5c5',673,NULL),(2482,NULL,'Dabrafenib, an orally bioavailable RAF inhibitor, and trametinib, an orally bioavailable MEK1/2 inhibitor, are FDA-approved in combination for the treatment of patients with solid tumors other than colorectal harboring BRAF V600E mutation. FDA approval was based on data from 131 adult patients with solid tumors treated with dabrafenib and trametinib in the BRF117019 and NCI-MATCH trials and 36 pediatric patients treated with dabrafenib and trametinib in the CTMT212X2101 study. Of the 131 adult patients treated with dabrafenib and trametinib, the overall response rate was 41% (54/131; 95% CI = 33-50) and of the 36 pediatric patients treated with dabrafenib and trametinib (low-grade glioma, n=34; high-grade glioma, n=2), the overall response rate was 25% (95% CI = 12-24) (PMID: 32818466, 34838156, 32758030)(Abstract: Bouffet et al. Abstract# LGG-49, Neuro-Oncology 2020. https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7715318/). In the randomized, Phase II study of dabrafenib and trametinib in 110 patients with BRAF V600–mutant pediatric low-grade glioma (dabrafenib + trametinib treatment, n=37; carboplatin + vincristine treatment, n=37), the overall response rate was 47% (95% CI= 35%-59%) with dabrafenib and trametinib and 11% (95% CI= 3%-25%) with carboplatin and vincristine, and the progression-free survival was 20.1 months (95% CI= 12.8 mo-not estimable) with dabrafenib and trametinib and 7.4 months (95% CI= 3.6-11.8 mo) with carboplatin and vincristine (Abstract: Bouffet et al. Abstract# LBA2002, ASCO 2022. https://ascopubs.org/doi/abs/10.1200/JCO.2022.40.17_suppl.LBA2002). FDA approval was supported by results in COMBI-d, COMBI-v and BRF113928 studies in melanoma and lung cancer (PMID: 23020132, 25399551, 27283860).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 16:35:41',NULL,'LEVEL_1','NO','LEVEL_3B','6d039136-d681-4915-a342-16e424f5e42c',673,NULL),(2483,NULL,'The pan-RAF kinase inhibitor tovorafenib is FDA-approved for the treatment of patients 6 months of age and older with BRAF V600-mutant pediatric low-grade glioma. Additionally, the RAF inhibitor dabrafenib in combination with the MEK1/2 inhibitor trametinib is FDA-approved for the treatment of patients 1 year of age and older with BRAF V600E-mutant pediatric low-grade glioma.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2024-06-21 09:55:51',NULL,NULL,NULL,NULL,'65384f19-67f6-4187-a4e9-b0e67c0d2d44',673,NULL),(2484,NULL,'Dabrafenib, a small molecule RAF inhibitor, and trametinib, a small molecule MEK1/2 inhibitor, are FDA-approved in combination for the treatment of pediatric patients 1 year of age and older with low-grade glioma (LGG) with a BRAF V600E mutation who require systemic therapy. FDA approval is based on the results of the Phase II Study CDRB436G2201 (NCT02684058) of dabrafenib plus trametinib versus carboplatin plus vincristine in 110 patients with BRAF V600-mutant LGG, as assessed by local or central laboratory tests. In the Phase II Study CDRB436G2201 (NCT02684058), the dabrafenib plus trametinib cohort (n=73 [n=70, V600E; n=3, other]) demonstrated an overall response rate (ORR) of 47% (95% CI=35-59), with a 3% (n=2) complete response (CR) rate, a 44% (n=32) partial response (PR) rate and a 41% (n=30) stable disease (SD) rate, and a median duration of response (DOR) of 20.3 months (95% CI=12.0-NE) while the chemotherapy cohort (n=37 [n=35, V600E; n=1, other; n=1, nonmutant]) demonstrated an ORR of 11% (95% CI=3-25) (OR=7.19 [95% CI=2.30-22.40]; RR=4.31 [95% CI=1.70-11.20]; p<0.001), with a 3% (n=1) CR rate, an 8% (n=3) PR rate and a 41% (n=15) SD rate, and a median DOR that was not estimable (95% CI=6.6-NE) (PMID: 37733309).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2024-06-21 09:49:51',NULL,'LEVEL_1','NO','LEVEL_3B','8d8631fe-755f-4d9a-a505-578963eb0f4d',673,NULL),(2485,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'f48ceb40-9fac-4681-90d7-163ed51dd6e2',673,NULL),(2486,NULL,'The class II BRAF L597S mutation is located in the kinase domain of the protein (PMID: 33019809). This mutation has been found in melanoma, among other cancers (PMID: 26643848). In vitro studies have demonstrated that this mutation is likely activating as measured by increased downstream signaling compared to wildtype (PMID: 22798288). Drug efficacy studies in cell lines demonstrated that the BRAF L597S mutation might be sensitive to the RAF inhibitor vemurafenib and the MEK inhibitor trametinib (PMID: 22798288). The BRAF L597S mutation has also been identified in patients with positive responses to trametinib, the allosteric MEK inhibitor TAK-733 and combined dabrafenib and trametinib treatment (PMID: 24933606, 22798288, 29903896).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-08 15:57:49',NULL,NULL,NULL,NULL,'bd08e589-0a0b-4ff9-b514-fe3fe1d84f30',673,NULL),(2487,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2018-08-17 14:01:34',NULL,NULL,NULL,NULL,'68016989-6e6d-4221-98d3-238110b00ac6',673,NULL),(2488,NULL,'The class II BRAF K601E mutation is located in the kinase domain in exon 15 of the protein (PMID: 28783719, 26343582). This mutation is recurrent in melanoma (PMID: 22798288, 26643848). Biological characterization of BRAF K601E mutations demonstrated that they activate the downstream MAPK pathway independently of RAS and render BRAF active as a dimer with CRAF and itself (PMID: 22798288, 20179705, 26343582). Preclinical studies with patient-derived xenograft models of colorectal cancer expressing BRAF K601E demonstrated sensitivity to treatment with PLX8394 with or without cetuximab as measured by reduced tumor growth, and resistance to treatment with cetuximab and vemurafenib as measured by no reduction in tumor growth upon treatment (PMID: 30559419, 31515458). A patient with metastatic BRAF K601E-mutated melanoma achieved a complete response to the MEK inhibitor trametinib (PMID: 28344857). In a case report, a patient with lung adenocarcinoma harboring BRAF K601E was treated with a combination therapy of dabrafenib plus trametinib and demonstrated partial response with a progression-free survival of nine months (PMID: 34590045). In another case report, a patient with papillary thyroid carcinoma harboring BRAF K601E was treated with a combination therapy of sorafenib plus denosumab and demonstrated a complete response (PMID: 35630083). In a Phase II trial, a patient with melanoma harboring BRAF K601E was treated with trametinib and demonstrated partial response with a progression-free survival of 32 weeks (PMID: 23248257). In another Phase II trial, six patients with advanced solid tumors harboring BRAF K601E were treated with vemurafenib and did not clinically respond to treatment (PMID: 29320312). In a Phase I trial, two patients with melanoma harboring BRAF K601E were treated with dabrafenib and did not clinically respond to treatment (PMID: 22608338).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 18:29:35',NULL,NULL,NULL,NULL,'9b64a01a-fe4a-4764-bb83-50a7dddc2093',673,NULL),(2489,NULL,'The RAF-targeted inhibitor vemurafenib is FDA-approved for the treatment of patients with BRAF V600-mutant Erdheim-Chester disease.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2019-08-22 12:26:19',NULL,NULL,NULL,NULL,'39484c36-282c-4392-909d-cd9ab20724df',673,NULL),(2490,NULL,'Vemurafenib is an orally available, small molecule RAF-targeted inhibitor that is FDA-approved for the treatment of patients with Erdheim-Chester disease (ECD) with BRAF V600 mutation. FDA approval was based on the results of the Phase II VE-BASKET (NCT01524978) trial of vemurafenib in 26 patients with BRAF V600-mutant non-melanoma cancers (n=22, ECD; n=4, Langerhans cell histiocytosis [LCH]).\nIn the Phase II VE-BASKET (NCT01524978) trial, the ECD cohort demonstrated an overall response rate of 54.5% (12/22) (95% CI=32.2-75.6), with one patient (4.5%) achieving complete response and eleven patients (50%) achieving partial response, and the median progression-free survival and overall survival were not reached (PMID: 29188284, 26287849).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2025-03-13 16:26:24',NULL,'LEVEL_1','NO','NO','729d93d7-aa18-4bf0-9c84-13b9ecce25fb',673,NULL),(2491,NULL,'The RAF-targeted inhibitors vemurafenib and dabrafenib are NCCN-listed as monotherapy for the treatment of BRAF V600E-mutant Langerhans Cell Histiocytosis and vemurafenib is FDA-approved for the treatment of BRAF V600-mutant Erdheim Chester Disease.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2021-10-01 11:54:06',NULL,NULL,NULL,NULL,'b1acc1d7-c638-4217-a6e4-986b99f66f0a',673,NULL),(2492,NULL,'Vemurafenib is an orally available, small molecule RAF-targeted inhibitor that is FDA-approved for the treatment of patients with Erdheim-Chester disease (ECD) with BRAF V600 mutation. Vemurafenib and dabrafenib are listed as monotherapies in the NCCN Histiocytic Neoplasms Guidelines (V3.2024) under the section \"Principles of Systemic Therapy\" as recommended treatment regimens for patients with Langerhans cell histiocytosis (LCH) harboring BRAF V600E mutations. NCCN recommendation was based on the results of the Phase II VE-BASKET (NCT01524978) and case reports.\nIn the Phase II VE-BASKET (NCT01524978) trial, all four patients of the LCH cohort achieved partial response (PMID: 29188284). In the case series evaluating the use of BRAF inhibitors in six adult patients with BRAF V600E‐mutant LCH, patients treated with vemurafenib monotherapy (n=3) achieved one complete response (CR), one partial response (PR) and one stable disease (SD) response while patients treated with dabrafenib monotherapy (n=3) achieved one CR and two PRs (PMID: 32985015). In a separate case report, a patient with BRAF V600E-mutant LCH was treated with dabrafenib plus trametinib and demonstrated a sustained metabolic response (PMID: 30154124).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2025-03-13 16:44:27',NULL,'LEVEL_2','NO','NO','a0a7271e-c46e-43b8-8f85-7e1418192d6c',673,NULL),(2493,NULL,'The FDA-approved RAF-inhibitors dabrafenib and vemurafenib have minimal activity as single agents in BRAF V600-mutant colorectal cancer (CRC). The triplet therapy combination of encorafenib + binimetinib + cetuximab, a RAF-inhibitor, a MEK-inhibitor and an anti-EGFR antibody respectively, is NCCN-compendium listed and has received FDA-breakthrough therapy designation for the treatment of patients with BRAF V600E mutant colorectal cancer.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2019-08-22 14:11:38',NULL,NULL,NULL,NULL,'8d714d43-7ccc-416f-99b8-4f49cc046590',673,NULL),(2494,NULL,'The RAF-targeted inhibitors encorafenib, dabrafenib and vemurafenib, alone or in combination with the MEK1/2-targeted inhibitors binimetinib, trametinib and cobimetinib respectively, are FDA-approved for the treatment of patients with BRAF V600E/K mutant melanoma and NCCN-compendium listed for the treatment of patients with BRAF V600-mutant melanoma. Additionally, the anti-PD-L1 antibody atezolizumab in combination with cobimetinib + vemurafenib is FDA-approved for the treatment of patients with unresectable or advanced BRAF V600-mutant melanoma.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2020-08-24 16:58:52',NULL,NULL,NULL,NULL,'49c8da54-77d7-4480-af56-bd58072c54c0',673,NULL),(2495,NULL,'The combination of vemurafenib, an inhibitor of V600-mutant BRAF, and cobimetinib, an inhibitor of MEK1/2, with atezolizumab, an immunotherapeutic PD-L1 antibody, is FDA-approved for patients with BRAF V600 mutation-positive unresectable or metastatic melanoma. FDA approval was based on the results of the Phase III double-blind, randomized, placebo-controlled IMspire150 trial of Atezolizumab + Cobimetinib + Vemurafenib versus Placebo + Cobimetinib + Vemurafenib in 514 patients with BRAF V600-mutant melanoma in which the median progression-free survival was 15.1 mos (95% CI=11.4,18.4) in the triplet arm versus 10.6 mos (95% CI=9.3,12.7) in the doublet + placebo arm (HR=0.78; 95% CI= 0.63, 0.97; p=0.0249) (PMID: 32534646).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 14:56:33',NULL,'LEVEL_1','NO','LEVEL_3B','2e0a9edd-9248-4da3-b5f8-acdfe19039d6',673,NULL),(2496,NULL,'While the RAF-targeted inhibitor dabrafenib in combination with the MEK1/2-targeted inhibitor trametinib is FDA-approved for the treatment of patients with BRAF V600E mutant non-small cell lung cancer (NSCLC), this combination is not specifically approved for the treatment of patients with BRAF [[mutation]] mutant NSCLC.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2019-12-18 13:32:08',NULL,NULL,NULL,NULL,'593f072b-2d62-4436-c06f-1d01f05298a8',673,NULL),(2497,NULL,'While the anti-PD-L1 antibody atezolizumab is FDA-approved in combination with the MEK1/2-targeted inhibitor cobimetinib and the RAF-targeted inhibitor vemurafenib for the treatment of patients with BRAF V600-mutant melanoma, and the pan-RAF kinase inhibitor tovorafenib is FDA-approved for the treatment of patients with BRAF V600-mutant pediatric low-grade glioma, the clinical utility of RAF- and MEK-targeted inhibitors (alone or in combination) in patients with [[variant]] is unknown.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2024-04-30 12:19:23',NULL,NULL,NULL,NULL,'822ab686-6d4b-4605-8133-9387af0a4fbc',673,NULL),(2498,NULL,'The RAF-targeted inhibitor vemurafenib is FDA-approved for the treatment of patients with BRAF V600-mutant Erdheim-Chester Disease (ECD) and there is promising clinical data in patients with non-ECD BRAF V600-mutant histiocytic neoplasms treated with vemurafenib or dabrafenib as monotherapy.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2021-10-05 11:03:34',NULL,NULL,NULL,NULL,'86fce41b-4b83-4bff-9d45-d96ea3767cde',673,NULL),(2499,NULL,'Vemurafenib is an orally available, small molecule RAF-targeted inhibitor that is FDA-approved for the treatment of patients with Erdheim-Chester disease (ECD) with BRAF V600 mutation. Vemurafenib and dabrafenib are listed as monotherapies in the NCCN Histiocytic Neoplasms Guidelines (V3.2024) under the section \"Principles of Systemic Therapy\" as recommended treatment regimens for patients with ECD and Langerhans cell histiocytosis (LCH) harboring BRAF V600E mutations. There is promising clinical data to support the use of vemurafenib and dabrafenib as monotherapies in patients with non-ECD and non-LCH BRAF V600-mutant histiocytic neoplasms.\nIn a case study, a patient with heterozygous BRAF V600E-mutant histiocytic sarcoma was treated with vemurafenib and maintained both clinical and radiologic tumor responses for three months until disease progression (PMID: 25209580). In a second case study, a patient with BRAF V600E-mutant histiocytic sarcoma was treated with vemurafenib plus chemotherapy, antibiotics and steroids and remained in complete remission eighteen months after treatment initiation (PMID: 31376203). In a third case study, a pediatric patient with BRAF V600E-mutant mixed systemic Rosai-Dorfman-Destombes disease and LCH reported sustained clinical and radiographic responses after treatment with dabrafenib prior to disease relapse at thirteen months (PMID: 31213430).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2025-03-13 16:05:44',NULL,'LEVEL_3A','NO','NO','ccfa69b9-f284-427a-84b5-a4ffcc5606ca',673,NULL),(2500,NULL,'The pan-RAF kinase inhibitor tovorafenib is FDA-approved for the treatment of patients 6 months of age and older with BRAF V600-mutant pediatric low-grade glioma.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2024-04-26 14:19:32',NULL,NULL,NULL,NULL,'e3ed11df-cbf0-485f-9065-af982e6282ce',673,NULL),(2501,NULL,'Tovorafenib is an orally available, pan-RAF small molecule inhibitor that is FDA-approved for the treatment of pediatric patients six months of age and older with relapsed or refractory pediatric low-grade glioma (LGG) harboring a BRAF fusion or rearrangement, or BRAF V600 mutation. FDA approval was based on the results of the Phase II FIREFLY-1 (NCT04775485) trial of tovorafenib in 76 patients (median age=8 years old [range=2-21]) with relapsed or refractory pediatric LGG harboring an activating BRAF alteration based on local laboratory testing. In the Phase II FIREFLY-1 (NCT04775485) trial, the overall RAPNO-LGG cohort demonstrated an objective response rate (ORR) of 51% (95% CI=40-63), with a 37% (n=28) partial response rate and 14% (n=11) minor response rate, a median duration of response (DOR) of 13.8 months (95% CI=11.3-NE) in 39 patients and a median progression-free survival of 13.8 months (95% CI=8.3-16.9) (PMID: 37978284). The BRAF V600E mutation subcohort (n=12) demonstrated an ORR of 50% (95% CI=21-79) and a median DOR that was not evaluable (95% CI=8.4-NE) (PMID: 37978284).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2024-04-26 14:17:11',NULL,'LEVEL_1','NO','LEVEL_3B','365e9c4e-bc1b-490c-98f7-f122d9504f66',673,NULL),(2502,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'fa5603f0-2ef7-43cf-aeb2-daf1793b84ee',673,NULL),(2503,NULL,'The class I (PMID: 28783719) activating exon 15 BRAF V600K missense mutation is located in the kinase domain of the BRAF protein. BRAF V600 alterations (predominantly V600E) are recurrent in lung (PMID: 25079552, 23833300) and thyroid (PMID: 25417114) cancers, among others. In metastatic melanoma, frequency of V600K mutation is second only to V600E, the most common BRAF alteration (PMID: 26091043). Analysis of clinicopathologic features and outcome in patients with metastatic melanoma harboring activating BRAF mutations revealed that, compared to V600E, V600K mutation was significantly associated with male sex, older age (median age, head/neck primary tumor location, shorter interval to stage IV disease, and shorter overall survival from the time of diagnosis of stage IV disease (PMID: 23922205, 22535154). Comprehensive biological characterization of BRAF V600K mutation (PMID: 15035987, 26343582) has demonstrated that this mutation activates the downstream MAPK pathway independently of RAS (PMID: 19251651, 26343582), renders BRAF constitutively activated in monomeric form (PMID: 20179705) and retains sensitivity to RAF monomer inhibitors such as vemurafenib (PMID: 26343582, 28783719, 20179705). Preliminary studies suggest that BRAF V600K mutant tumors may not respond to combined BRAF and MEK inhibition as well as BRAF V600E tumors due to a decreased reliance on the MAPK pathway, though further studies are needed to validate this finding (PMID: 30630828).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2019-03-05 19:00:20',NULL,NULL,NULL,NULL,'7f32379e-0513-4cd5-aa97-bf5ebcb9f2fe',673,NULL),(2504,NULL,'The RAF-targeted inhibitors encorafenib, dabrafenib and vemurafenib alone or in combination with the MEK-targeted inhibitors binimetinib, trametinib and cobimetinib, respectively, are FDA-approved for the treatment of patients with BRAF V600E/K mutant melanoma.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2019-08-22 14:16:21',NULL,NULL,NULL,NULL,'603dab24-2e01-4179-a0ac-cff1fe8c81ca',673,NULL),(2505,NULL,'While the RAF-targeted inhibitor dabrafenib in combination with the MEK1/2-targeted inhibitor trametinib is FDA-approved for the treatment of patients with BRAF V600E mutant non-small cell lung cancer (NSCLC), this combination is not specifically approved for the treatment of patients with BRAF V600K mutant NSCLC. However, laboratory data demonstrate that cells expressing BRAF V600K respond similarly to dabrafenib + trametinib as cells with BRAF V600E, and patients with BRAF V600K mutant melanoma derived similar clinical benefit to dabrafenib + trametinib as those with BRAF V600E.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2019-12-17 17:00:05',NULL,NULL,NULL,NULL,'33bea22d-cd06-4a27-95d1-23125badb1f6',673,NULL),(2506,NULL,'While the MEK1/2-targeted inhibitor trametinib, alone or in combination with the RAF-targeted inhibitor dabrafenib, and the MEK-targeted inhibitor cobimetinib in combination with the RAF-targeted inhibitor vemurafenib are FDA-approved for the treatment of patients with BRAF V600K mutant melanoma, their clinical utility in patients with [[variant]] has yet to be defined.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2019-08-22 14:17:06',NULL,NULL,NULL,NULL,'5719cd2c-bf51-496f-9d5f-287583907e50',673,NULL),(2507,NULL,'Dabrafenib, an orally bioavailable RAF inhibitor, and trametinib, an orally bioavailable MEK1/2 inhibitor, are FDA-approved alone or in combination for the treatment of patients with metastatic melanoma harboring a V600E or V600K BRAF mutation. FDA approval of dabrafenib in combination with trametinib was based on results from an open-label Phase III study of combination therapy versus dabrafenib monotherapy in 247 patients with metastatic melanoma who were naive to treatment with BRAF inhibitors. Combined dabrafenib and trametinib, administered in full monotherapy doses, improved the response rate in patients with BRAF V600-mutant metastatic melanoma versus dabrafenib monotherapy (67% vs.51%; p<0.002). However, median progression-free survival improved by only 2 weeks (9.3 months vs 8.8 months; HR = 0.75) compared with dabrafenib monotherapy (PMID: 23020132). Combination therapy is associated with less cutaneous toxicity than monotherapy, but systemic toxicity may be increased (PMID: 25287827, 25399551). Follow-up trials have demonstrated that all clinical measures inclusive of overall and median progression-free survival as well as objective response rates, median duration of response and number of patients with complete response favored patients treated with combination dabrafenib and trametinib, administered in full monotherapy doses, compared to either dabrafenib or vemurafenib monotherapy, including patients who previously progressed on BRAF inhibitor monotherapy (PMID: 25287827, 25399551, 25265492). Additionally, patients with melanoma treated with dabrafenib and trametinib in both the neoadjuvant and adjuvant settings have improved survival over patients given standard of care (PMID: 29361468, 28991513, 28891408). Promising clinical data has also suggested that addition of an immunotherapy agent to combination RAF and MEK inhibitor treatment may improve rate of overall response and duration of response in melanoma patients (PMID: 31171876, 31171879, 31171878).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 16:53:07',NULL,'LEVEL_1','NO','LEVEL_3B','bc28ec2e-60ae-4a5d-9401-524e357b5bed',673,NULL),(2508,NULL,'Trametinib is an oral small molecule inhibitor of MEK1/2 that is FDA-approved alone or with dabrafenib for the treatment of patients with metastatic melanoma harboring a V600E or V600K BRAF mutation. In an open-label, randomized Phase III trial, patients with BRAF V600E/K-mutated unresectable, metastatic melanoma received oral trametinib (2 mg once daily) or an intravenous regimen of either dacarbazine (1000 mg/m2) or paclitaxel (175 mg/m2) every three weeks. Trametinib demonstrated improved progression-free survival (HR for disease progression or death = 0.45) and six-month overall survival (81% vs. 67%; death HR = 0.54; p=0.01) (PMID: 22663011). However, like other MEK inhibitors, the benefit of trametinib is limited by adverse reactions, most notably grade three or four rash and diarrhea (PMID: 22663011). Trametinib is not typically used as monotherapy for patients with BRAF V600K melanoma given its lower response rate compared to BRAF inhibitors and combined BRAF and MEK inhibitors. Patients previously treated with a RAF inhibitor appear to be less likely than untreated patients to respond to trametinib treatment (PMID: 22663011), and FDA guidelines state that trametinib as a monotherapy is not indicated for these patients. Dabrafenib and trametinib are FDA-approved as a combination therapy, which has superior clinical outcomes compared to dabrafenib or trametinib monotherapy (PMID: 25399551, 25265492). Additionally, patients with melanoma treated with dabrafenib and trametinib in both the neoadjuvant and adjuvant settings had improved survival over patients given standard of care (PMID: 29361468).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 16:52:56',NULL,'LEVEL_1','NO','LEVEL_3B','873eaae0-4bf1-4d6d-a312-f8ff9770f393',673,NULL),(2509,NULL,'The RAF inhibitor vemurafenib in combination with the MEK inhibitor cobimetinib is FDA-approved for the treatment of patients with BRAF V600-mutant metastatic or unresectable locally advanced melanoma. FDA approval was based on results from the randomized Phase III coBRIM trial of combined vemurafenib and cobimetinib versus vemurafenib and placebo in 495 patients with metastatic BRAF V600-mutant melanoma that demonstrated superior clinical benefit measures in the combination versus the control arm. Specifically, median progression-free survival was 9.9 months in the combination arm versus 6.2 months in the control arm (HR = 0.51), with a complete response rate of 10% versus 4%, respectively, and interim nine-month overall survival of 81% versus 73%, respectively (PMID: 25265494). Follow-up analysis of the coBRIM trial showed two-year overall survival was 48.3% in the combination group versus 38.0% in the monotherapy group (PMID: 27480103), and five-year followup of the BRIM7 study showed a median overall survival of 31.8 months and a five-year survival rate of 39.2% (PMID: 31732523).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 16:41:59',NULL,'LEVEL_1','NO','LEVEL_3B','19caa107-e92a-4246-9d01-6d707b9ecd4e',673,NULL),(2510,NULL,'The combination of encorafenib, an inhibitor of V600E- or V600K-mutant BRAF, and binimetinib, an inhibitor of MEK1/2, is FDA-approved in combination for patients with unresectable or metastatic melanoma with a BRAF V600E or V600K mutation. FDA approval was based on the results of the Phase III COLUMBUS trial of combined encorafenib plus binimetinib versus single-agent vemurafenib in 577 patients with BRAF V600E- or V600K-mutant metastatic melanoma in which the median progression-free survival was 14.9 months (95% CI = 11.0-18.5) in the encorafenib plus binimetinib group versus 7.3 months (95% CI = 5.6-8.2) in the single agent vemurafenib group (HR= 0.54, 95% CI = 0.41-0.71; p<0·0001) (PMID: 29573941). In the five-year update of the Phase III COLUMBUS trial, the progression-free survival and overall survival were 23% and 35% respectively in the encorafenib plus binimetinib group (n=192) versus 10% and 21% respectively in the single agent vemurafenib group (n=191), and the median duration of response and disease control rate were 18.6 months and 92.2% in the encorafenib plus binimetinib group versus 12.3 months and 81.2% in the single-agent vemurafenib group (PMID: 35862871).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 16:42:13',NULL,'LEVEL_1','NO','LEVEL_3B','b76c8407-558c-49e9-ab3c-90a181df0044',673,NULL),(2511,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'dc31c7a1-bb00-4f06-975e-5b2fc013f800',673,NULL),(2512,NULL,'The class I activating exon 15 BRAF V600D mutation is located in the kinase domain of the protein (PMID: 28783719). This mutation is recurrent in melanoma (PMID: 26091043, 23579220, 22614978). Comprehensive biological characterization of the BRAF V600D mutation has demonstrated that this mutation activates the downstream MAPK pathway independently of RAS and renders BRAF constitutively activated in monomeric form (PMID: 15035987, 12068308, 19251651, 26343582, 20179705). Preclinical studies with melanoma cells expressing BRAF V600D demonstrate sensitivity to treatment with CCT196969, CCT241161, AZ628, TAK-632, PLX7904, vemurafenib, dabrafenib, ASTX029 and cobimetinib plus HM95573 as measured by inhibition of MEK and ERK phosphorylation and cellular proliferation (PMID: 25500121, 17210691, 27523909, 33953400, 34330842). In a case report, a patient with pilocytic astrocytoma harboring BRAF V600D was treated with single-agent dabrafenib then subsequently treated with combination therapy of dabrafenib plus trametinib and demonstrated stable disease (PMID: 28784858). In a Phase II trial, a patient with non-small cell lung cancer harboring BRAF V600D was treated with vemurafenib and demonstrated partial response with a progression-free survival of 3.8 months (PMID: 31959346).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 18:32:10',NULL,NULL,NULL,NULL,'2d9f29be-c010-4fd7-8bf1-724be975d211',673,NULL),(2513,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'67171333-e67d-4efb-b109-1ec059584108',673,NULL),(2514,NULL,'The class I activating exon 15 BRAF V600R missense mutation is located in the kinase domain of the BRAF protein (PMID: 28783719). BRAF V600R is the third most common mutation occurring in 5-7% of patients with BRAF-mutant melanoma (PMID: 22536370, 23237741, 22614978). Comprehensive biological characterization of the BRAF V600R mutation has demonstrated that this mutation activates the downstream MAPK pathway independently of RAS and renders BRAF constitutively activated in monomeric form (PMID: 15035987, 28783719, 26343582, 20179705). Preclinical studies with melanoma cells expressing BRAF V600R demonstrate sensitivity to treatment with AZ628, TAK-632, PLX7904, vemurafenib and dabrafenib as measured by inhibition of cellular proliferation (PMID: 27523909). In a case report, a patient with melanoma harboring BRAF V600R was treated with a combination therapy of dabrafenib plus trametinib and demonstrated partial response with a progression-free survival of 52.2 months (PMID: 36039514). In another case report, a patient with melanoma harboring BRAF V600R was treated with dabrafenib and demonstrated partial response with lesion reduction and progression-free survival of seven months (PMID: 27255157).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 18:33:40',NULL,NULL,NULL,NULL,'12d0ecbc-50f2-4179-b883-236acf79ec53',673,NULL),(2515,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'fe0fcc32-3e63-485c-9c5c-e71282f366da',673,NULL),(2516,NULL,'The class I (PMID: 28783719) activating exon 15 BRAF V600G mutation is located in the kinase domain of the protein. This mutation has been found in cardio-facio-cutaneous syndrome (CFC), lung cancer and esophagogastric cancer (PMID: 26287849). Substitutions at position V600 of BRAF, including the common BRAF V600E mutation, are known to be activating and oncogenic (PMID: 12068308, 16273091, 15035987). Expression of this mutation in 293T cells demonstrated that this mutation is activating as measured by increased downstream ERK activation and increased transcription of downstream MAPK pathway transcriptional targets (e.g. ELK) compared to wildtype BRAF (PMID: 20735442). A patient with non-small cell lung cancer (NSCLC) harboring the BRAF V600G mutation had stable disease in response to treatment with vemutafenib, while a patient with sarcoma and a patient with esophagogastric cancer both harboring the BRAF V600G mutation had progressive disease in response to vemurafenib (PMID: 26287849).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2017-09-27 11:03:34',NULL,NULL,NULL,NULL,'aa1b3f05-546a-4bd5-a85e-9f826728ce4d',673,NULL),(2517,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2021-12-28 10:31:16',NULL,NULL,NULL,NULL,'1e543634-e853-4b7c-b61e-76537ae06c5c',673,NULL),(2518,NULL,'The BRAF V600M mutation is located in the BRAF kinase domain. This mutation has been found in melanoma (PMID: 25382067, 22536370). In vitro studies have demonstrated that this mutation, similar to other class 1 BRAF V600 mutations, activates the downstream MAPK pathway independent of RAS, as measured by increased levels of phosphorylated MEK and decreased RAS-GTP in V600E mutant cells compared to wildtype (PMID: 26343582, 28783719). The BRAF V600M mutation renders BRAF constitutively activated in monomeric form and is sensitive to inhibition by vemurafenib (PMID: 28783719, 25382067, 26343582). However, It is unknown whether the BRAF V600M mutation actually arises in cancer as noted by several studies (PMID: 22536370, 23579220, 25382067) or previous sequencing studies miscalled a V600R dinucleotide change (chromosome 7: position 140453136 AC > CT) as a single nucleotide change (chromosome 7: position 140453137 C >T).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2021-12-28 10:31:15',NULL,NULL,NULL,NULL,'838d4e27-f794-42e0-8f8e-d6b4955c1b4e',673,NULL),(2519,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'af609f8b-ee1e-4ff5-a363-2327464330ab',673,NULL),(2520,NULL,'The class II BRAF L597R mutation is located in the kinase domain of the protein (PMID: 33019809). This mutation has been found in melanoma, among other cancers (PMID: 26643848). In vitro studies have demonstrated that this mutation is likely activating as measured by increased downstream signaling compared to wildtype (PMID: 22798288). Drug efficacy studies in cell lines demonstrated that the BRAF L597R mutation might be sensitive to the RAF inhibitor vemurafenib and the MEK inhibitor trametinib (PMID: 22798288). The BRAF L597R mutation has also been identified in patients with positive responses to trametinib and the allosteric MEK inhibitor TAK-733 (PMID: 24933606). In a case report, a patient with melanoma harboring BRAF L597R was treated with vemurafenib and demonstrated partial response with 30% growth inhibition of skin and lung nodules (PMID: 23715574). In another case report, a patient with lung adenocarcinoma harboring BRAF L597R was treated with a combination therapy of dabrafenib and trametinib and demonstrated partial response with a progression-free survival of twelve months (PMID: 32540409). In another case report, a patient with colorectal cancer harboring BRAF L597R was treated with a combination therapy of panitumumab plus FOLFIRI and demonstrated stable disease with a progression-free survival of 16.5 months (PMID: 31515458).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-09 18:35:08',NULL,NULL,NULL,NULL,'57225720-7b20-42b8-aed1-561e9d1a6922',673,NULL),(2521,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'d138d84d-4bcf-4d28-a586-c09e8fcd6c80',673,NULL),(2522,NULL,'The class II BRAF L597V mutation is located in the kinase domain in exon 15 of the protein (PMID: 28783719, 26343582). This mutation is recurrent in melanoma (PMID: 12068308, 15035987, 26643848). Biological characterization of BRAF L597V mutation demonstrated that it activates the downstream MAPK pathway independent of RAS and renders BRAF active as a dimer with CRAF and itself (PMID: 12068308, 15035987, 22798288, 26343582, 28783719, 20179705). Preclinical studies with patient-derived lung adenocarcinoma cells expressing BRAF L597V demonstrated sensitivity to treatment with dabrafenib plus trametinib, trametinib, BGB-283 and LXH 254, as measured by cellular proliferation inhibition, and resistance to treatment with dabrafenib, encorafenib, vemurafenib, TAK-580, LY3214996, MK-8353, GDC-0994 and BVD-523, as measured by sustained cellular proliferation upon drug treatment (PMID: 32540409). In a Phase II trial, a patient with endometrial adenocarcinoma harboring BRAF L597V was treated with trametinib and demonstrated stable disease with a progression-free survival of 7.9 months (PMID: 31924734).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 18:36:20',NULL,NULL,NULL,NULL,'a9e6b8b3-d1fb-4685-a5ec-78811f7bb602',673,NULL),(2523,NULL,'There is promising clinical data in patients with BRAF L597-mutant melanoma treated with the FDA-approved MEK-targeted inhibitor trametinib.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2019-08-22 12:14:20',NULL,NULL,NULL,NULL,'30a2e81e-265e-4103-ab0b-30bc2e3da638',673,NULL),(2524,NULL,'Trametinib is a small-molecule inhibitor of the MEK1/2 kinases that is FDA-approved in combination with a RAF inhibitor for use in BRAF V600E-positive metastatic melanoma. \nIn a Phase II (NCT02296112) trial of trametinib in patients with non-BRAF V600-mutant melanoma, a patient harboring BRAF L597Q demonstrated partial response with a tumor reduction of 38% and an ongoing progression-free survival of 8.3 months (PMID: 33861486). \nIn vitro studies of cell lines engineered to express BRAF L597R or L597S mutations demonstrated sensitivity to MEK inhibition as measured by decreased activation of downstream effector proteins upon treatment with trametinib (PMID: 22798288, 29903896).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2025-03-12 15:13:20',NULL,'LEVEL_3A','NO','LEVEL_3B','af5ea563-3d74-49e1-b931-ebb6f3fdeb43',673,NULL),(2525,NULL,'While there is promising clinical data supporting the use of the FDA-approved MEK-inhibitor trametinib in patients with BRAF L597-mutant melanoma, its clinical utility in patients with [[variant]] is unknown. BRAF class II mutations including [[gene]] [[mutation]] are insensitive to the RAF inhibitors vemurafenib and dabrafenib. Laboratory data suggest that cancer cells with oncogenic, BRAF class II mutations may be sensitive to novel BRAF inhibitors such as plixorafenib.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2024-06-10 17:54:52',NULL,NULL,NULL,NULL,'9b3811aa-85b0-40d0-90fc-f5c724b37f06',673,NULL),(2526,NULL,'Plixorafenib is an orally available, second-generation, small-molecule BRAF inhibitor that inhibits mutated, oncogenic BRAF without causing paradoxical MAPK pathway activation as is seen with first-generation BRAF inhibitors (PMID: 28659148). In a phase I clinical trial for patients with refractory or relapsed solid tumors with or without BRAF mutation, there were two (28%) partial responses of seven evaluable BRAF-mutant patients treated with plixorafenib and cobicistat, a CYP3A4 inhibitor (Abstract: Janku et al. Abstract# B176, AACR-NCI-EORTC 2017. http://mct.aacrjournals.org/content/17/1_Supplement/B176). Both responses were in patients with BRAF V600 mutations. Preclinical studies show that plixorafenib specifically inhibits BRAF-containing dimers and inhibits proliferation and pathway activation in BRAF-mutated colorectal cancer cell lines (PMID: 26466569, 28659148, 30559419, 28783719).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2024-06-10 17:54:43',NULL,'LEVEL_4','NO','LEVEL_4','1fd2d2b7-b69a-4e58-b205-81ef99c8c2e9',673,NULL),(2527,NULL,'There is promising clinical data in patients with BRAF K601E mutant melanoma treated with the FDA-approved MEK-targeted inhibitor trametinib.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2019-08-22 12:08:16',NULL,NULL,NULL,NULL,'f54dc0ea-805f-407b-acc0-878409be447b',673,NULL),(2528,NULL,'Trametinib is a small molecule inhibitor of the MEK1/2 kinases that is FDA-approved in combination with a RAF inhibitor for use in BRAF V600E-positive metastatic melanoma. Anecdotal evidence of clinical activity of trametinib in BRAF K601-mutant melanoma includes a patient who experienced a complete response to trametinib over 36 months (PMID: 28344857), and four patients in various other studies who achieved a partial response or stable disease upon treatment with trametinib (PMID: 23248257, 24933606). In vitro studies of cell lines engineered to express BRAF K601E demonstrated sensitivity to MEK inhibition as measured by decreased activation of downstream effector proteins upon treatment with trametinib (PMID: 22798288, 29903896).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2023-02-15 14:52:16',NULL,'LEVEL_3A','NO','LEVEL_3B','b17106e4-9dd3-4157-90d2-0e791c15278b',673,NULL),(2529,NULL,'While there is promising clinical data supporting the use of the MEK-targeted inhibitor trametinib in patients with BRAF K601E mutant melanoma, its clinical utility in patients with [[variant]] is unknown. BRAF class II mutations including [[gene]] [[mutation]] are insensitive to the RAF inhibitors vemurafenib and dabrafenib. Laboratory data suggest that cancer cells with oncogenic, BRAF mutations may be sensitive to novel BRAF inhibitors such as plixorafenib.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2024-06-10 17:53:55',NULL,NULL,NULL,NULL,'e6703560-987d-4350-a9aa-931bdaea463b',673,NULL),(2530,NULL,'Plixorafenib is an orally available, second-generation, small-molecule BRAF inhibitor that inhibits mutated, oncogenic BRAF without causing paradoxical MAPK pathway activation as is seen with first-generation BRAF inhibitors (PMID: 28659148). In a phase I clinical trial for patients with refractory or relapsed solid tumors with or without BRAF mutation, there were two (28%) partial responses of seven evaluable BRAF-mutant patients treated with plixorafenib and cobicistat, a CYP3A4 inhibitor (Abstract: Janku et al. Abstract# B176, AACR-NCI-EORTC 2017. http://mct.aacrjournals.org/content/17/1_Supplement/B176). Both responses were in patients with BRAF V600 mutations. In a phase I/IIa trial of plixorafenib for patients with BRAF-altered, advanced solid or CNS tumors (n=110; n=61, patients with class 1 mutations; n=19, patients with class 2 mutations [excluding fusions]; n=17, patients with BRAF fusions), partial response was achieved in 39% (n=9/23) of patients with MAPKi-naive, V600-mutant tumors, with a median duration of response (DoR) of 32 months, and in 18% (n=3/17) of patients with MAPKi treated, V600-mutant tumors (n=6, patients with V600-mutant glioma; n=3, patients with V600-mutant ovarian cancer; n=1, patients with V600-mutant small bowel cancer; n=1, patients with V600-mutant papillary thyroid cancer; n=1, patients with V600-mutant anaplastic thyroid cancer) (Abstract: Fuente et al. Abstract# 3006, J. Clin. Oncol. 2023, Vol 41, Suppl 16. https://ascopubs.org/doi/10.1200/JCO.2023.41.16_suppl.3006). Preclinical studies show that plixorafenib specifically inhibits BRAF-containing dimers and inhibits proliferation and pathway activation in BRAF-mutated colorectal cancer cell lines (PMID: 26466569, 28659148, 30559419, 28783719).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2024-06-10 17:53:43',NULL,'LEVEL_4','NO','LEVEL_4','690ed068-5612-438a-ac07-948a18228375',673,NULL),(2531,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'b3965dfe-f320-4ad5-8f89-7d2f351908f0',673,NULL),(2532,NULL,'The class II BRAF K601Q mutation is located in the kinase domain in exon 15 of the protein (PMID: 33019809). This mutation has been found in patients with cardio-facio-cutaneous syndrome (PMID: 19206169). Expression of this mutation in NIH-3T3 cells demonstrated that it is activating as measured by increased downstream pathway activation compared to wildtype BRAF, though to a lesser extent than BRAF V600E (PMID: 19206169). Preclinical studies with melanoma cells expressing BRAF K601Q demonstrated resistance to treatment with vemurafenib as measured by sustained MEK and ERK phosphorylation following treatment (PMID: 35045286).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-08 15:07:15',NULL,NULL,NULL,NULL,'bf3ce630-ff39-4267-a35a-5ea53feee665',673,NULL),(2533,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:37:28',NULL,NULL,NULL,NULL,'a4f10719-c5cb-4074-b753-acbe2a67dd47',673,NULL),(2534,NULL,'The class II BRAF L597Q mutation is located in the kinase domain in exon 15 of the protein (PMID: 28783719, 26343582). This mutation is recurrent in melanoma (PMID: 12068308, 15035987, 26643848). Biological characterization of BRAF L597Q demonstrated that it activates the downstream MAPK pathway independent of RAS and renders BRAF active as a dimer with CRAF and itself (PMID: 12068308, 15035987, 22798288, 26343582, 28783719). Preclinical studies with patient-derived colon adenocarcinoma cells expressing BRAF L597Q demonstrated sensitivity to treatment with trametinib, selumetinib, AZD8931 and trametinib plus cetuximab as measured by inhibition of tumor growth (PMID: 31704811). In a Phase I trial, a patient with lung cancer harboring BRAF L597Q was treated with BVD-523 and demonstrated partial response (PMID: 29247021). In a Phase II trial, a patient with melanoma harboring BRAF L597Q was treated with trametinib and demonstrated partial response with a 38% tumor reduction and ongoing progression-free survival of 8.3 months (PMID: 33861486). In another Phase II trial, a patient with an advanced solid tumor harboring BRAF L597Q was treated with vemurafenib and did not clinically respond to treatment (PMID: 29320312).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 18:40:03',NULL,NULL,NULL,NULL,'1f81f2af-cf83-4764-9fe2-b5f4de735c42',673,NULL),(2535,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:35:42',NULL,NULL,NULL,NULL,'9cc4015a-8efe-4920-8520-02ef0003980b',673,NULL),(2536,NULL,'The class II BRAF K601N mutation is located in the kinase domain in exon 15 of the protein (PMID: 28783719, 26343582). This mutation has been identified in melanoma and multiple myeloma (PMID: 12068308, 15035987, 25178945, 23273605, 24270325). Biological characterization of BRAF K601N demonstrated that it activates the downstream MAPK pathway independently of RAS and renders BRAF active as a dimer with CRAF and itself (PMID: 26343582, 20179705). Preclinical studies with NIH3T3 and SK-MEL-239 cells expressing BRAF K601N demonstrated sensitivity to treatment with LY3009120 and PLX8394 as measured by reduced proliferation (PMID: 26732095, 30559419). In a Phase Ib trial, a patient with non-small cell lung cancer harboring BRAF K601N was treated with combination therapy of LTT462 and LXH 254 and demonstrated an unconfirmed partial response (Abstract: Wolf et al. Abstract# 1387p, Annals of Oncology 2020. https://www.annalsofoncology.org/article/S0923-7534%2820%2941697-7/fulltext). In a Phase II trial, two patients with non-small cell lung cancer harboring BRAF K601N were treated vemurafenib and did not clinically respond to treatment (PMID: 31959346).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 18:41:35',NULL,NULL,NULL,NULL,'99bbe560-98df-4ece-97ad-2ccf9fa0b7d8',673,NULL),(2537,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:46:14',NULL,NULL,NULL,NULL,'f856d787-ee6c-4ece-b0b5-4bf4c20d1dbb',673,NULL),(2538,NULL,'The class III BRAF D594A mutation is located in the kinase domain in exon 15 of the protein (PMID: 20141835, 28783719). This mutation has been recurrently found in melanoma, lung and colorectal cancers (PMID: 20141835, 28481359). Biological characterization of the BRAF D594A mutation has demonstrated that it is RAS dependent in its activation of the MAPK pathway, signals as a dimer with CRAF, and typically co-occurs with another driver mechanism that amplifies RAS signaling (PMID: 20141835, 28783719). Thus, when BRAF D594A is observed in melanoma, it typically co-occurs with an activating RAS mutation or NF1 inactivation, whereas when observed in non-small cell lung or colorectal cancers, it is associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719, 20141835). While this mutation is sensitive to MEK inhibition by targeted inhibitors such as trametinib, it is insensitive to RAF monomer inhibitors such as vemurafenib (PMID: 28783719).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 15:49:17',NULL,NULL,NULL,NULL,'d8ab8fe1-4049-418a-8beb-1bcf5c7c0adb',673,NULL),(2539,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'01ba7555-1f48-4cef-99a7-5bb8f0439f47',673,NULL),(2540,NULL,'The class III BRAF D594E mutation is located in the kinase domain in exon 15 of the protein. This mutation has been found in non-small cell lung cancer and diffuse large B-cell lymphoma (PMID: 28947956, 32877514). In vivo studies with conditional knock-in mice expressing BRAF D594 demonstrate that the mutation activates the MAPK pathway through CRAF (PMID: 20978199). Expression of BRAF D594E in HEK293 cells demonstrated that it is activating as measured by increased downstream ERK signaling compared to wildtype BRAF (PMID: 28947956). In vitro studies have suggested that this mutation is resistant to dabrafenib, as measured by increased MAPK pathway activation upon drug treatment, but sensitive to trametinib, as measured by decreased MAPK pathway activation upon drug treatment (PMID: 28947956). As BRAF D594E is a kinase-dead mutation, it is suggested to be insensitive to treatment with vemurafenib (PMID: 28026870).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 15:49:30',NULL,NULL,NULL,NULL,'eac9874d-79d9-454a-81b6-87c68e93307f',673,NULL),(2541,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:45:27',NULL,NULL,NULL,NULL,'5ea90d79-44f3-49e0-bcab-decd35590115',673,NULL),(2542,NULL,'The class III BRAF D594G mutation is located in the kinase domain in exon 15 of the protein (PMID: 28783719). This mutation has been found in colorectal cancer and melanomas, among others (PMID: 26498038, 28481359). Despite having hypoactive kinase activity, in vitro studies have demonstrated that this mutation is likely activating as measured by increased CRAF dimerization and downstream signaling compared to wildtype (PMID: 20141835, 26498038, 28783719). Preclinical studies with WM3670 cells expressing BRAF D594G demonstrated resistance to treatment with vemurafenib and PLX8394, as measured by persistent MEK, ERK and AKT activity, and sensitivity to treatment with SIJ1777, as measured by AKT and MAPK inhibition (PMID: 33917428). In a case report, a patient with low-grade serous ovarian cancer harboring BRAF D594G was treated with trametinib and demonstrated minimal clinical response (PMID: 35198414).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 15:50:46',NULL,NULL,NULL,NULL,'2f4e594e-c475-49b7-a06a-dd2b1c5d4189',673,NULL),(2543,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:44:26',NULL,NULL,NULL,NULL,'e8e0818f-cedb-4eae-a9c1-e61cab753b74',673,NULL),(2544,NULL,'The class III BRAF D594N mutation occurs in the kinase domain in exon 15 of the protein (PMID: 28783719). This mutation has been found in non-small cell lung cancer and melanoma (PMID: 22798288, 23833300, 26498038, 28783719, 28947956). Biological characterization of the BRAF D594N mutation has demonstrated that it is RAS dependent in its activation of the MAPK pathway, signals as a dimer with CRAF, and typically co-occurs with another driver mechanism that amplifies RAS signaling (PMID: 28783719, 26498038). Thus, when BRAF D594N is observed in melanoma, it typically co-occurs with an activating RAS mutation or NF1 inactivation, whereas when observed in non-small cell lung or colorectal cancers, it is associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719). While this mutation is sensitive to MEK inhibition by targeted inhibitors such as trametinib, it is insensitive to RAF monomer inhibitors such as vemurafenib (PMID: 28783719). In a case report, a patient with EGFR-positive, MET-amplified non-small cell lung cancer acquired BRAF D594N as a secondary resistance mutation in response to combination treatment with osimertinib plus crizotinib (PMID: 36136993). The patient demonstrated clinical response to combination treatment with osimertinib plus trametinib (PMID: 36136993).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 19:33:13',NULL,NULL,NULL,NULL,'b0ec34c2-01be-4bd8-96db-5aea6eb0706c',673,NULL),(2545,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'d98714d2-a2af-4af6-9722-63683c1ef6b4',673,NULL),(2546,NULL,'The class III BRAF D594V mutation is located in the kinase domain in exon 15 of the protein (PMID: 33019809). This mutation has been found in colorectal cancer and cardio-facio-cutaneous (CFC) syndrome (PMID: 16439621, 14678966). Expression of this mutation in D04 or COS7 cells demonstrated that, despite being kinase-dead, the mutation activates the MAPK pathway through dimerization with CRAF as measured by downstream MEK and ERK phosphorylation (PMID: 15035987, 14678966). When expressed in zebrafish embryos, the BRAF D594V mutation causes the same aberrant elongation phenotype as BRAF V600E, suggesting that it is likely activating in vivo (PMID: 19376813).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 19:34:23',NULL,NULL,NULL,NULL,'50b2db09-21b0-4bd8-859e-e6432d3a7483',673,NULL),(2547,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'e9ee68af-6814-4e3d-afcc-699156f2d920',673,NULL),(2548,NULL,'The class III BRAF D594Y mutation is located in the kinase domain in exon 15 of the protein (PMID: 30224342). This mutation has been identified in lung adenocarcinoma and ovarian cancer (PMID: 28481359, 31477716). Analysis of patients with BRAF-altered lung cancers demonstrated that BRAF D594Y has impaired kinase function (PMID: 32913992). As a BRAF class III mutation, it is suggested that BRAF D594Y is sensitive to MEK inhibition by targeted inhibitors such as trametinib and insensitive to RAF monomer inhibitors such as vemurafenib (PMID: 28783719).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-06 19:35:00',NULL,NULL,NULL,NULL,'4f361386-9f20-415b-ad55-2b6e73a3bc5a',673,NULL),(2549,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:39:07',NULL,NULL,NULL,NULL,'c8e8b1f4-06ab-4749-b420-7a5600a95e1e',673,NULL),(2550,NULL,'The class II BRAF G464E mutation is located in the kinase domain in exon 11 of the protein (PMID: 28783719, 26343582). This mutation has been reported in colorectal cancer (PMID: 15150094). Biological characterization of the BRAF G464E mutation demonstrated it activates the downstream MAPK pathway independent of RAS and renders BRAF active as a dimer with CRAF (PMID: 15035987, 23680146, 15150094, 26343582, 20179705, 16364920). Preclinical studies with cancer cell lines expressing BRAF G464E demonstrate resistance to vemurafenib as measured by prolonged ERK signaling following treatment (PMID: 26343582, 28783719, 26343582). A patient with spindle cell carcinoma harboring BRAF G464E treated with trametinib resulted in stable disease with a progression-free survival of 6.9 months (PMID: 31924734).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 15:56:56',NULL,NULL,NULL,NULL,'40f0164f-978b-4b99-87bc-392ce3f14d64',673,NULL),(2551,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'fdb9c569-972c-4267-b851-c566fe8e0d01',673,NULL),(2552,NULL,'The class II BRAF G464R mutation is located in the kinase domain in exon 11 of the protein (PMID: 33019809). This mutation has been found in melanoma (PMID: 15046639). Expression of this mutation in NIH-3T3 cells demonstrated that this mutation is activating as measured by increased downstream pathway activation compared to wildtype BRAF, though to a lesser extent than BRAF V600E (PMID: 15046639). In vitro studies with Ba/F3 and MCF10A cells expressing BRAF G464R demonstrate that the mutation is activating as measured by increased cell viability and proliferation compared to wildtype (PMID: 29533785). In a case report for a patient with metastatic colorectal cancer harboring BRAF G464R and KRAS G12S, the patient was treated with bevacizumab plus FOLFIRI and then later treated with bevacizumab plus FOLFOXIRI and demonstrated recurrent disease in the sigmoid colon following both treatment regimens (PMID: 31183211).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 15:57:26',NULL,NULL,NULL,NULL,'6ac26115-a639-4eee-aaac-dd0eba053dd6',673,NULL),(2553,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'5bab3643-9d50-43bf-be7b-307a2e48c9c4',673,NULL),(2554,NULL,'The class II BRAF G464V mutation is located in the kinase domain in exon 11 of the protein (PMID: 28783719, 26343582). This mutation has been reported in melanoma, colorectal cancer and breast cancer (PMID: 15035987, 15150094, 17314276). Biological characterization of the BRAF G464V mutation demonstrated it activates the downstream MAPK pathway independent of RAS and renders BRAF active as a dimer with CRAF (PMID:  15035987, 12068308, 15150094, 26343582, 20179705). Preclinical studies with KRAS-mutant HEK293 cells expressing BRAF G464V demonstrated sensitivity to treatment with RAF inhibitor Cmpd A as measured by reduced phosphorylated ERK levels (PMID: 23680146). A patient with lung adenocarcinoma harboring BRAF G464V treated with trametinib did not respond to treatment and demonstrated progressive disease (PMID: 31924734). Two patients with advanced solid tumors harboring BRAF G464V were treated with vemurafenib and did not have an objective response to treatment (PMID: 29320312).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 19:40:08',NULL,NULL,NULL,NULL,'532ebf53-588d-495d-92a3-fd13cb96b34b',673,NULL),(2555,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:43:08',NULL,NULL,NULL,NULL,'6ebe87c5-27e7-40a0-baa2-6ed29b00648c',673,NULL),(2556,NULL,'The class III BRAF G466A mutation is located in the kinase domain in exon 11 of the protein (PMID: 28783719, 15035987, 28783719). This mutation has been identified in melanoma and lung adenocarcinoma (PMID: 12068308, 28481359). Biological characterization of the BRAF G466A mutation has demonstrated that it is RAS dependent in its activation of the MAPK pathway, signals as a dimer with CRAF, and typically co-occurs with another driver mechanism that amplifies RAS signaling (PMID: 15035987, 28783719). Thus, when BRAF G466A is observed in melanoma, it typically co-occurs with an activating RAS mutation or NF1 inactivation, whereas when observed in non-small cell lung or colorectal cancers, it is associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719). A patient with non-small cell lung cancer harboring BRAF G466A treated with vemurafenib did not clinically respond to treatment and demonstrated progressive disease (PMID: 31959346). Patients with advanced solid tumors harboring BRAF G466A were treated with trametinib and demonstrated either progressive or stable disease (PMID: 31924734). In a case report, a patient with metastatic Bellini duct carcinoma harboring BRAF G466A treated with trametinib plus dabrafenib demonstrated 11 months of stable disease following treatment (PMID: 33669326). In a Phase Ib trial, a patient with metastatic non-small cell lung cancer harboring BRAF G466A was treated with combination therapy of the ERK1/2 inhibitor LTT462 and the BRAF/CRAF inhibitor LXH 254 and demonstrated stable disease with a 25% tumor reduction following treatment (Abstract: Wolf et al. Abstract# 1387p, Annals of Oncology 2020. https://www.annalsofoncology.org/article/S0923-7534%2820%2941697-7/fulltext).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 19:42:36',NULL,NULL,NULL,NULL,'855e100e-1702-43f9-ba27-bbb53498df41',673,NULL),(2557,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:42:51',NULL,NULL,NULL,NULL,'3aaa447d-1aaf-41b9-b0ee-d17185ce9016',673,NULL),(2558,NULL,'The class III BRAF G466E mutation occurs in the kinase domain in exon 11 of the protein (PMID: 15035987, 28783719). This mutation has been reported in melanoma, lung cancer, colorectal cancer and chronic myelomonocytic leukemia (PMID: 28481359, 15046639, 27790118, 24446311). Biological characterization of the BRAF G466E mutation has demonstrated that it is RAS dependent in its activation of the MAPK pathway, signals as a dimer with CRAF, and typically co-occurs with another driver mechanism that amplifies RAS signaling (PMID: 15035987, 15046639, 28783719). Thus, when BRAF G466E is observed in melanoma, it typically co-occurs with an activating RAS mutation or NF1 inactivation, whereas when observed in non-small cell lung or colorectal cancers, it is associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719). Preclinical studies with melanoma cell lines expressing BRAF G466E demonstrated sensitivity to treatment with AZ628 and TAK-632 as measured by reduced cell proliferation, and insensitivity to treatment with PLX7904, vemurafenib and dabrafenib, as measured by prolonged cell viability (PMID: 27523909). In a clinical study, two patients with metastatic colorectal cancer harboring BRAF G466E were treated with combination therapy of panitumumab and irinotecan and demonstrated partial response with a progression-free survival of 8.3 months (PMID: 31515458). In a case report, a patient with melanoma harboring BRAF G466E was treated with ipilimumab and demonstrated progressive disease (PMID: 27790118).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 19:43:32',NULL,NULL,NULL,NULL,'09553532-91a2-47fb-9468-ff505476c94e',673,NULL),(2559,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'903e2063-c368-4075-aab6-7d3f314f610a',673,NULL),(2560,NULL,'The class III BRAF G466R mutation is located in the kinase domain in exon 11 of the protein (PMID: 28783719). This mutation has been identified in lung adenocarcinoma and melanoma (PMID: 24297085, 21788131). Expression of this mutation in NIH3T3 cells demonstrated that this mutation is likely activating as measured by increased downstream ERK activation (PMID: 15046639). While this mutation has kinase activity in vitro less than wildtype BRAF, it likely activates downstream ERK through dimerization with CRAF (PMID: 15035987, 16364920). A patient with stage IV lung adenocarcinoma harboring BRAF G466R was treated with selumetinib and demonstrated an overall survival of 9.1 months (PMID: 25273224). In a case report, a patient with non-small cell lung cancer harboring BRAF G466R was treated with a combination therapy of dabrafenib plus trametinib and did not clinically respond to treatment (Abstract: Citarella et al. Precis Cancer Med 2022. https://pcm.amegroups.com/article/view/6792/html#B19). Another patient with non-small cell lung cancer harboring BRAF G466R was treated with a combination therapy of nivolumab plus anlotinib and demonstrated progressive disease with a progression-free survival of two months (PMID: 32411601). In a Phase II trial, a patient with melanoma harboring BRAF G466R and NRAS Q61H was treated with a combination therapy of docetaxel plus selumetinib and demonstrated stable disease with a progression-free survival of seven months (PMID: 31839677).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-06 19:44:53',NULL,NULL,NULL,NULL,'5414eff5-1ecb-4030-adf2-da44ef4b3778',673,NULL),(2561,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:39:53',NULL,NULL,NULL,NULL,'b6105994-7ba4-42af-b463-1b0eb367d81a',673,NULL),(2562,NULL,'The class III BRAF G466V missense mutation is located in the kinase domain in exon 11 of the protein (PMID: 15035987, 28783719). This mutation has been reported in melanoma, lung cancer, colorectal cancer and cardio-facio-cutaneous syndrome (PMID: 28481359, 15046639, 26498038, 16439621, 22649091). Biological characterization of the BRAF G466V mutation has demonstrated that it is RAS dependent in its activation of the MAPK pathway, signals as a dimer with CRAF, and typically co-occurs with another driver mechanism that amplifies RAS signaling (PMID: 15035987, 26498038, 22649091, 16364920, 24202393, 28783719). Thus, when BRAF G466V is observed in melanoma, it typically co-occurs with an activating RAS mutation or NF1 inactivation, whereas when observed in non-small cell lung or colorectal cancers, it is associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719). Preclinical studies with lung cancer cell lines expressing BRAF G466V demonstrated sensitivity to treatment with TAK-632, TAE226 and RMC-4550 as measured by inhibition of cell proliferation and reduced ERK phosphorylation following treatment (PMID: 26090892, 27523909, 30104724). Other preclinical studies with patient-derived xenograft colorectal cancer models expressing BRAF G466V demonstrated resistance to treatment with PLX8394 as measured by continued ERK phosphorylation and inability to suppress tumor growth, and sensitivity to treatment with cetuximab as measured by reduced tumor growth and inhibition of ERK phosphorylation (PMID: 30559419). In a Phase II trial, three patients with non-small cell lung cancer harboring BRAF G466V were treated with vemurafenib and did not clinically respond to treatment (PMID: 31959346). In another Phase II trial, a patient with lung adenocarcinoma harboring BRAF G466V was treated with trametinib and demonstrated progressive disease (PMID: 31924734). In a case report, a patient with metastatic colorectal cancer harboring BRAF G466V was treated with a combination therapy of irinotecan plus panitumumab and demonstrated a partial response with a progression-free survival of 6.1 months (PMID: 31515458).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-07 17:57:38',NULL,NULL,NULL,NULL,'4bd4a259-ff20-48b2-aa59-8d1202991f65',673,NULL),(2563,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'acc42ebe-bf76-4b5c-9c2c-59865e0f39f6',673,NULL),(2564,NULL,'The class II BRAF G469A mutation is located in the kinase domain in exon 11 of the protein (PMID: 28783719, 26343582). This mutation has been reported in melanoma, non-small cell lung cancer and cardio-facio-cutaneous syndrome (PMID: 12068308, 23833300, 16439621). Biological characterization of the BRAF G469A mutation demonstrated that it activates the downstream MAPK pathway independently of RAS and renders BRAF active as a dimer with CRAF and itself (PMID: 12068308, 23833300, 26343582, 20179705, 22510884). Ectopic expression of BRAF G469A in drug-sensitive EGFR-mutant cells conferred resistance to EGFR TKIs that was overcome by addition of a MEK inhibitor (PMID: 22773810). Preclinical studies with patient-derived lung adenocarcinoma cells expressing BRAF G469A demonstrated sensitivity to treatment with LXH 254, lifirafenib and dabrafenib plus trametinib, as measured by inhibition of cell growth, and resistance to treatment with LY3214996, MK-8353, ravoxertinib, ulixertinib, TAK-580, vemurafenib and dabrafenib, as measured by persistent cell growth (PMID: 32540409). In a clinical study, patients with metastatic colorectal cancer harboring BRAF G469A were treated with cetuximab plus FOLFIRI, cetuximab plus irinotecan or panitumumab plus irinotecan and each treatment group demonstrated stable disease with a progression-free survival of 4.4 months, 3.5 months and 4.0 months, respectively (PMID: 31515458). In a Phase I trial, a patient with head and neck cancer and a patient with small bowel cancer, both harboring BRAF G469A, were treated with ulixertinib and demonstrated partial response (PMID: 29247021). In a Phase II trial, a patient with lung adenocarcinoma harboring BRAF G469A was treated with trametinib and demonstrated stable disease with a progression-free survival of 20.4 months (PMID: 31924734). In another Phase II trial, two patients with advanced solid tumors harboring BRAF G469A were treated with vemurafenib and did not clinically respond to treatment (PMID: 29320312).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-07 17:58:34',NULL,NULL,NULL,NULL,'ab9c04c7-415e-41da-93cd-82cbb6ce102c',673,NULL),(2565,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:43:47',NULL,NULL,NULL,NULL,'1ec9dffe-c9c5-4aa0-8439-5aca0e35730f',673,NULL),(2566,NULL,'The class III BRAF G469E mutation is located in the kinase domain in exon 11 of the protein (PMID: 28783719). This mutation has been reported in melanoma, lung cancer, colorectal cancer and cardio-facio-cutaneous syndrome (PMID: 26498038, 18794803, 16439621). Biological characterization of the BRAF G469E mutation has demonstrated that it is RAS dependent in its activation of the MAPK pathway, signals as a dimer with CRAF, and typically co-occurs with another driver mechanism that amplifies RAS signaling (PMID: 15035987, 28783719, 15150094, 22510884). Thus, in melanoma, the G469E variant, similar to other class III BRAF mutants, would be expected to co-occur with activating RAS mutation or NF1 inactivation, whereas in non-small cell lung or colorectal cancers, this mutation would most likely be associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719). Preclinical studies with melanoma cells expressing BRAF G469E demonstrated sensitivity to treatment with sorafenib, as measured by inhibition of growth and induced apoptosis, and resistance to treatment with U0126, as measured by persistent cell growth (PMID: 18794803). In a Phase II trial, a patient with breast ductal carcinoma harboring BRAF G469E was treated with trametinib and demonstrated partial response with a 50% tumor size reduction (PMID: 31924734).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 18:43:01',NULL,NULL,NULL,NULL,'2bb6b849-bcd7-4f63-b423-6d2f5260e49c',673,NULL),(2567,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'10eb50de-c687-463b-811a-6271aaef3431',673,NULL),(2568,NULL,'The BRAF G469L mutation is located in the protein\'s kinase domain in exon 11. While this mutation has not been functionally characterized, other substitutions at this position (e.g., G469R) have been shown to be activating and oncogenic (PMID: 24920063 ). This mutation was found in a patient with non-small cell lung cancer who failed to respond to treatment with vemurafenib (PMID: 24035431).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'29e7843e-2973-4cc5-9288-3a3f17757604',673,NULL),(2569,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:38:36',NULL,NULL,NULL,NULL,'f8af2c28-f6db-41e3-94d8-b1a27435331c',673,NULL),(2570,NULL,'The class II BRAF G469R mutation is located in the kinase domain in exon 11 of the protein (PMID: 28783719, 26343582). This mutation has been reported in non-small cell lung cancer, chronic lymphocytic leukemia, melanoma and a range of other cancer types (PMID: 26498038, 24920063, 16096377, 26150740, 26619011). Biological characterization of the BRAF G469R mutation demonstrated that it activates the downstream MAPK pathway independent of RAS renders BRAF active as a dimer with CRAF and itself (PMID: 26343582, 28783719, 20179705). While sensitive to MEK inhibition by targeted inhibitors such as trametinib, this mutation is insensitive to RAF monomer inhibitors such as vemurafenib (PMID: 26343582, 28783719, 18794803, 26343582, 28783719). In a Phase II trial, a patient with melanoma harboring BRAF G469R and KIT G12V was treated with trametinib and demonstrated stable disease with a progression-free survival of 22.3 months (PMID: 33861486).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-08 14:30:52',NULL,NULL,NULL,NULL,'75cc7602-ac02-434e-89b6-5551765ba3a5',673,NULL),(2571,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:38:08',NULL,NULL,NULL,NULL,'b8f3cd76-e1a5-4bd1-96c4-7a5241b5fe8b',673,NULL),(2572,NULL,'The class II BRAF G469V mutation is located in the kinase domain in exon 11 of the protein (PMID: 28783719, 26343582). This mutation has been reported in non-small cell lung cancer and bladder cancer (PMID: 25870796, 27388325, 23401075). Biological characterization of the BRAF G469V mutation demonstrated that it activates the downstream MAPK pathway independently of RAS and renders BRAF active as a dimer with CRAF and itself (PMID: 26343582, 28783719, 20179705). Preclinical studies with SKBR3 cells expressing BRAF G469V demonstrated resistance to treatment with vemurafenib as measured by persistent MEK and ERK activation following treatment (PMID: 26343582). In a case report, two patients with metastatic colorectal cancer harboring BRAF G469V were treated with either panitumumab plus FOLFOX or cetuximab plus irinotecan and both treatment options demonstrated partial response with a progression-free survival of 18.9 months and 10.9 months, respectively (PMID: 31515458). In another case report, a patient with lung adenocarcinoma harboring BRAF G469V was treated with combination therapy of trametinib and dabrafenib and progressed after nine weeks of treatment (PMID: 32540409). In another case report, a patient with hepatocellular carcinoma and non-small cell lung cancer harboring BRAF G469V was treated with sorafenib and demonstrated a complete response in the lung and stability of the hepatocellular carcinoma (PMID: 27388325).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 18:48:58',NULL,NULL,NULL,NULL,'94fe5461-1eb2-432a-9b78-a2e7d2e26cb7',673,NULL),(2573,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'31844270-7a3e-4505-88f9-d75959551599',673,NULL),(2574,NULL,'The BRAF G469del mutation is located in the kinase domain in exon 11 of the protein. This mutation has been found in non-small cell lung cancer (PMID: 23833300). Expression of this mutation in NIH-3T3 cells demonstrated that though in vitro kinase activity and in vivo downstream MEK and ERK activation were decreased compared to wildtype BRAF, colony formation was mildly increased compared to wildtype BRAF (PMID: 23833300).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'687e219a-c2f3-4559-b626-101529bf2bf0',673,NULL),(2575,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'6877f3c4-e48a-42d4-bed6-0d55a2a9c10d',673,NULL),(2576,NULL,'The BRAF S151A mutation is located proximal to the RAS-binding domain in exon 3 of the protein. Expression of this mutation in NHEM cells demonstrated that it is likely activating, as measured by increased binding of BRAF to NRAS (PMID: 21478863). As the S151 residue of BRAF is a suspected site of negative-regulatory phosphorylation of BRAF by ERK, mutation of this serine to alanine would be predicted to result in increased BRAF activity (PMID: 21478863).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'b67cc890-136d-4b8f-978d-643d6acd35f4',673,NULL),(2577,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'3bb6e5b5-4599-40e7-930e-de0be6fa52f4',673,NULL),(2578,NULL,'The BRAF Q201H mutation is located in the RAS-binding domain in exon 4 of the protein. This mutation has been found in an ovarian cancer cell line (PMID: 18060073). While this mutation has not been functionally validated, SIFT prediction software predicted that this mutation would likely be neutral (PMID: 18060073).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'9f372272-5687-477b-9727-e2ea8ae52574',673,NULL),(2579,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'d86aa3d7-afc8-4512-b4ad-03e1fcbec9fe',673,NULL),(2580,NULL,'The BRAF T241P mutation is located in the cysteine-rich domain in exon 6 of the protein. This mutation has been found in cardio-facio-cutaneous syndrome (CFC) (PMID: 19206169). Expression of this mutation in NIH-3T3 cells demonstrated that it is likely activating as measured by moderately increased activation of MEK and ERK and slightly increased colony formation compared to wildtype BRAF (PMID: 19206169).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2019-07-12 18:32:31',NULL,NULL,NULL,NULL,'274d4c28-1e34-4982-872d-414ea59a5b73',673,NULL),(2581,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'de63a301-2e58-4312-abe2-cae003e0d59c',673,NULL),(2582,NULL,'The BRAF A246P mutation is located in the cysteine-rich domain in exon 6 of the protein. This mutation is found in cardio-facio-cutaneous (CFC) syndrome (PMID: 16474404). Expression of BRAF A246P in NIH-3T3 cells engineered to concurrently express an ERK-dependent luciferase construct demonstrated that this mutation is activating, as measured by increased luciferase activity compared to wildtype BRAF (PMID: 16474404). Single-molecule binding assays with BRAF A246P also demonstrate that the mutation is activating as measured by increased RAS binding affinity compared to wildtype (PMID: 24409384). Preclinical studies with zebrafish embryos expressing BRAF A246P demonstrated sensitivity to treatment with MEK inhibitors CI-1040 and PD0325901 as measured by the prevention of CFC development (PMID: 19376813).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 15:43:09',NULL,NULL,NULL,NULL,'f0a7fcca-369a-4d7d-b125-ac14c41ddc57',673,NULL),(2583,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'d53d983d-004b-4658-896b-f9d5fd19e085',673,NULL),(2584,NULL,'The class II BRAF Q257R mutation is located in the cysteine-rich domain in exon 6 of the protein (PMID: 33019809). This mutation has been found in cardio-facio-cutaneous syndrome (PMID: 16474404, 16439621). Expression of this mutation in NIH-3T3 cells demonstrated that this mutation is activating as measured by increased transcription of downstream MAPK pathway transcriptional targets (e.g., ELK) compared to wildtype BRAF (PMID: 16474404). When expressed in zebrafish embryos, the Q257R mutation causes the same aberrant elongation phenotype as BRAF V600E, suggesting that it is likely activating in vivo (PMID: 19376813).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-08 16:03:33',NULL,NULL,NULL,NULL,'eef8ecb6-23d2-442e-927d-d5350813178d',673,NULL),(2585,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'bcd54ffa-98df-4028-9e75-d5858ab5aed2',673,NULL),(2586,NULL,'The BRAF E275K mutation is located in the cysteine-rich domain in exon 6 of the protein. This mutation has been found in cardio-facio-cutaneous syndrome (PMID: 19206169). Expression of this mutation in NIH-3T3 cells demonstrated that it is activating as measured by increased colony formation despite decreased MEK and ERK phosphorylation compared to wildtype BRAF (PMID: 19206169).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'0142dec9-1c86-41f8-a39e-a2c12c36d6dd',673,NULL),(2587,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:39:26',NULL,NULL,NULL,NULL,'33f20b93-a5aa-46ba-83b1-26871c2016bf',673,NULL),(2588,NULL,'The class III BRAF D287H mutation occurs in the cysteine-rich domain in exon 6 of the protein (PMID: 28783719). Biological characterization of the BRAF D287H mutation has demonstrated that it is RAS dependent in its activation of the MAPK pathway, signals as a dimer with CRAF, and typically co-occurs with another driver mechanism that amplifies RAS signaling (PMID: 26343582, 28783719). In melanoma, the D287H variant, similar to other class III BRAF mutants, would be expected to co-occur with activating RAS mutation or NF1 inactivation, whereas in non-small cell lung or colorectal cancers, this mutation would most likely be associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719). While this mutation is sensitive to MEK inhibition by targeted inhibitors such as trametinib, it is insensitive to RAF monomer inhibitors such as vemurafenib (PMID: 28783719).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 15:46:22',NULL,NULL,NULL,NULL,'05840d43-e046-488f-bcd9-42517eee4a78',673,NULL),(2589,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'0cb22fc2-ff96-4abc-adb1-82fcee800dd6',673,NULL),(2590,NULL,'The BRAF I326V mutation is located in the flexible hinge domain of the BRAF protein. This mutation has been found as a germline mutation in Noonan Syndrome (PMID: 17603482). In vitro studies have demonstrated that this mutation is likely neutral as measured by downstream signaling compared to wildtype (PMID: 17603482). In a clinical study, a patient with colorectal cancer harboring BRAF I326V was treated with panitumumab and irinotecan plus S-1 and demonstrated progressive disease (PMID: 30463788).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2023-03-08 14:41:23',NULL,NULL,NULL,NULL,'c81b4261-e7a5-49db-80fc-e85e54ab4055',673,NULL),(2591,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:39:39',NULL,NULL,NULL,NULL,'7269fee4-78fd-4b9f-9589-35ff6398cb79',673,NULL),(2592,NULL,'The class III hypoactivating exon 6 BRAF V459L missense mutation occurs in the cysteine-rich domain of the protein (PMID: 28783719). This mutation has been reported in lung cancer and melanoma (PMID: 12460918). BRAF V459L signals as a dimer with CRAF, is RAS-dependent in its activation of the MAPK pathway, and, in tumors, would typically co-occur with another driver mechanism that amplifies RAS signaling (PMID: 28783719). Thus, like other class III BRAF mutants, in melanoma, the V459L variant would be expected to co-occur with activating RAS mutation or NF1 inactivation, whereas in non-small cell lung and colorectal cancers, this mutation would most likely be associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719). While this mutation is sensitive to MEK inhibition by targeted inhibitors such as trametinib, it is insensitive to RAF monomer inhibitors such as vemurafenib.','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-01-27 14:54:03',NULL,NULL,NULL,NULL,'74cb3e73-70a1-43c1-bb48-50a77184ce71',673,NULL),(2593,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'60619485-6bf6-456b-99bd-bf3ca8dd3286',673,NULL),(2594,NULL,'The BRAF R462E mutation is located in the kinase domain of the BRAF protein. In vitro studies have demonstrated that the BRAF L597S mutation is likely activating as measured by CRAF activity and downstream signaling compared to wildtype (PMID: 25155755).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2020-09-20 17:22:08',NULL,NULL,NULL,NULL,'612a0f55-afdf-4931-abbc-16550552dd4c',673,NULL),(2595,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'36c50b89-b6e6-4761-ade8-349acdcd73f1',673,NULL),(2596,NULL,'The class II BRAF R462I mutation is located in the kinase domain in exon 11 of the protein (PMID: 35050937). This mutation has been found in colorectal cancer (PMID: 15150094). Expression of this mutation in NIH-3T3 or IEC-6 cells demonstrated that this mutation is neutral as measured by kinase activity, foci-formation and cell proliferation comparable to wildtype BRAF (PMID: 15150094, 15035987). Additionally, expression of this mutation with HRAS G12V failed to activate the MAPK pathway either as a monomer or a dimer with CRAF, suggesting it is not activating (PMID: 15150094).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2023-03-08 16:03:51',NULL,NULL,NULL,NULL,'89566b58-387b-4ade-bec1-847857ef762a',673,NULL),(2597,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'26295e28-2d03-4e12-b4c1-b70e00c7166c',673,NULL),(2598,NULL,'The class II BRAF I463S mutation is located in the kinase domain in exon 11 of the protein (PMID: 33019809). This mutation has been found in colorectal cancer (PMID: 15150094). Expression of this mutation in NIH-3T3 or IEC-6 cells demonstrated that it is likely neutral, as measured by kinase activity, foci formation, and cell proliferation comparable to wildtype BRAF (PMID: 15150094, 15035987). Additionally, expression of BRAF I463S with HRAS G12V does not lead to increased MAPK pathway activation either alone as a monomer or through dimerization with CRAF (PMID: 15150094).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2023-03-08 14:42:05',NULL,NULL,NULL,NULL,'d5c4b6b2-1741-441c-ac40-b223d4060c9b',673,NULL),(2599,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'94d0f8da-898a-4f3a-9674-d2e8d7a4dec1',673,NULL),(2600,NULL,'The class III BRAF S467A mutation is located in the kinase domain in exon 11 of the protein (PMID: 35050937). This mutation has been found in cardio-facio-cutaneous syndrome (PMID: 16439621). Expression of this mutation in 293T cells demonstrated that this mutation is activating as measured by increased activation of downstream MAPK effectors compared to wildtype BRAF (PMID: 16439621). When expressed in zebrafish embryos, the BRAF S467A mutation causes the same aberrant elongation phenotype as BRAF V600E, suggesting that it is likely activating in vivo (PMID: 19376813).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 14:35:21',NULL,NULL,NULL,NULL,'b1f6b30a-c28b-4f4b-b0fd-04e76e8b5d9d',673,NULL),(2601,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'391497af-3c28-4451-8b55-b4af8b0278c5',673,NULL),(2602,NULL,'The BRAF F468C mutation is located in the kinase domain in exon 11 of the protein. This mutation has been found in colorectal cancer (PMID: 15150094). Expression of this mutation in NIH-3T3 cells demonstrated that it is activating as measured by increased in vitro kinase activity, increased proliferation and increased foci formation compared to wildtype BRAF (PMID: 15150094).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'9665e855-859a-42c2-b65e-fceb34f4b3ab',673,NULL),(2603,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'9152f85c-59b4-4978-b42a-315ea2528a46',673,NULL),(2604,NULL,'The class II BRAF V471F mutation is located in the kinase domain in exon 11 of the protein (PMID: 33019809). Expression of this mutation in 293T cells demonstrated that this mutation is activating as measured by increased downstream pathway activation and moderate transforming activity compared to wildtype BRAF (PMID: 25348715). Though this mutation is kinase-dead, it activates the MAPK pathway by dimerizing with CRAF (PMID: 25348715).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 18:51:02',NULL,NULL,NULL,NULL,'a97a1859-463d-44b0-a455-7708ac87643d',673,NULL),(2605,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'f1f455b0-d3f4-4086-aee9-7af13bf507f0',673,NULL),(2606,NULL,'The BRAF Y472C mutation is located in the kinase domain in exon 11 of the protein. This mutation is found in non-small cell lung cancer (PMID: 22649091). Expression of this mutation in COS7, H661, or H226 cells demonstrated that it is activating as measured by increased downstream MEK and ERK activation compared to wildtype BRAF, despite having impaired kinase activity (PMID: 22649091). Similar to other kinase-inactivating BRAF mutations, the Y472C mutant promotes downstream oncogenic signaling (via MEK/ERK pathway) by transactivating CRAF, and therefore is considered to be likely oncogenic in the clinical setting (PMID: 22649091). In a Phase II trial, a patient with non-small cell lung cancer harboring BRAF Y472C was treated with dasatinib and demonstrated a complete response (PMID: 20855820).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 18:51:36',NULL,NULL,NULL,NULL,'38abf378-98d7-47ca-b0b7-d277dfcc627f',673,NULL),(2607,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'290eff4d-b13d-419b-8e92-693f1f479f96',673,NULL),(2608,NULL,'The BRAF G478C mutation is located in the kinase domain in exon 12 of the protein. This mutation was engineered to mimic the ARAF G331C mutation (PMID: 22926515). Expression of this mutation in COS-7 cells demonstrated that this mutation is inactivating, as shown by abolished kinase activity compared to wildtype BRAF (PMID: 22926515).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'52557f96-60a6-4b41-9fba-74de217198da',673,NULL),(2609,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'7dfeeb0c-1c68-417c-9267-78d3ccd709eb',673,NULL),(2610,NULL,'The class III BRAF K483E mutation occurs in the tyrosine kinase domain of the BRAF protein (PMID: 33019809). This mutation has been identified in a patient diagnosed with pediatric poorly differentiated carcinoma (PMID: 27799065). Overexpression of this variant in 293T cells resulted in activation of MEK1/2, however, the activation was comparable to overexpression of wildtype BRAF (PMID: 27799065). Activation likely occurs via allosteric activation of BRAF or CRAF because of the lack of BRAF K483E kinase activity (PMID: 27799065). Preclinical studies with patient-derived colorectal cancer organoids expressing BRAF K483E demonstrated sensitivity to treatment with binimetinib as measured by decreased cell viability, and resistance to treatment with cetuximab as measured by no change in cell viability (PMID: 33060766).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-09 18:52:08',NULL,NULL,NULL,NULL,'0be98f82-fc8b-47a0-9ccc-7413b607a840',673,NULL),(2611,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'e3a61279-8c09-41f0-83aa-2903fc667917',673,NULL),(2612,NULL,'The class III BRAF K483M mutation is located in the kinase domain of the BRAF protein (PMID: 15035987). In vitro studies have demonstrated that this mutation is likely activating as measured by CRAF activation and downstream signaling compared to wildtype (PMID: 15035987, 23533272). Preclinical studies with D04 cells expressing BRAF K483M demonstrated sensitivity to treatment with sorafenib as measured by inhibition of MEK activation (PMID: 20141835).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-08 14:42:57',NULL,NULL,NULL,NULL,'a979f929-319b-4dad-917f-ba9414e5d0f6',673,NULL),(2613,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'7d10414f-305b-4724-9b43-f6544d241b44',673,NULL),(2614,NULL,'The class II BRAF L485F mutation is located in the kinase domain in exon 11 of the protein (PMID: 31515458). This mutation has been found in cardio-facio-cutaneous syndrome (PMID: 16474404, 16439621). Expression of this mutation in NIH-3T3 cells demonstrated that it is activating as measured by significantly increased transcription of downstream MAPK pathway transcriptional targets (e.g., ELK) compared to wildtype BRAF (PMID: 16474404). Preclinical studies with 293T cells expressing BRAF L485F demonstrated sensitivity to treatment with LY3009120, as measured by inhibition of ERK signaling, and resistance to treatment with dabrafenib, PLX8394 and vemurafenib, as measured by persistent ERK signaling (PMID: 34108213). In a clinical study, a patient with metastatic colorectal cancer harboring BRAF L485F was treated with a combination therapy of cetuximab plus irinotecan and demonstrated stable disease with a progression-free survival of 6.3 months (PMID: 31515458).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-08 15:23:51',NULL,NULL,NULL,NULL,'839326e3-e318-490f-aefb-5d1cc6446c31',673,NULL),(2615,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'cb00df9d-198b-4dad-9bf7-65978cb68d7f',673,NULL),(2616,NULL,'The class II BRAF K499E mutation is located in the kinase domain in exon 12 of the protein (PMID: 33019809). This mutation has been found in cardio-facio-cutaneous syndrome (PMID: 16474404, 16439621). Expression of this mutation in NIH-3T3 cells demonstrated that it is activating as measured by significantly increased transcription of downstream MAPK pathway transcriptional targets (e.g., ELK) compared to wildtype BRAF (PMID: 16474404).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-08 14:43:44',NULL,NULL,NULL,NULL,'d46a95e1-2983-436e-9368-5485cf138059',673,NULL),(2617,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'ef03b869-b19a-406d-805f-6dc48d4c0c48',673,NULL),(2618,NULL,'The BRAF E501G mutation is located in the kinase domain in exon 12 of the protein. This mutation has been found in cardio-facio-cutaneous (CFC) syndrome (PMID: 16439621). Expression of BRAF E501G in NIH-3T3 cells demonstrated that this mutation is slightly loss of function and therefore likely not oncogenic, as measured by MAPK pathway activation in the form of downstream ELK transcription comparable to or less than wildtype BRAF (PMID: 26065894, 16474404, 16439621).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2019-02-03 19:52:37',NULL,NULL,NULL,NULL,'2662435c-a398-48e3-ad80-840da9137e2b',673,NULL),(2619,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'139692b6-39a3-4cc0-a9f7-1879cd870b0f',673,NULL),(2620,NULL,'The BRAF E501K mutation is located in the kinase domain of the BRAF protein. This mutation has been found as a germline mutation in Noonan syndrome and cardio-facio-cutaneous syndrome (PMID: 17603482, 16474404). In vitro studies have demonstrated that this mutation might be inactivating as measured by decreased BRAF kinase activity in a cell line with a second BRAF mutation compared to controls (PMID: 17603482). However, another in vitro study found increased downstream pathway output compared to wildtype (PMID: 16474404). BRAF E501K is suggested to be RAS-dependent due to enrichment of RAS regulatory genes in tumors harboring the mutation in a pan-cancer genomic data analysis (PMID: 33507258).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2023-03-07 18:05:18',NULL,NULL,NULL,NULL,'ec6aaa98-f05b-4a8d-bb3c-5e1b59380208',673,NULL),(2621,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'dfc4709e-b7be-4ea2-9784-a5cfd49b7b6d',673,NULL),(2622,NULL,'The class II BRAF L505H mutation is located in the kinase domain in exon 12 of the protein (PMID: 33019809). This mutation has been found in prostate cancer (PMID: 24283590). Expression of this mutation in 293T cells or RWPE-1 prostate cells demonstrated that it is activating as measured by increased downstream activation of MEK and ERK as well as increased colony formation in soft agar compared to wildtype BRAF (PMID: 24283590). In vitro and in vivo studies of BRAF L505H suggest that this mutation is resistant to vemurafenib as measured by the occurrence of the L505H mutation in a vemurafenib resistance screen, sustained MAPK pathway signaling upon treatment with vemurafenib in cells expressing the mutation and sustained tumor growth in a xenograft model of melanoma cells harboring this mutation (PMID: 24283590, 24112705). In one study, one patient with metastatic melanoma harboring BRAF L505H had progressive disease in response to vemurafenib treatment (PMID: 25515853). In vitro studies, however, suggest that BRAF L505H is sensitive to selumetinib as measured by decreased MAPK pathway signaling upon drug treatment (PMID: 24283590).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 18:55:32',NULL,NULL,NULL,NULL,'07f22e94-4359-4e3b-a747-1a846bbf7294',673,NULL),(2623,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'b1152f1c-13e3-4fdb-b675-1c0f378d1014',673,NULL),(2624,NULL,'The BRAF R509H mutation is located in the kinase domain in exon 13 of the protein. This mutation lies along the dimer interface of the protein. Expression of this mutation in 293H cells demonstrated that it is inactivating, as shown by decreased protein dimerization and decreased downstream cell signaling (PMID: 20179705).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2023-12-13 12:00:41',NULL,NULL,NULL,NULL,'5ee9e9a1-ed4b-4e83-ab9d-9c2e3969ceea',673,NULL),(2625,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'4fcd2047-f412-4b97-880d-cf0da88a2e43',673,NULL),(2626,NULL,'The BRAF T529I mutation is located in the kinase domain in exon 13 of the protein. This alteration is considered a gatekeeper mutation as mutations at the analogous residue in other kinases are known to cause resistance to drugs that bind in the ATP-binding pocket (PMID: 15573099). Expression of this mutation in COS7 cells demonstrated it is likely neutral as measured by kinase activity comparable to wildtype BRAF (PMID: 20538618). However, expression with BRAF V600E in COS7 cells demonstrated that this mutation confers resistance to RAF inhibitors such as vemurafenib, but maintains sensitivity to MEK inhibitors (PMID: 20538618).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'cd172ba8-907b-446b-8fa5-999d9842636d',673,NULL),(2627,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'7f29f128-5d8b-4338-bc2c-de5e0d021224',673,NULL),(2628,NULL,'The BRAF T529M mutation is located in the kinase domain in exon 13 of the protein. This alteration is considered a gatekeeper mutation as mutations at the analogous residue in other kinases are known to cause resistance to drugs that bind in the ATP-binding pocket (PMID: 15573099). Expression of this mutation in COS7 cells demonstrated it is likely neutral as measured by kinase activity comparable to wildtype BRAF (PMID: 20538618). However, expression with BRAF V600E in COS7 cells demonstrated that this mutation confers resistance to RAF inhibitors such as vemurafenib, but maintains sensitivity to MEK inhibitors (PMID: 20538618).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'ba37133a-b86e-4e2f-9c4a-3a20bba75a12',673,NULL),(2629,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'78859ec7-08e2-4cde-be35-dc1a8251ebe3',673,NULL),(2630,NULL,'The BRAF T529N mutation is located in the kinase domain in exon 13 of the protein. This alteration is considered a gatekeeper mutation as mutations at the analogous residue in other kinases are known to cause resistance to drugs that bind in the ATP-binding pocket (PMID: 15573099). Expression of this mutation in COS7 cells demonstrated it is likely neutral as measured by kinase activity comparable to wildtype BRAF (PMID: 20538618). However, expression with BRAF V600E in COS7 cells demonstrated that this mutation confers resistance to RAF inhibitors such as vemurafenib, but maintains sensitivity to MEK inhibitors (PMID: 20538618).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'700df84a-fd4b-4548-bc55-645b5151c41c',673,NULL),(2631,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2023-03-09 14:31:47',NULL,NULL,NULL,NULL,'26a09bcd-4109-4a76-b3ee-47b09f771091',673,NULL),(2632,NULL,'The BRAF W531C mutation is located in the cysteine-rich domain in exon 6 of the protein. This mutation has been found in patients with cardio-facio-cutaneous syndrome (PMID: 19206169). There is conflicting evidence on the biological and oncogenic effect of this mutation. Expression of this mutation in NIH-3T3 cells demonstrated that this mutation is likely neutral, as measured by downstream pathway activation comparable to wildtype BRAF (PMID: 19206169). However, in vitro studies with Ba/F3 and MCF10A cells and in vivo studies with drosophila expressing BRAF W531C demonstrate that the mutation is activating as measured by increased MEK and ERK signaling and cellular proliferation (PMID: 29533785, 33855281).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2023-03-09 18:56:08',NULL,NULL,NULL,NULL,'5ba45d26-0662-48e4-aca8-af8d9790b5fb',673,NULL),(2633,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2023-02-14 16:45:52',NULL,NULL,NULL,NULL,'90e25372-22a3-4004-a2f9-84f2187fbcfa',673,NULL),(2634,NULL,'The class III BRAF N581D mutation is located in the kinase domain in exon 15 of the protein and is a statistically significant hotspot (PMID: 3010472). This mutation is found in cardio-facio-cutaneous syndrome (PMID: 16474404). Expression of this mutation in NIH-3T3 cells demonstrated that it is likely neutral as measured by transcription of downstream MAPK pathway target genes (e.g., ELK) comparable to wildtype BRAF (PMID: 16474404). Preclinical studies with patient-derived xenograft models of non-small cell lung cancer expressing BRAF N581D demonstrated sensitivity to treatment with RMC-4550 as measured by tumor growth inhibition (PMID: 30104724).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2023-03-09 18:58:53',NULL,NULL,NULL,NULL,'102f2a9d-2991-464a-984f-13df8d99e510',673,NULL),(2635,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:43:59',NULL,NULL,NULL,NULL,'d51426b1-b27b-42be-b84e-20cd1d12953d',673,NULL),(2636,NULL,'The class III BRAF N581S mutation is located in the kinase domain in exon 15 of the protein (PMID:28783719). This mutation has been reported in lung cancer, colorectal cancer and melanoma (PMID: 26498038). Biological characterization of the BRAF N581S mutation has demonstrated that it is RAS dependent in its activation of the MAPK pathway, signals as a dimer with CRAF, and typically co-occurs with another driver mechanism that amplifies RAS signaling (PMID: 15035987, 28783719). Thus, in melanoma, the N581S variant, similar to other class III BRAF mutants, would be expected to co-occur with activating RAS mutation or NF1 inactivation, whereas in non-small cell lung or colorectal cancers, this mutation would most likely be associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719).  Preclinical studies with patient-derived lung adenocarcinoma cells expressing BRAF N581S demonstrated sensitivity to treatment with a combination therapy of PF-477736 plus PF3644022 as measured by increased apoptosis (PMID: 26140595). In a Phase II trial, two patients with lung adenocarcinoma and gynecologic cancer harboring BRAF N581S were treated with trametinib and demonstrated progressive disease and stable disease, respectively (PMID: 31924734). In a case report, a patient with metastatic colorectal cancer harboring BRAF N581S was treated with a combination therapy of cetuximab plus FOLFIRI and demonstrated partial response with a progression-free survival of sixteen months (PMID: 31515458). In another Phase II trial, two patients with advanced solid tumors harboring the mutation were treated with vemurafenib and did not clinically respond to treatment (PMID: 29320312).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 19:00:45',NULL,NULL,NULL,NULL,'db1a6f73-d838-41b4-9004-b2b5a0684b32',673,NULL),(2637,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2023-03-08 16:00:51',NULL,NULL,NULL,NULL,'c4f7d30f-8184-4ffb-bf52-768f6c3cb365',673,NULL),(2638,NULL,'The class III BRAF N581Y mutation is located in the kinase domain of BRAF in exon 13 (PMID: 30224342). This noncanonical BRAF mutation has been identified in a screen of colorectal cell lines and in a patient with melanoma (PMID: 19474002, 26084293). In vitro studies with Ba/F3 cells expressing BRAF N581Y demonstrate that the mutation is activating as measured by increased cell viability compared to wildtype (PMID: 32540409). The HT-55 colon cancer cell line harboring this mutation was insensitive to treatment with the GDC-0879 RAF kinase inhibitor (PMID: 19276360).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-08 16:00:52',NULL,NULL,NULL,NULL,'96dc7292-f9e2-4308-ac25-83ebc2eae671',673,NULL),(2639,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2020-10-04 23:37:23',NULL,NULL,NULL,NULL,'1c855bc9-a6bf-48d2-b7f9-3f26397c63a3',673,NULL),(2640,NULL,'The BRAF L584F mutation is located in the kinase domain of the BRAF protein. This mutation has been found in melanoma, as well as other cancers (PMID: 23658559, 26386083). In vitro studies have demonstrated that this mutation may be activating as measured by sensitivity to RAF inhibition compared to wildtype (PMID: 23658559).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2020-10-04 23:36:43',NULL,NULL,NULL,NULL,'31484336-b5ef-4566-9139-0889007f5784',673,NULL),(2641,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'770191ac-6644-4f4e-92fa-52bed11b6a88',673,NULL),(2642,NULL,'The class II BRAF E586K mutation is located in the kinase domain in exon 15 of the protein (PMID: 33019809). This mutation has been identified in lung adenocarcinoma (PMID: 31534501). Expression of this mutation in COS cells demonstrated that it is activating as measured by increased in vitro kinase activity compared to wildtype BRAF (PMID: 15035987). Preclinical studies with HEK293 cells expressing BRAF E586K demonstrated sensitivity to treatment with pan-RAF inhibitor LY3009120 as measured by inhibited phospho-MEK and -ERK activities (PMID: 26343583).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-07 18:08:03',NULL,NULL,NULL,NULL,'2a7480c9-f5a2-4f5d-ba10-1b5d56dd2c20',673,NULL),(2643,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:46:57',NULL,NULL,NULL,NULL,'4f7f3cec-7f72-4795-8bd8-0ac1ad166b47',673,NULL),(2644,NULL,'The class III BRAF F595L mutation is located in the kinase domain in exon 11 of the protein (PMID: 28783719). This mutation has been reported in histiocytic sarcoma, colorectal cancer and cardio-facio-cutaneous syndrome (PMID: 26582644, 15150094, 26150740). Biological characterization of the BRAF F595L mutation has demonstrated that it is RAS dependent in its activation of the MAPK pathway, signals as a dimer with CRAF, and typically co-occurs with another driver mechanism that amplifies RAS signaling (PMID: 28783719, 15035987, 15150094). Thus, when BRAF F595L is observed in melanoma, it typically co-occurs with an activating RAS mutation or NF1 inactivation, whereas when observed in non-small cell lung or colorectal cancers, it is associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719, 20141835). While this mutation is sensitive to MEK inhibition by targeted inhibitors such as trametinib, it is insensitive to RAF monomer inhibitors such as vemurafenib (PMID: 28783719, 26582644). A patient with metastatic colorectal cancer harboring BRAF F595L was treated with a combination therapy of FOLFOX plus panitumumab and experienced partial response with a progression-free survival of 10.2 months (PMID: 31515458).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-07 18:09:17',NULL,NULL,NULL,NULL,'5fb6a290-f77f-4f7e-aae1-ae8e7c6eb37a',673,NULL),(2645,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'2f902a6a-5e44-4837-8e09-cc39f20fce39',673,NULL),(2646,NULL,'The class III BRAF G596C mutation is located in the kinase domain of the BRAF protein (PMID: 28947956). This mutation has been found in non-small cell lung cancers, among others (PMID: 28947956). In vitro experiments have demonstrated that this mutation is activating as measured by increased downstream signaling compared to wildtype controls (PMID: 28947956). The BRAF G596C mutation confers resistance to the RAF inhibitor dabrafenib, but retains sensitivity to MEK inhibitor trametinib, as measured by MAPK pathway activation (PMID: 28947956).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-08 14:33:31',NULL,NULL,NULL,NULL,'7c6857fc-1772-420f-b26a-2e122ca12071',673,NULL),(2647,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:47:37',NULL,NULL,NULL,NULL,'0f1e6399-024b-4bd4-9d5d-175175fce18b',673,NULL),(2648,NULL,'The class III BRAF G596R mutation is located in the kinase domain in exon 15 of the protein (PMID: 28783719). This mutation has been reported in melanoma, lung cancer and colorectal cancer (PMID: 14678966, 26498038). Biological characterization of the BRAF G596R mutation has demonstrated that it is RAS dependent in its activation of the MAPK pathway, signals as a dimer with CRAF, and typically co-occurs with another driver mechanism that amplifies RAS signaling (PMID: 15035987, 28783719, 16364920). Thus, in melanoma, the G596R variant, similar to other class III BRAF mutants, would be expected to co-occur with activating RAS mutation or NF1 inactivation, whereas in non-small cell lung or colorectal cancers, this mutation would most likely be associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719). Preclinical studies with colorectal cancer cells expressing BRAF G596R demonstrated sensitivity to treatment with PLX8394, RMC-4550 and trametinib plus dabrafenib as measured by inhibition of cellular proliferation, and resistance to treatment with vemurafenib as measured by persistent ERK and MEK activation (PMID: 30559419, 30104724,  28947956, 28783719). In a Phase II trial, a patient with non-small cell lung cancer was treated with vemurafenib and did not clinically respond to treatment (PMID: 31959346).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 19:02:14',NULL,NULL,NULL,NULL,'4c2cce08-23cc-49a9-bb8c-3244d90f7ff2',673,NULL),(2649,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'c84458f5-3f34-4136-8ab3-239bb9996d4e',673,NULL),(2650,NULL,'The class III BRAF G596V mutation is located in the kinase domain in exon 15 of the protein (PMID: 33198372). This mutation has been found in cardio-facio-cutaneous syndrome (PMID: 16439621). Expression of this mutant in HEK293T cells demonstrated it has impaired kinase activity and is not able to induce downstream MEK and ERK activation in this context (PMID: 16439621). However, when expressed in zebrafish embryos, the G596V mutation causes the same aberrant elongation phenotype as BRAF V600E, suggesting that it might function in a manner similar to BRAF activating mutants during development in vivo (PMID: 19376813). In a Phase II trial, a patient with non-small cell lung cancer harboring BRAF G596V was treated with vemurafenib and demonstrated a partial response (PMID: 26200454).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-09 19:04:17',NULL,NULL,NULL,NULL,'86f2dcf1-34f4-426b-83d7-6336964f61fa',673,NULL),(2651,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'4fc6ccc4-22d3-4bfb-a6cd-8eead0f36523',673,NULL),(2652,NULL,'The BRAF A598T mutation is located in the kinase domain of the BRAF protein. This mutation has been identified in glioma (PMID: 32996219). In vitro experiments have demonstrated that is mutation is inactivating as measured by reduced BRAF kinase activity compared to wildtype controls (PMID: 22926515, 32059434).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2023-03-06 15:44:49',NULL,NULL,NULL,NULL,'b0e7125c-946a-4890-b86a-9cb16ddc21bd',673,NULL),(2653,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'094c1215-bf19-4821-8044-9d3e991acd7c',673,NULL),(2654,NULL,'The class II BRAF A598V mutation is located in the kinase domain in exon 15 of the protein (PMID: 34794740). This mutation has been found in papillary thyroid carcinoma (PMID: 19200582). In vitro studies of BRAF A598V in patient samples have demonstrated that this mutation is activating as measured by increased phosphorylated MEK and ERK levels compared to wildtype BRAF (PMID: 19200582). Preclinical studies with patient-derived circulating tumor cells expressing BRAF A598V demonstrate resistance to combination treatment with BRAF/MEK inhibitors dabrafenib and trametinib as measured by sustained detection following treatment (PMID: 33731038).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 15:44:59',NULL,NULL,NULL,NULL,'4e3b29fc-7373-4ca1-a7d9-0ec1b1595842',673,NULL),(2655,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'700e3725-521c-4138-a19f-10d02ba99db4',673,NULL),(2656,NULL,'The class II BRAF T599I mutation is located in the kinase domain in exon 15 of the protein (Abstract: Severson et al. Abstract #40P, Annals of Oncology 2022. https://www.annalsofoncology.org/article/S0923-7534%2822%2900058-8/fulltext). Expression of this mutation in COS cells demonstrated that it is activating as measured by increased kinase activity and downstream ERK activation compared to wildtype BRAF (PMID: 15035987). In a case report, a patient with metastatic melanoma harboring BRAF T599I was treated with vemurafenib and demonstrated a clinical response to treatment (PMID: 29232305).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 19:04:49',NULL,NULL,NULL,NULL,'25bbc115-da6c-4110-c0c1-d51486913e97',673,NULL),(2657,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'1e49df5e-858a-4e65-a507-1d50e08e2682',673,NULL),(2658,NULL,'The class II BRAF T599R mutation is located in the kinase domain in exon 15 of the protein (PMID: 33019809). This mutation has been found in cardio-facio-cutaneous syndrome and thyroid carcinoma (PMID: 19206169, 25120313). Expression of BRAF T599R in NIH3T3 cells demonstrated that it is activating as measured by increased colony formation and downstream MAPK pathway activation compared to wildtype BRAF (PMID: 19206169).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 14:33:57',NULL,NULL,NULL,NULL,'762acae2-d84d-4f7e-9f1b-18c23afc75d4',673,NULL),(2659,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'03ccaae2-8f53-4fa9-94f0-e1c098c93431',673,NULL),(2660,NULL,'The BRAF R671Q mutation is located in the kinase domain of the BRAF protein. This mutation has been found in colorectal cancers, among others (PMID: 27048246). In vitro studies have demonstrated that this mutation is likely activating as measured by increased downstream signaling compared to wildtype (PMID: 28174173).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2020-10-05 00:06:38',NULL,NULL,NULL,NULL,'c66a2b0d-3f33-4f91-85f3-4c0cac591ad8',673,NULL),(2661,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'4aaf8250-0888-4fb7-87f8-fd8a3648d50c',673,NULL),(2662,NULL,'The BRAF A728V mutation is located in the C-terminal end of exon 18 of the protein. This mutation has been identified in papillary thyroid carcinoma (PMID: 19176457).  Expression of this mutation in COS cells demonstrated that it is activating as measured by increased phosphorylated ERK levels and increased kinase activity compared to wildtype BRAF (PMID: 15035987).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 15:45:16',NULL,NULL,NULL,NULL,'84adeb92-4025-4ce5-be2a-d0b900086110',673,NULL),(2663,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2021-01-11 23:13:39',NULL,NULL,NULL,NULL,'c02b208b-d750-4898-957c-a9b175327513',673,NULL),(2664,NULL,'The class II BRAF L485_P490del mutation is located in the kinase domain in exon 11 of the protein (PMID: 36686670). Expression of this mutation in HEK293 or NIH-3T3 cells demonstrated that it is activating as measured by kinase activity and colony formation in soft agar comparable to BRAF V600E (PMID: 26732095). However, a second study in human cell lines demonstrated that this mutation has kinase activity comparable to wildtype BRAF (PMID: 26996308). This mutation is dependent on BRAF homodimer formation, as BRAF L485_P490del fails to activate downstream MAPK pathway effectors as a monomer (PMID: 26732095). Preclinical studies with NIH3T3 cells expressing BRAF L485_P490del demonstrated sensitivity to treatment with LY3009120, as measured by inhibition of MEK and ERK phosphorylation, and resistance to treatment with vemurafenib, as measured by sustained MEK and ERK signaling and proliferation (PMID: 26732095). In a case report, a patient with metastatic melanoma harboring BRAF L485_P490del and amplified PD-L1 expression was treated with a combination therapy of trametinib and dabrafenib and demonstrated partial response with a progression-free survival of 18 months (PMID: 36686670).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-09 19:05:21',NULL,NULL,NULL,NULL,'fcc850b0-b6f4-4c5e-9f3d-b1776da2b284',673,NULL),(2665,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2023-02-07 16:49:59',NULL,NULL,NULL,NULL,'9a46e5bd-4749-4733-afde-592265f17157',673,NULL),(2666,NULL,'The BRAF L485_Q494del mutation is located in the kinase domain in exon 11 of the protein. While this variant has not been functionally validated, another deletion in this amino acid range (L485_P490del) has been shown to be gain-of-function and oncogenic (PMID: 26732095). Experiments in cell lines and mouse models demonstrate that BRAF alpha-C helix indel mutants, such as L485_Q494del, are insensitive to vemurafenib and maintain activity of the MAPK pathway upon drug treatment (PMID: 26732095)','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2023-02-07 16:50:01',NULL,NULL,NULL,NULL,'9b3aa240-60ed-4132-8cb3-b6122d96703a',673,NULL),(2667,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'c3a491ee-e144-4017-9f6f-d2e809d40ccc',673,NULL),(2668,NULL,'The BRAF L485_P490delinsF mutation is located in the kinase domain in exon 11 of the protein. While this variant has not been functionally validated, another deletion in this amino acid range (L485_P490del) has been shown to be gain-of-function and oncogenic (PMID: 26732095). Experiments in cell lines and mouse models demonstrate that BRAF alpha-C helix indel mutants, such as L485_P490delinsF, are insensitive to vemurafenib and maintain activity of the MAPK pathway upon drug treatment (PMID: 26732095)','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-12-18 15:35:54',NULL,NULL,NULL,NULL,'2c5fe2dc-3d3c-4dd0-9342-4487716516bb',673,NULL),(2669,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2023-02-07 16:51:39',NULL,NULL,NULL,NULL,'46020abb-e172-4a09-90ee-6cedc0a7e4e7',673,NULL),(2670,NULL,'The class II BRAF L485_P490delinsY mutation is located in the kinase domain in exon 11 of the protein (PMID: 33019809). This mutation has been identified in non-small lung cancer (PMID: 12068308). While this variant has not been functionally validated, preclinical studies with non-small lung cancer cell lines and mouse models expressing BRAF L485_P490delinsY demonstrated sensitivity to treatment with LY3009120 and trametinib as measured by inhibition of cellular proliferation, and resistance to vemurafenib as measured by sustained MEK and ERK pathway activation (PMID: 26732095).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2023-03-09 19:07:06',NULL,NULL,NULL,NULL,'43ac21b6-f89c-4d26-9582-a4afa9412a21',673,NULL),(2671,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2021-01-11 22:45:05',NULL,NULL,NULL,NULL,'93be4a13-1158-4135-8c3b-062eaea0d56c',673,NULL),(2672,NULL,'The class II BRAF N486_P490del mutation is located in the kinase domain in exon 11 of the protein (PMID: 33019809). This mutation has been found in an ovarian cancer cell line and in patients with pancreatic cancer (PMID: 18060073, 26996308, 31519698). Expression of this mutation in a human cell line demonstrated that it is activating via a CRAF- and dimer-independent mechanism as measured by increased kinase activity and downstream signaling compared to wildtype (PMID: 26996308). Preclinical studies with patient-derived xenograft models of pancreatic ductal adenocarcinoma expressing BRAF N486_P490del demonstrated sensitivity to treatment with trametinib and LY3009120 alone or in combination as measured by reduced tumor growth (PMID: 34011980). A patient with pancreatic cancer harboring this mutation had a partial response to treatment with the BRAF inhibitor dabrafenib (PMID: 31519698). In a case report, two patients with Langerhans cell histiocytosis harboring BRAF N486_P490del were treated with trametinib and one patient demonstrated a complete response with a progression-free survival of over 18 months while the second patient demonstrated stable disease with a progression-free survival of over twelve months (PMID: 32991018). In another case report, a patient with metastatic pancreatic ductal adenocarcinoma harboring BRAF N486_P490del was treated with a combination therapy of dabrafenib plus trametinib and demonstrated partial response (PMID: 36505826).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-09 19:09:02',NULL,NULL,NULL,NULL,'5211e083-6d72-4505-a5fe-29da60c439a0',673,NULL),(2673,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2023-03-09 14:32:56',NULL,NULL,NULL,NULL,'d4da6583-0755-4b4c-a0a9-88cdd924ae26',673,NULL),(2674,NULL,'The BRAF V487_P492delinsA mutation is located in the kinase domain in exon 11 of the protein. In vitro studies with BxPC-3 cells expressing BRAF V487_P492delinsA demonstrate that the mutation is activating as measured by increased pathway activation and cellular proliferation compared to wildtype (PMID: 26732095). Experiments in cell lines and mouse models demonstrate that BRAF alpha-C helix indel mutants, such as V487_P492delinsA, are insensitive to vemurafenib and maintain activity of the MAPK pathway upon drug treatment (PMID: 26732095).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-09 14:32:57',NULL,NULL,NULL,NULL,'ab4e90a9-8fdf-480f-9078-717b7eae8560',673,NULL),(2675,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'a26d68bf-e048-4eb0-86c6-f03db77c89b7',673,NULL),(2676,NULL,'The class II BRAF T488_P492del mutation is located in the kinase domain in exon 11 of the protein (Abstract: Severson et al. Abstract #40P, Annals of Oncology 2022. https://www.annalsofoncology.org/article/S0923-7534%2822%2900058-8/fulltext). This mutation has been found in pancreatic cancer (PMID: 26996308). Expression of this mutation in a human cell line demonstrated that it is activating as measured by increased kinase activity and downstream signaling compared to wildtype (PMID: 26996308).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-09 14:34:39',NULL,NULL,NULL,NULL,'a73f9de4-3f0a-4a19-a926-8527631caf46',673,NULL),(2677,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'3b3cd9ed-bf98-4a48-8686-4462e5daffda',673,NULL),(2678,NULL,'The class II BRAF P490_Q494del mutation is located in the kinase domain in exon 11 of the protein (Abstract: Severson et al. Abstract #40P, Annals of Oncology 2022. https://www.annalsofoncology.org/article/S0923-7534%2822%2900058-8/fulltext). This mutation has been found in pancreatic cancer (PMID: 26996308). Expression of this mutation in a human cell line demonstrated that it is activating as measured by increased kinase activity and downstream signaling compared to wildtype (PMID: 26996308).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-08 16:03:07',NULL,NULL,NULL,NULL,'bdfa68e2-fbeb-4cd0-be3a-5f99c698a832',673,NULL),(2679,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'2af03236-4075-4338-a940-501eff3ca3a6',673,NULL),(2680,NULL,'The BRAF R506_K507insVLR mutation (also referred to as BRAF V504_R506dup) is located in the kinase domain in exon 13 of the protein. This mutation has been found in pilocytic astrocytoma (PMID: 23817572). Expression of this mutation in NIH-3T3 cells demonstrated that it is activating as measured by increased downstream pathway activation compared to wildtype BRAF (PMID: 23817572). Preclinical studies with HEK293T cells expressing BRAF R506_K507insVLR demonstrated sensitivity to treatment with trametinib as measured by inhibition of ERK signaling, and resistance to treatment with PLX8394, dabrafenib, vemurafenib, LY3009120 and sorafenib as measured by sustained ERK signaling (PMID: 34108213).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 19:11:19',NULL,NULL,NULL,NULL,'e33ccee2-e00e-4d90-ab7c-b8dd00dc6146',673,NULL),(2681,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'cea46944-4ddb-4879-85e5-4f5e9096b01b',673,NULL),(2682,NULL,'The BRAF T599dup mutation is located in the kinase domain in exon 15 of the protein. This mutation has been found in melanoma and pilocytic astrocytoma (PMID: 19363522, 21190184, 29456854, 38781546). Expression of this mutation in HEK293, NIH-3T3 or MCF-10A cells demonstrated that this mutation is activating as measured by kinase activity, anchorage-independent growth and changes in contact inhibition comparable to BRAF V600E (PMID: 19363522, 21190184, 23833300). In a case report, four patients with metastatic melanoma harboring BRAF T599dup were treated with a combination therapy of dabrafenib plus trametinib and demonstrated partial response (PMID: 35319964). Another patient with metastatic melanoma harboring BRAF T599dup was treated with a combination therapy of binimetinib plus encorafenib and demonstrated a partial response and a progression-free survival of at least nine months (PMID: 35319964). Two other patients with metastatic melanoma harboring BRAF T599dup were treated with vemurafenib and demonstrated progressive disease (PMID: 35319964). In a case report, a pediatric patient with pilocytic astrocytoma harboring BRAF T599ins was successfully treated with dabrafenib (PMID: 38781546). In another case report, a patient with metastatic colorectal cancer was treated with a combination therapy of panitumumab plus FOLFOX and demonstrated progressive disease (PMID: 31515458).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2024-08-21 16:49:34',NULL,NULL,NULL,NULL,'aa40d7f6-5e58-4764-a5d0-ee4acadfd3ad',673,NULL),(2683,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'9da9cbef-6692-46d3-91d5-4c2f5c0259d5',673,NULL),(2684,NULL,'The BRAF T599insTT mutation is located in the kinase domain in exon 15 of the protein. This mutation has been found in pilocytic astrocytoma (PMID: 21190184). Expression of this mutation in HEK293 cells or MCF-10A cells demonstrated that this mutation is activating as measured by kinase activity and changes in contact inhibition comparable to the BRAF V600E mutation (PMID: 21190184).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'9d37b580-d00b-4bb8-ae07-6b3c35e024ed',673,NULL),(2685,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'0aee4a9e-61b8-4030-9b4e-dac8f285ac2a',673,NULL),(2686,NULL,'The BRAF T599_V600insV mutation is located in the kinase domain in exon 15 of the protein. This mutation has been found in papillary thyroid carcinoma (PMID: 16501605). Expression of BRAF T599_V600insV in HEK293 or NIH-3T3 cells demonstrated that it is activating and transforming as measured by increased kinase activity, increased downstream pathway activation, and increased foci formation compared to wildtype BRAF (PMID: 16501605).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'666cbc41-40e1-4e09-8c5d-c452e60b3d37',673,NULL),(2687,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'e28500fd-4a6d-423f-b6d3-7c78170548bd',673,NULL),(2688,NULL,'The BRAF V600delinsYM mutation is located in the kinase domain in exon 15 of the protein. This mutation has been found in papillary thyroid carcinoma (PMID: 22752848). Expression of this mutation in NIH-3T3 cells demonstrated that it is activating as measured by increased kinase activity and increased cell proliferation compared to wildtype BRAF (PMID: 22752848).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'228dffe7-0f4b-4554-bb4f-088824fab2ae',673,NULL),(2689,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'037bd74e-dbb8-43bf-ba1a-d3d48ba1d100',673,NULL),(2690,NULL,'The BRAF V600_K601insDFGLAT alteration is located in the kinase domain in exon 15 of the protein. This mutation has been found in papillary thyroid cancer (PMID: 17297294). Expression of this mutation in NIH-3T3 cells demonstrated that it is activating as measured by increased downstream pathway activation and colony formation compared to wildtype BRAF (PMID: 17297294).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2020-11-17 20:51:17',NULL,NULL,NULL,NULL,'e5797c7f-7268-48b6-8ead-783fcab2d999',673,NULL),(2691,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'ab18a9a6-b6c2-421c-b74d-08ab02c44d09',673,NULL),(2692,NULL,'BRAF fusions generally arise from chromosomal translocations that fuse the N-terminal end of a partner gene with the C-terminal end of BRAF (exons 9-18, containing the kinase domain), such that the fusion protein excludes the BRAF CR1 regulatory domain (PMID:15630448), thereby resulting in a constitutively active BRAF kinase. These class II hyperactivating BRAF fusions have been found in melanoma, prostate cancer, gastric cancer, and multiple other cancers (PMID: 28783719, 26343582, 24345920, 20526349, 25985019, 26324360, 18974108). Biological characterization of diverse BRAF fusion proteins demonstrate that they activate the downstream MAPK pathway independent of RAS (PMID: 24345920, 21424530, 22745804, 21424530, 18974108, 26343582), render BRAF active as a homo- or heterodimer dimer with CRAF (PMID: 26343582), and, while sensitive to MEK inhibition by targeted inhibitors such as trametinib (PMID: 24345920, 28783719, 26343582, 26314551), are insensitive to RAF monomer inhibitors such as vemurafenib and dabrafenib (PMID: 26343582, 28783719). BRAF fusions have been found across multiple studies in post-treatment samples of patients with EGFR-mutant lung cancer who progressed on osimertinib (PMID: 30257958, 30073261).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2024-06-05 11:14:09',NULL,NULL,NULL,NULL,'896baaf7-1159-4038-9434-8a5539537581',673,NULL),(2693,NULL,'There is promising clinical data from a case study in a patient with BRAF fusion-positive ovarian cancer treated with the FDA-approved MEK1/2-targeted inhibitor selumetinib in combination with paclitaxel, and in patients with BRAF fusion-positive melanoma treated with the FDA-approved MEK1/2-targeted inhibitor trametinib.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2019-08-26 15:43:50',NULL,NULL,NULL,NULL,'2a6d18bb-0a61-4615-a43d-1818b7dd46ea',673,NULL),(2694,NULL,'Cobimetinib and trametinib are small molecule inhibitors of the MEK1/2 kinases that are FDA-approved in combination with a RAF inhibitor for use in BRAF V600E-positive metastatic melanoma. In a study of patients with low-grade serous ovarian cancer, a patient with a CUL1-BRAF fusion who progressed on carboplatin and paclitaxel had a sustained complete response to treatment with paclitaxel and a MEK1/2 inhibitor (selumetinib) (PMID: 26324360).  Additionally, in vitro studies have demonstrated that BRAF fusions are sensitive to MEK inhibition as measured decreased downstream MAPK pathway signaling in BRAF fusion-containing cells upon treatment with trametinib (PMID: 24345920).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2023-02-15 14:50:08',NULL,'LEVEL_3A','NO','LEVEL_3B','e569bfd4-15f5-421d-9d4e-31dfb7a82903',673,NULL),(2695,NULL,'There is promising clinical data in patients with BRAF fusion-positive melanoma treated with the FDA-approved MEK1/2-targeted inhibitor trametinib.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2019-08-26 15:44:02',NULL,NULL,NULL,NULL,'4d13aa6b-fb7c-45e4-8c43-fe1223fdd53f',673,NULL),(2696,NULL,'Cobimetinib and trametinib are orally available, small-molecule inhibitors of the MEK1/2 kinases that are FDA-approved in combination with a RAF inhibitor for use in BRAF V600E-positive metastatic melanoma. There is promising clinical data in patients with BRAF fusion-positive melanoma treated with cobimetinib and trametinib monotherapies.\nTwo studies from independent groups have shown that three patients with BRAF-fusion positive metastatic melanoma experienced clinical benefit, such as improvement of ECOG status, tumor shrinkage, or stable disease upon treatment with the MEK inhibitor trametinib (PMID: 26314551, 26072686). In the Phase II VICC MEL 1457 (NCT02296112) trial of trametinib in patients with BRAF non-V600 mutant metastatic melanoma (n=2, patient with BRAF fusion), one patient harboring a BRAF-AGAP3 fusion achieved a partial response with an on-going progression-free survival of 1.8 months and one patient harboring a BRAF-MZT1 fusion demonstrated progressive disease (PMID: 33861486).\nIn vitro studies have demonstrated that BRAF fusions are sensitive to MEK inhibition as measured by decreased downstream MAPK pathway signaling in BRAF fusion-containing cells upon treatment with trametinib (PMID: 24345920).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2025-03-12 15:07:32',NULL,'LEVEL_3A','NO','LEVEL_3B','cec96519-6479-4b9e-9d89-42e3b2a2bc94',673,NULL),(2697,NULL,'While the pan-RAF kinase inhibitor tovorafenib is FDA-approved for the treatment of patients 6 months of age and older with pediatric low-grade glioma harboring a BRAF fusion, and there is promising clinical data demonstrating the clinical utility of MEK1/2-targeted inhibitors such as FDA-approved trametinib in patients with BRAF fusion-positive melanoma and ovarian cancer, the clinical utility of these inhibitors in patients with [[variant]] is unknown.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2024-04-30 12:10:54',NULL,NULL,NULL,NULL,'67f8217f-063d-454f-c0a1-9ad1481afc59',673,NULL),(2698,NULL,'The MEK inhibitor selumetinib is NCCN-compendium listed as a treatment option for patients with BRAF fusion-positive pilocytic astrocytoma.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2021-08-26 18:34:29',NULL,NULL,NULL,NULL,'5306d2e7-1e09-4cfe-ae94-152e3244c7f6',673,NULL),(2699,NULL,'Selumetinib is a small molecule tyrosine kinase inhibitor of MEK1/2. In stratum one of the phase II PBTC study of selumetinib in 25 patients with pilocytic astrocytoma harboring a KIAA1549–BRAF fusion or BRAF V600E mutation, seven of eighteen patients with a KIAA1549–BRAF fusion had a partial response to treatment (PMID: 31151904). Additionally, the two year progression-free survival rate for the BRAF study population (n=25) was 70% (95% CI = 47–85) (PMID: 31151904).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 14:50:30',NULL,'LEVEL_2','NO','LEVEL_3B','a05f8f2e-5d26-4639-9c10-019b8183fc33',673,NULL),(2700,NULL,'The pan-RAF kinase inhibitor tovorafenib is FDA-approved for the treatment of patients 6 months of age and older with pediatric low-grade glioma harboring a BRAF fusion or rearrangement.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2024-04-26 14:21:48',NULL,NULL,NULL,NULL,'6b87637f-0271-4c56-8c1b-5a6ccaca7780',673,NULL),(2701,NULL,'Tovorafenib is an orally available, pan-RAF small molecule inhibitor that is FDA-approved for the treatment of pediatric patients six months of age and older with relapsed or refractory pediatric low-grade glioma (LGG) harboring a BRAF fusion or rearrangement, or BRAF V600 mutation. FDA approval was based on the results of the Phase II FIREFLY-1 (NCT04775485) trial of tovorafenib in 76 patients (median age=8 years old [range=2-21]) with relapsed or refractory pediatric LGG harboring an activating BRAF alteration based on local laboratory testing. In the Phase II FIREFLY-1 (NCT04775485) trial, the overall RAPNO-LGG cohort demonstrated an objective response rate (ORR) of 51% (95% CI=40-63), with a 37% (n=28) partial response rate and 14% (n=11) minor response rate, a median duration of response (DOR) of 13.8 months (95% CI=11.3-NE) in 39 patients and a median progression-free survival of 13.8 months (95% CI=8.3-16.9) (PMID: 37978284). The BRAF fusion subcohort (n=64 [KIAA1549-BRAF fusion, n=56; other BRAF duplication or rearrangement by FISH, n=8]) demonstrated an ORR of 52% (95% CI=39-64) and a median DOR of 13.8 months (95% CI=11.3-NE) (PMID: 37978284).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2024-04-26 14:21:56',NULL,'LEVEL_1','NO','LEVEL_3B','8bd8579f-8d4f-42ef-9271-8e3149c2490f',673,NULL),(2702,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2019-07-29 23:12:54',NULL,NULL,NULL,NULL,'bb7f48fd-2962-44c1-a76a-08465a8aa7cf',673,NULL),(2703,NULL,'The AGAP3-BRAF fusion protein results from an inversion on chromosome 7, joining exons 1-9 of AGAP3 with a 3\' segment of the BRAF gene. The AGAP3-BRAF fusion protein contains the full BRAF kinase domain, but lacks the regulatory RAS-binding domain and the cysteine-rich (CR1) domain, which are responsible for BRAF binding to RAS and auto-inhibition. This fusion protein has been found in melanoma, colorectal cancer and ovarian serous carcinoma (PMID: 26314551, 28539463, 30279230, 34568720).  Expression of this fusion in NIH3T3 cells demonstrated that it is activating as measured by increased MAPK pathway activity and cellular growth compared to wildtype BRAF (PMID: 30279230). Expression of this fusion in cell lines demonstrated that it is sensitive to trametinib but not vemurafenib as measured by in vitro colony formation and cell proliferation (PMID: 28539463). A patient with BRAF V600E-mutated metastatic melanoma, who experienced disease relapse after an initial response to the BRAF inhibitor Vemurafenib, was subsequently treated with dabrafenib plus trametinib (RAF inhibitor plus MEK inhibitor), and had a partial response for a period of two months (PMID: 28539463).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2021-10-12 15:51:05',NULL,NULL,NULL,NULL,'9f208268-d2d3-415b-820f-472944a8850e',673,NULL),(2704,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'e535c945-69cf-4a98-8ec3-6161c1706862',673,NULL),(2705,NULL,'The AGK-BRAF fusion protein results from an inversion of chromosome 7, which fuses the first two exons of AGK with exons 8-18 of BRAF. The AGK-BRAF fusion protein contains the full BRAF kinase domain, but lacks the regulatory RAS-binding domain and the cysteine-rich (CR1) domain, which are responsible for BRAF binding to RAS and auto-inhibition (PMID: 23890088, 24135138). This fusion has been found in melanoma, glioma, lung cancer, ovarian serous carcinoma and pediatric post-Chernobyl thyroid cancer (PMID: 23890088, 24135138, 26314551, 34568720). Expression of AGK-BRAF in mouse fibroblasts demonstrated that this fusion is activating and transforming as measured by increased growth and colony formation in soft agar compared to GFP control (PMID: 24135138). In vitro studies of AGK-BRAF in melanoma cell lines suggest that this fusion is sensitive to sorafenib but not vemurafenib as measured by cell viability upon drug treatment (PMID: 23890088). AGK-BRAF fusion was observed in 3 of 174 EGFR-mutant lung adenocarcinoma with primary resistance to EGFR tyrosine kinase inhibitors (TKIs).  Functional studies with the induction of AGK-BRAF fusion in H1975 ( EGFR L858R + T790M), PC9 (EGFR ex19del) and HCC827 (EGFR ex19del) cell lines demonstrated that the fusion conferred resistance to growth inhibition by EGFR TKIs (PMID: 30831205).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2021-10-12 16:18:20',NULL,NULL,NULL,NULL,'ec17e9b0-111a-46a9-a462-3608dcfa3eac',673,NULL),(2706,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'60c9eb9a-dff8-4f07-a2de-5e0df3641d31',673,NULL),(2707,NULL,'The AKAP9-BRAF fusion protein results from an inversion of chromosome 7 that fuses exons 1-8 of AKAP9 and exons 9-18 of BRAF. This fusion contains the BRAF kinase domain, but excludes the BRAF CR1 domain responsible for RAS binding and auto-inhibition (PMID:15630448). Expression of AKAP9-BRAF in COS7 cells demonstrated that it is activating as measured by increased kinase activity compared to wildtype BRAF, and expression of AKAP9-BRAF in NIH-3T3 cells demonstrated that it is transforming as measured by increased foci formation compared to wildtype BRAF (PMID:15630448).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'db923d23-b9a7-4aec-9c62-f8360acb48a7',673,NULL),(2708,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'1c201a83-1800-4ce4-a7d9-82e7ff1a3fd0',673,NULL),(2709,NULL,'The CUL1-BRAF fusion protein results from an in-frame translocation of chromosome 7 that fuses exons 1-7 of CUL1 with exons 9-18 of BRAF (PMID: 26324360). The CUL1-BRAF fusion protein contains the BRAF kinase domain, but lacks the BRAF CR1 domain that is responsible for RAS-binding and auto-inhibition. This fusion has been found in low-grade serous ovarian cancer (PMID: 26324360). While this fusion has not been functionally validated, other fusions that contain the BRAF kinase domain an exclude the CR1 domain have been shown to be activating and oncogenic (PMID: 22745804, 25985019, 15630448). A patient with low-grade serious ovarian cancer harboring the CUL1-BRAF fusion achieved a sustained complete response to combination selumetinib and paclitaxel (PMID: 26324360). In a study of patients with low-grade serous ovarian cancer, a patient with a CUL1-BRAF fusion who progressed on carboplatin and paclitaxel had a sustained complete response to treatment with combined selumetinib and paclitaxel (PMID: 26324360).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-08-18 17:09:00',NULL,NULL,NULL,NULL,'4a726bda-f66f-4715-b83d-a3cd788ba09d',673,NULL),(2710,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'25243c5f-b3b1-4811-82e3-123c7c50193a',673,NULL),(2711,NULL,'The FAM131B-BRAF fusion is the result of a 2.5 Mb deletion on chromosome 7 which fuses the first two exons of the FAM131B gene with exons 9-18 of the BRAF gene (PMID: 21424530). This fusion contains the BRAF kinase domain, but excludes the BRAF CR1 domain responsible for RAS binding and auto-inhibition (PMID:15630448). The FAM131B-BRAF fusion has been found in pilocytic astrocytomas and pediatric low-grade gliomas (PMID: 21424530, 25040262). Expression of this mutation in NIH-3T3 cells demonstrated that it is activating, as measured by increased downstream MEK phosphorylation and decreased contact inhibition compared to wildtype BRAF (PMID: 21424530). Preclinical studies with mice and NIH3T3 cells expressing FAM131B-BRAF demonstrate sensitivity to treatment with trametinib as measured by suppressed tumor growth and anchorage-independent growth; however, acquired resistance was observed following prolonged treatment (PMID: 29156677). FAM131B-BRAF is suggested to acquire resistance against MEK inhibitors selumetinib, binimetinib and trametinib through enhancing PI3K/AKT/mTOR pathway signaling to overcome MEK inhibition (PMID: 29156677). Combination treatment of mTOR inhibitor everolimus with trametinib in mice expressing FAM131B-BRAF prolonged tumor suppression and delayed acquired resistance (PMID: 29156677).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-07 18:12:22',NULL,NULL,NULL,NULL,'81a3f713-19b7-4236-bdad-ec27d8558e27',673,NULL),(2712,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-11-29 19:47:36',NULL,NULL,NULL,NULL,'71d38212-4aaa-400f-a4e5-e1b22e33a12c',673,NULL),(2713,NULL,'The GTF2I-BRAF fusion protein results from a rearrangement on chromosome 7, joining exons 1-19 of GTF21 to intron 9 BRAF, thus retaining the full kinase domain of BRAF. The GTF2I-BRAF fusion has been identified in melanoma and pilocytic astrocytoma (PMID: 26314551, 28448514). When expressed in a human embryonic kidney cell line, the fusion protein elevated basal levels of phosphorylated ERK compared to the wildtype BRAF (PMID: 28448514). The fusion was detected in a patient with pilocytic astrocytoma and immunohistochemistry confirmed elevated phospho-ERK in tumor tissue from this patient (PMID: 28448514).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-09 19:13:34',NULL,NULL,NULL,NULL,'6ef06341-1ca9-4f6c-8a4c-293b89cb6f0d',673,NULL),(2714,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'55d693ef-39c8-4ddb-9623-8a864eea593b',673,NULL),(2715,NULL,'The KIAA1549-BRAF fusion protein results from an internal tandem duplication event on chromosome 7 that fuses exons 1-16 of KIAA1549 and exons 9-18 of BRAF. This fusion contains the BRAF kinase domain, but excludes the BRAF CR1 domain responsible for RAS binding and auto-inhibition (PMID: 18974108, 24345920). This fusion has been found in pilocytic astrocytoma (PMID: 18974108, 24345920). Expression of this fusion in NIH-3T3 cells demonstrated that it is activating as measured by constitutive kinase activity and increased anchorage independent growth in soft agar compared to wildtype BRAF (PMID: 18974108). KIAA1549-BRAF fusion protein functions as a dimer and is therefore not sensitive to RAF inhibitors such as vemurafenib in vitro (PMID: 23533272). Preclinical evidence suggests that these oncoproteins may be targeted by second-generation RAF inhibitors, which are reported to inhibit RAF dimers rather than induce their transactivation of RAF (as is the case with older inhibitors such as vemurafenib) (PMID: 23533272). In vitro studies have suggested that pediatric astrocytoma cell lines harboring the KIAA1549-BRAF fusion are resistant to treatment with first generation RAF inhibitors (PMID: 23533272, 26072686). In a Phase II clinical trial of selumetinib in 25 patients with WHO grade I pilocytic astrocytoma harboring either the KIAA1549-BRAF fusion or the BRAF V600E mutation, nine patients (36% [95% CI:18-57%]) had a sustained partial response (PMID: 31151904).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2019-10-27 21:12:36',NULL,NULL,NULL,NULL,'f98b6b73-bf97-4869-aec2-1234627962f3',673,NULL),(2716,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'89c2cc4a-b480-4509-983b-a785ba959878',673,NULL),(2717,NULL,'The MKRN1-BRAF fusion results from an inversion of chromosome 7 that fuses exons 1-4 of MKRN1 and exons 11-18 of BRAF (PMID: 23817572). This fusion contains the BRAF kinase domain but excludes the BRAF cysteine-rich (CR1) domain responsible for RAS binding and auto-inhibition (PMID:15630448). This mutation has been found in pediatric pilocytic astrocytoma, colorectal cancer, head and neck cancer, and ovarian serous cancer (PMID: 23817572, 26314551, 26324360, 34568720). While this fusion has not been functionally validated, other fusions that contain exons 11-18 of BRAF (e.g., AKAP9-BRAF, KIAA1549-BRAF) have been shown to be activating and oncogenic (PMID: 15630448, 18974108, 23817572). The MKRN1-BRAF fusion was detected in a patient with low-grade serous ovarian cancer who achieved a sustained complete response to combination selumetinib and paclitaxel (PMID: 26324360, 34568720).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2021-10-12 16:18:54',NULL,NULL,NULL,NULL,'621199d9-da07-472a-b38b-2674f36450af',673,NULL),(2718,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'5d30335b-e959-4424-9f22-37e9577b519e',673,NULL),(2719,NULL,'The PAPSS1-BRAF fusion protein results from a fusion of chromosomes 4 and 7 that fuses exons 1-5 of PAPSS1 and exons 9-18 of BRAF (PMID: 24345920). This fusion contains the BRAF kinase domain, but excludes the BRAF CR1 domain responsible for RAS binding and auto-inhibition (PMID:15630448). This fusion has been found in melanoma (PMID: 24345920). Expression of this fusion in 293H cells demonstrated that it is activating as measured by activation of downstream MEK and ERK that is comparable to BRAF V600E (PMID: 24345920). In vitro experiments have suggested that the PAPSS1-BRAF fusion is resistant to vemurafenib but sensitive to trametinib as measured by changes in MEK and ERK phosphorylation upon drug treatment (PMID: 24345920).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'aac8fa91-a07d-4eb8-b3be-b9f2132cb9b4',673,NULL),(2720,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic',NULL,NULL,NULL,NULL,NULL,'0e288881-f144-4f60-b565-d607cb2c22d2',673,NULL),(2721,NULL,'The PPFIBP2-BRAF fusion joins the N-terminus of PPFIBP2 with the C-terminus of BRAF resulting in a fusion protein containing the BRAF kinase domain but lacking the BRAF CR1 regulatory domain. While this fusion has not been functionally validated, other BRAF fusions lacking the BRAF CR1 regulatory domain (e.g. KIAA 1549-BRAF fusion) have been shown to be activating and oncogenic. The PPFIBP2-BRAF fusion was found in a patient with metastatic melanoma who responded to MEK inhibition with trametinib (PMID: 26072686).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2018-02-28 20:53:06',NULL,NULL,NULL,NULL,'935876ae-3fd7-430d-b5bd-f9f34f8f540b',673,NULL),(2722,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'dfdf1602-37b6-40f4-a110-c0c62594f6e3',673,NULL),(2723,NULL,'The SND1-BRAF fusion protein results from a rearrangement of chromosome 7 and fuses exons 1-16 of SND1 with exons 9-18 of BRAF. The SND1-BRAF fusion protein contains the BRAF kinase domain, but lacks the BRAF CR1 domain that is responsible for RAS-binding and auto-inhibition (PMID: 24345920). Expression of SND1-BRAF in a lung adenocarcinoma cell line, H1299, or a gastric cancer cell line, GTL16, demonstrated that this fusion is activating as measured by increased activation of downstream MEK and ERK signaling proteins compared to wildtype BRAF (PMID: 22745804, 25985019). Expression of SND1-BRAF in Ba/F3 cells demonstrated that this fusion is transforming as measured by IL-3-independent growth (PMID: 25266736). In vitro studies suggest that this fusion is sensitive to MEK inhibition, as measured by decreased cell viability upon treatment with trametinib (PMID: 25266736).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'8674d546-7ec4-40ba-a4b1-0dbb0e112823',673,NULL),(2724,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'b5a0f9dd-a623-480e-a8ce-fc163330249e',673,NULL),(2725,NULL,'The TRIM24-BRAF fusion protein results from an inversion of chromosome 7 that fuses exons 1-9 of TRIM24 and exons 9-18 of BRAF (PMID: 24345920). This fusion contains the BRAF kinase domain, but excludes the BRAF CR1 domain responsible for RAS binding and auto-inhibition (PMID:15630448). This fusion has been found in melanoma (PMID: 24345920). Expression of this fusion in 293H cells demonstrated that it is activating as measured by activation of downstream MEK and ERK that is comparable to BRAF V600E (PMID: 24345920). In vitro experiments have suggested that the TRIM24-BRAF fusion is resistant to vemurafenib but sensitive to trametinib as measured by changes in MEK and ERK phosphorylation upon drug treatment (PMID: 24345920).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2019-07-20 11:35:05',NULL,NULL,NULL,NULL,'2ae1fb52-59a2-4a65-8fea-3fe33187dca6',673,NULL),(2726,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic',NULL,NULL,NULL,NULL,NULL,'90c7bd08-6966-4b0b-aaf0-acf1e1625bdd',673,NULL),(2727,NULL,'The ZKSCAN1-BRAF fusion joins the N-terminus of ZKSCAN1 with the C-terminus of BRAF, resulting in a fusion protein containing the BRAF kinase domain but lacking the BRAF CR1 regulatory domain. While this fusion has not been functionally validated, other BRAF fusions lacking the BRAF CR1 regulatory domain (e.g. KIAA 1549-BRAF fusion) have been shown to be activating and oncogenic. The ZKSCAN1-BRAF fusion was found in a patient with spitzoid melanoma who responded to the MEK inhibitor trametinib (PMID: 26314551).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2018-03-05 16:20:25',NULL,NULL,NULL,NULL,'465766c4-ccec-4657-9331-3b277c8d36eb',673,NULL),(2728,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'ee6a98fc-190a-40d0-8b1e-6aa8726a3a2b',673,NULL),(2729,NULL,'BRAF amplification is a rare event in cancer and has been found to occur at very low frequency in melanoma and glioma (cBioPortal, MSKCC, April 2017). It has been demonstrated that amplification of wildtype BRAF in melanoma cells leads to overexpression of the protein and constitutive activation of MAPK pathway, demonstrated as a BRAF-dependent increase in ERK phosphorylation, as well as an increase in cell proliferation (PMID: 15467732). BRAF overexpression has been associated with increased proliferation in gliomas (PMID: 25618114). Amplification of BRAF V600E allele has been described as a mechanism of resistance to MEK/RAF inhibitors in melanoma via MAPK pathway hyperactivation (PMID: 22395615, 24055054, 21098728).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2019-07-20 11:26:14',NULL,NULL,NULL,NULL,'7c4682f3-b122-4160-bb8b-fd1585a3b73e',673,NULL),(2730,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:46:25',NULL,NULL,NULL,NULL,'fd6a7bec-aedd-46f3-8c87-1a3ed90ed1f5',673,NULL),(2731,NULL,'The class III BRAF D594H missense mutation occurs in the kinase domain in exon 15 of the protein (PMID: 28783719). This mutation has been reported in melanoma, lung and colorectal cancers (PMID: 28481359). Biological characterization of the BRAF D594H mutation has demonstrated that it is RAS dependent in its activation of the MAPK pathway, signals as a dimer with CRAF, and typically co-occurs with another driver mechanism that amplifies RAS signaling (PMID: 28783719). Thus, when BRAF D594H is observed in melanoma, it typically co-occurs with an activating RAS mutation or NF1 inactivation, whereas when observed in non-small cell lung or colorectal cancers, it is associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719, 20141835). While this mutation is sensitive to MEK inhibition by targeted inhibitors such as trametinib, it is insensitive to RAF monomer inhibitors such as vemurafenib (PMID: 28783719).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-06 15:51:18',NULL,NULL,NULL,NULL,'be6acfec-a41a-46ca-b9ce-e79a9b7ee84a',673,NULL),(2732,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:44:11',NULL,NULL,NULL,NULL,'08e3242b-d663-42c0-bdfe-978c4e27c4e7',673,NULL),(2733,NULL,'The class III BRAF N581I mutation is located in the kinase domain in exon 15 of the protein (PMID: 28783719). This mutation has been reported in lung cancer and vulval malignant melanoma (PMID: 22969966, 26202550, 15917418). Biochemically, it has been demonstrated that the BRAF N581I mutant signals as a dimer with CRAF, is RAS-dependent in its activation of the MAPK pathway, and, in tumors, would typically co-occur with another driver mechanism that amplifies RAS signaling (PMID: 28783719). Thus, in melanoma, the N581I variant, similar to other class III BRAF mutants, would be expected to co-occur with activating RAS mutation or NF1 inactivation, whereas in non-small cell lung or colorectal cancers, this mutation would most likely be associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719). While this mutation is sensitive to MEK inhibition by targeted inhibitors such as trametinib, it is insensitive to RAF monomer inhibitors such as vemurafenib (PMID: 28783719). In a case report, a patient with metastatic colorectal cancer harboring BRAF N581I was treated with a combination therapy of cetuximab plus irinotecan and demonstrated stable disease with a progression-free survival of 10.3 months (PMID: 31515458).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 19:14:01',NULL,NULL,NULL,NULL,'0cc9d835-eac3-44d0-b116-4aaca9cf6dac',673,NULL),(2734,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:47:22',NULL,NULL,NULL,NULL,'ae1e8ae2-ae37-432a-b750-d53fd88d0c79',673,NULL),(2735,NULL,'The class III BRAF G596D mutation is located in the kinase domain in exon 15 of the protein (PMID: 28783719). This mutation has been reported in cervical adenocarcinoma and esophagogastric cancer (PMID: 17360030, 23481512). Biochemically, it has been demonstrated that the BRAF G596D mutant signals as a dimer with CRAF, is RAS-dependent in its activation of the MAPK pathway, and, in tumors, would typically co-occur with another driver mechanism that amplifies RAS signaling (PMID: 28783719). Thus, like other class III BRAF mutants, in melanoma, the G596D variant would be expected to co-occur with activating RAS mutation or NF1 inactivation, whereas in non-small cell lung and colorectal cancers, this mutation would most likely be associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719). While this mutation is sensitive to MEK inhibition by targeted inhibitors such as trametinib, it is insensitive to RAF monomer inhibitors such as vemurafenib (PMID: 28783719). Preclinical studies with SKBR3 cells expressing BRAF G596D demonstrate resistance to treatment with dabrafenib as measured by sustained ERK phosphorylation following treatment (PMID: 31158244).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 19:15:15',NULL,NULL,NULL,NULL,'49953b55-2bdb-486f-b7e4-89fe7668145b',673,NULL),(2736,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic',NULL,NULL,NULL,NULL,NULL,'b43cee2e-c580-4a59-b413-2a9b73025243',673,NULL),(2737,NULL,'The BRAF P367R mutation occurs in exon 8 of the gene. A study evaluating the effects of rare somatic mutations in lung cancers showed that cells transfected with BRAF P367R mutation display a mild increase in ERK phophorylation compared to wildtype (PMID: 27478040).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function',NULL,NULL,NULL,NULL,NULL,'31cdd5bf-1988-4e5c-9e4e-763b9e2f48cb',673,NULL),(2738,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic',NULL,NULL,NULL,NULL,NULL,'c12b63c0-7113-4bff-bb65-5012665295d1',673,NULL),(2739,NULL,'The BRAF H574Q mutation is located in exon 14 of the kinase domain of the protein. This mutation has been identified in glioma and melanoma (PMID: 34625582, 28972077). A study evaluating the effects of rare somatic mutations in lung cancers showed that cells transfected with BRAF H574Q mutation display a robust increase in ERK phosphorylation, comparable to BRAF V600E mutation (PMID: 27478040).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-09 19:15:46',NULL,NULL,NULL,NULL,'6e4e140e-18bf-423f-94d3-f0747d28683c',673,NULL),(2740,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral',NULL,NULL,NULL,NULL,NULL,'81aec819-7b4c-4046-9d85-fcf61e35c5d5',673,NULL),(2741,NULL,'The BRAF W450L mutation is located in the kinase domain of the BRAF protein. This mutation has been found in lung cancers, among others (PMID: 27478040). In vitro studies have demonstrated that this mutation is likely neutral as measured by downstream signaling compared to wildtype (PMID: 27478040).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2020-09-20 17:34:17',NULL,NULL,NULL,NULL,'a4bddc9f-5015-46ac-bb44-29ac9c0ba4ab',673,NULL),(2742,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:43:30',NULL,NULL,NULL,NULL,'1e49a5d0-e272-4aae-9808-df8d11f19caf',673,NULL),(2743,NULL,'The class III BRAF S467L mutation occurs in the kinase domain in exon 11 of the protein (PMID: 28783719). This mutation has been reported in melanoma (PMID: 24710085, 25651238, 26498038, 26559571). Biochemically, it has been demonstrated that the BRAF S467L mutant signals as a dimer with CRAF, is RAS-dependent in its activation of the MAPK pathway, and, in tumors, would typically co-occur with another driver mechanism that amplifies RAS signaling (PMID: 28783719). Therefore, class III BRAF mutants like the BRAF S467L variant would be generally expected to co-occur with activating RAS mutations or NF1 inactivation in melanomas, whereas in non-small cell lung or colorectal cancers, this mutation will most likely be associated with receptor tyrosine kinase (RTK) hyperactivation at the protein level (PMID: 28783719).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 19:16:16',NULL,NULL,NULL,NULL,'2cff07a9-00cc-46ec-b107-d2f5af04f8ba',673,NULL),(2744,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2018-06-19 11:36:00',NULL,NULL,NULL,NULL,'e284c089-14e5-44d4-ad50-ab260d2d8f45',673,NULL),(2745,NULL,'The class II BRAF K601T mutation is located in the kinase domain in exon 15 of the protein (PMID: 28783719, 26343582). This mutation has been reported in hairy cell leukemia and multiple myeloma (PMID: 25938346, 26090869). Biochemical characterization of BRAF K601T has demonstrated that it activates the downstream MAPK pathway independent of RAS and renders BRAF active as a dimer with CRAF and itself (PMID: 26343582). While this mutation is sensitive to MEK inhibition by targeted inhibitors such as trametinib, it is insensitive to RAF monomer inhibitors such as vemurafenib (PMID: 28783719, 26343582, 22798288).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2023-03-09 19:16:52',NULL,NULL,NULL,NULL,'e34774d6-313e-4da7-824b-87c3d126c302',673,NULL),(2746,NULL,'BRAF class II mutations including [[gene]] [[mutation]] are insensitive to the RAF-targeted inhibitors vemurafenib and dabrafenib. Laboratory data suggest that cancer cells with oncogenic, non-V600 BRAF mutations may be sensitive to novel BRAF inhibitors such as plixorafenib.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2024-06-10 17:52:41',NULL,NULL,NULL,NULL,'522e6413-dfd4-4099-8da9-1f79b192e6e4',673,NULL),(2747,NULL,'Plixorafenib is an orally available, second-generation, small-molecule BRAF inhibitor that inhibits mutated, oncogenic BRAF without causing paradoxical MAPK pathway activation as is seen with first-generation BRAF inhibitors (PMID: 28659148). In a phase I clinical trial for patients with refractory or relapsed solid tumors with or without BRAF mutation, there were two (28%) partial responses of seven evaluable BRAF-mutant patients treated with plixorafenib and cobicistat, a CYP3A4 inhibitor (Abstract: Janku et al. Abstract# B176, AACR-NCI-EORTC 2017. http://mct.aacrjournals.org/content/17/1_Supplement/B176). Both responses were in patients with BRAF V600 mutations. In a phase I/IIa trial of plixorafenib for patients with BRAF-altered, advanced solid or CNS tumors (n=110; n=61, patients with class 1 mutations; n=19, patients with class 2 mutations [excluding fusions]; n=17, patients with BRAF fusions), partial response was achieved in 39% (n=9/23) of patients with MAPKi-naive, V600-mutant tumors, with a median duration of response (DoR) of 32 months, and in 18% (n=3/17) of patients with MAPKi treated, V600-mutant tumors (n=6, patients with V600-mutant glioma; n=3, patients with V600-mutant ovarian cancer; n=1, patients with V600-mutant small bowel cancer; n=1, patients with V600-mutant papillary thyroid cancer; n=1, patients with V600-mutant anaplastic thyroid cancer) (Abstract: Fuente et al. Abstract# 3006, J. Clin. Oncol. 2023, Vol 41, Suppl 16. https://ascopubs.org/doi/10.1200/JCO.2023.41.16_suppl.3006). \nPreclinical studies show that plixorafenib specifically inhibits BRAF-containing dimers and inhibits proliferation and pathway activation in BRAF-mutated colorectal cancer cell lines (PMID: 26466569, 28659148, 30559419, 28783719).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2024-06-10 17:52:28',NULL,'LEVEL_4','NO','LEVEL_4','96034660-351c-4fce-9f82-cdfe98f7a0d2',673,NULL),(2748,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2018-10-17 15:58:17',NULL,NULL,NULL,NULL,'94ff2e7c-e9c1-490b-8f9f-0de4c1b633d1',673,NULL),(2749,NULL,'The class III BRAF F247L mutation is located in the RAS binding and kinase autoinhibitory domain of the BRAF protein (PMID: 31515458). This mutation has been found in colorectal cancers, among others (PMID: 31515458). In vitro studies have demonstrated that this mutation is activating as measured by increased downstream signaling compared to wildtype (PMID: 28512244, 29533785). A patient with metastatic colorectal cancer harboring BRAF F247L was treated with a combination therapy of FOLFIRI plus cetuximab and demonstrated a complete response with a progression-free survival of 12.6 months (PMID: 31515458).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-07 18:16:10',NULL,NULL,NULL,NULL,'6da5e4e4-ed2a-4c99-83cd-555ceb42bd76',673,NULL),(2750,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2018-10-19 14:02:07',NULL,NULL,NULL,NULL,'06ea9f39-5cdd-4c53-9d3b-fd0740e47125',673,NULL),(2751,NULL,'The BRAF L514V mutation is located in the ATP binding pocket of the kinase domain of the protein. This mutation was found in a patient with BRAF V600E-mutant anaplastic ganglioglioma who progressed on treatment with dabrafenib (PMID: 29880583). Co-expression of this mutation in human cells with BRAF V600E in cis demonstrated that it is activating, promotes dimerization, and confers resistance to type I αC-OUT/DFG-IN BRAF inhibitors such as vemurafenib and dabrafenib (PMID: 29880583). The BRAF L514V mutation was shown to be sensitive to inhibition with RAF dimer inhibitors, such as BGB3245 (PMID: 29880583).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2018-10-19 14:44:23',NULL,NULL,NULL,NULL,'fa20c208-4419-4084-96ea-938a2dcd9353',673,NULL),(2752,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2019-02-07 22:56:32',NULL,NULL,NULL,NULL,'d76c1ca3-0fc0-4275-83e3-e01280b4e5f5',673,NULL),(2753,NULL,'The PCBP2-BRAF fusion results from the fusion of the 3\' end of the PCBP2 gene with the 5\' end of the BRAF gene. While this alteration has not been functionally characterized per se, many other BRAF fusions have been shown to be oncogenic suggesting that the PCBP2-BRAF fusion is likely oncogenic (PMID: 24345920, 21424530, 22745804, 21424530, 18974108, 26343582). In a study of patients with non-small cell lung cancer who progressed on osimertinib, one patient harbored the PCBP2-BRAF fusion (PMID: 30257958). Knockdown of BRAF in a cell line created from this patient led to a reduction of cell growth and resensitization to osimertinib (PMID: 30257958). While these cells were insensitive to the BRAF inhibitors dabrafenib and LXH245, they were sensitive to the MEK inhibitor trametinib (PMID: 30257958).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2019-07-20 12:11:32',NULL,NULL,NULL,NULL,'fc022e3e-d9df-4908-b6c7-e4881d450db2',673,NULL),(2754,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2019-03-15 01:28:23',NULL,NULL,NULL,NULL,'373a848a-67c3-465e-a52e-c2d81b49eaea',673,NULL),(2755,NULL,'The BRAF N486_T491delinsK mutation is located in the kinase domain of the protein. This mutation has been found in histiocytic neoplasms (PMID: 30867592). Expression of this mutation in Ba/F3 cells demonstrates that it is activating as measured by increased downstream ERK signaling, cytokine-independent growth, and MEK1/2-inhibitor sensitivity in vitro compared to wildtype BRAF (PMID: 30867592). A patient with histiocytic disease harboring the BRAF N486_T491delinsK mutation had a complete response to treatment with the MEK1/2 inhibitor cobimetinib (PMID: 30867592).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2019-03-24 21:45:12',NULL,NULL,NULL,NULL,'a4caf016-33fd-4eb9-b967-6b18c944b350',673,NULL),(2756,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2019-07-29 16:14:51',NULL,NULL,NULL,NULL,'d8c54d72-0695-4cf9-aefa-e77540c5ffa0',673,NULL),(2757,NULL,'Duplication of the BRAF kinase domain (BRAF-KDD) occurs from a breakpoint in intron 9 and results in a duplication of exons 10-18 to generate a protein that is approximately 140 kDa with a second kinase domain and an alternative 3\' untranslated region. This alteration has been found in lung cancer, melanoma and others (PMID: 32913992, 27320919, 26562024). In vitro studies with HEK293T cells expressing BRAF-KDD demonstrate that the mutation is activating as measured by increased downstream MAPK pathway signaling compared to control (PMID: 27320919). Analysis from sequencing data of clinical samples across multiple tumor types harboring BRAF-KDD also demonstrates that the mutation is activating as measured by increased BRAF mRNA and CCND1 expression, demonstrating increased activation of MAPK signaling (PMID: 26562024). The oncogenic function of BRAF-KDD is predicted to be dimerization-dependent based on preclinical studies of BRAF-KDD in BRAF V600E-positive cells demonstrating sensitivity to pan-RAF dimerization inhibitor LY3009120 (PMID: 27320919). Knockdown of BRAF-KDD in BRAF V600E-positive cells expressing the kinase domain duplication demonstrated restored sensitivity to BRAF inhibitors such as dabrafenib (PMID: 27320919).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2024-05-22 15:38:21',NULL,NULL,NULL,NULL,'00b243ca-25a4-46b0-a189-7e9c80a3af07',673,NULL),(2758,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2019-07-29 23:17:49',NULL,NULL,NULL,NULL,'b2bfc7d1-dca7-424c-aea1-f4d4f269a868',673,NULL),(2759,NULL,'The ARMC10-BRAF fusion protein combines the N-terminus of ARMC10 with the C-terminus of BRAF, preserving the kinase domain of BRAF. This fusion protein is found in patients with sporadic microsatellite instability-high colorectal cancers (PMID: 30279230). Expression of this fusion protein in NIH3T3 cells demonstrated that it was activating as shown by increased colony formation and pathway activation compared to expression of BRAF alone (PMID: 30279230). Preclinical studies with patient-derived xenograft models expressing ARMC10-BRAF demonstrated sensitivity to treatment with MEK inhibitor trametinib and ERK inhibitor SCH772984 as measured by tumor regression and decreased phosphorylated ERK following treatment (PMID: 30254212).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-06 15:45:43',NULL,NULL,NULL,NULL,'ee026fa7-42df-40e7-bcce-6fc7f23610f4',673,NULL),(2760,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2021-01-11 23:01:24',NULL,NULL,NULL,NULL,'7fb3f203-c29f-4970-9fce-a49bbc9aaba2',673,NULL),(2761,NULL,'The BRAF N486del mutation is located in the kinase domain in exon 11 of the protein. Expression of this mutation in a human cell line demonstrated that it is likely neutral as measured by kinase activity comparable to wildtype (PMID: 26996308).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2021-01-11 23:04:17',NULL,NULL,NULL,NULL,'8988fbbf-4d5e-4827-8715-7b7ab6fec169',673,NULL),(2762,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2021-01-11 23:07:09',NULL,NULL,NULL,NULL,'b7c09079-ec39-4eaf-a48a-29699f0561bc',673,NULL),(2763,NULL,'The BRAF N486_V487del mutation is located in the kinase domain in exon 11 of the protein. Expression of this mutation in a human cell line demonstrated that it is likely activating as measured by modestly increased kinase activity compared to wildtype (PMID: 26996308).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2021-01-11 23:07:41',NULL,NULL,NULL,NULL,'efd9fd75-4a60-44c8-afaa-488fdcd9d630',673,NULL),(2764,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2021-01-11 23:10:06',NULL,NULL,NULL,NULL,'33d8da06-3401-4fe6-ab4e-f2937c13438a',673,NULL),(2765,NULL,'The BRAF N486_T488del mutation is located in the kinase domain in exon 11 of the protein. This mutation has been identified in non-small cell lung cancer (PMID: 36200799). Expression of this mutation in a human cell line demonstrated that it is likely activating as measured by increased kinase activity compared to wildtype (PMID: 26996308).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-08 15:59:58',NULL,NULL,NULL,NULL,'8754dd0b-a399-4490-a974-b60c3ff0d914',673,NULL),(2766,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2021-01-11 23:11:31',NULL,NULL,NULL,NULL,'65cb1cc4-f06b-4618-af23-3e11834cb4ca',673,NULL),(2767,NULL,'The BRAF N486_A489del mutation is located in the kinase domain in exon 11 of the protein. Expression of this mutation in a human cell line demonstrated that it is likely activating as measured by modestly increased kinase activity compared to wildtype (PMID: 26996308).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2021-01-11 23:11:33',NULL,NULL,NULL,NULL,'09be3075-692e-4804-bdef-15c34c209716',673,NULL),(2768,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2021-01-11 23:26:45',NULL,NULL,NULL,NULL,'f7bc56df-3d31-4f59-9949-cd88d5c8a63e',673,NULL),(2769,NULL,'The BRAF N486_T491del mutation is located in the kinase domain in exon 11 of the protein. Expression of this mutation in a human cell line demonstrated that it is likely activating as measured by modestly increased kinase activity compared to wildtype (PMID: 26996308).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2021-01-11 23:27:22',NULL,NULL,NULL,NULL,'605adff6-663f-455d-9b22-a60cade42cfc',673,NULL),(2770,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2021-01-11 23:29:15',NULL,NULL,NULL,NULL,'6e00085e-9da2-492a-a8c6-a635ebebfb65',673,NULL),(2771,NULL,'The BRAF P490del mutation is located in the kinase domain in exon 11 of the protein. Expression of this mutation in a human cell line demonstrated that it is likely neutral as measured by kinase activity comparable to wildtype (PMID: 26996308).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2021-01-11 23:29:39',NULL,NULL,NULL,NULL,'beace36e-656a-43af-9044-faf7cf48039c',673,NULL),(2772,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2021-01-11 23:42:10',NULL,NULL,NULL,NULL,'14e19c47-eb20-45a7-bf36-a4acc714db68',673,NULL),(2773,NULL,'The BRAF A489_P490del mutation is located in the kinase domain in exon 11 of the protein. Expression of this mutation in a human cell line demonstrated that it is likely activating as measured by modestly increased kinase activity compared to wildtype (PMID: 26996308).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2021-01-11 23:42:11',NULL,NULL,NULL,NULL,'3a2c8706-35f2-4056-a822-6cb6135aa7f8',673,NULL),(2774,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2021-01-11 23:44:51',NULL,NULL,NULL,NULL,'6a5b6c22-8a6b-47af-b330-771367813431',673,NULL),(2775,NULL,'The BRAF T488_P490del mutation is located in the kinase domain in exon 11 of the protein. Expression of this mutation in a human cell line demonstrated that it is likely neutral as measured by kinase activity comparable to wildtype (PMID: 26996308).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2021-01-11 23:45:05',NULL,NULL,NULL,NULL,'93d252f6-11a4-4b50-9716-2d6603567f22',673,NULL),(2776,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2021-01-11 23:48:23',NULL,NULL,NULL,NULL,'b6c74337-4d02-4a34-b5eb-018219d39c2f',673,NULL),(2777,NULL,'The BRAF V487_P490del mutation is located in the kinase domain in exon 11 of the protein. Expression of this mutation in a human cell line demonstrated that it is likely activating as measured by increased kinase activity compared to wildtype (PMID: 26996308).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2021-01-11 23:48:24',NULL,NULL,NULL,NULL,'8fba81d3-6bfd-46b2-b3c8-be2174cf5cef',673,NULL),(2778,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2021-05-05 21:00:58',NULL,NULL,NULL,NULL,'8e1b288e-93a8-45fa-8fad-90b6fda31633',673,NULL),(2779,NULL,'The BRAF A598_T599insV mutation is located in the kinase domain of the protein. While this mutation has not been functionally characterized, a patient with melanoma harboring this mutation had a partial response to treatment with the combination of dabrafenib and trametinib (PMID: 28800030).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2021-05-05 21:03:10',NULL,NULL,NULL,NULL,'5cc55276-326f-45e3-974a-fc29b92930fa',673,NULL),(2780,NULL,'While the RAF-inhibitor dabrafenib in combination with the MEK-inhibitor trametinib is FDA-approved for the treatment of patients with BRAF V600E mutant non-small cell lung cancer, their clinical utility in patients with [[variant]] is unknown.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2017-11-27 13:23:13',NULL,NULL,NULL,NULL,'ec7c8254-cf2c-461a-810e-e8f8e452de0e',673,NULL),(2781,NULL,'While the RAF-inhibitors dabrafenib and vemurafenib, alone and in combination with the MEK-inhibitors trametinib and cobimetinib respectively, are FDA-approved for the treatment of patients with BRAF V600E and V600K mutant melanoma, their clinical utility in patients with [[variant]] is unknown.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2018-08-22 15:30:00',NULL,NULL,NULL,NULL,'68ce6de9-5658-4535-b52d-a0b574d3c573',673,NULL),(2782,NULL,'While the RAF-inhibitor dabrafenib in combination with the MEK-inhibitor trametinib is FDA-approved for the treatment of patients with BRAF V600E mutant melanoma, non-small cell lung cancer, and anaplastic thyroid cancer, and the RAF-inhibitor vemurafenib is FDA-approved as monotherapy in BRAF V600-mutant Erdheim-Chester disease, their clinical utility in patients with [[variant]] is unknown.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2019-08-22 12:21:22',NULL,NULL,NULL,NULL,'e849d451-64e6-4dc1-ac77-0071b21a22f8',673,NULL),(2783,NULL,'This assertion is supported by (PMID: 22237106).','DIAGNOSTIC_IMPLICATION',NULL,_binary '\0',NULL,'2020-09-16 17:52:15',NULL,'LEVEL_Dx3',NULL,NULL,'46b031e3-4ae9-418b-8b17-3a6acfd197d8',673,NULL),(2784,NULL,'The presence of a BRAF [[mutation]] [[[mutation]]] may assist in the diagnosis of [[tumor type]].','DIAGNOSTIC_SUMMARY',NULL,_binary '\0',NULL,'2020-09-16 17:52:15',NULL,NULL,NULL,NULL,'614bf7fb-7926-49db-9fb0-6dd00fc3f603',673,NULL),(2785,NULL,'There is promising clinical data in patients with histiocytic neoplasms harboring MAPK pathway alterations treated with the MEK-targeted inhibitors cobimetinib or trametinib as monotherapy.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2021-10-20 10:48:08',NULL,NULL,NULL,NULL,'c96628e0-742b-477e-8eff-c79aa725a02d',673,NULL),(2786,NULL,'Trametinib and cobimetinib are MEK1/2 kinase inhibitors that are FDA-approved for patients with unresectable or metastatic melanoma with BRAF V600E or V600K mutations and both are NCCN-listed for patients with histiocytic neoplasms harboring MAPK pathway mutations. In a case study of one eighteen-year-old patient with refractory histiocytic sarcoma harboring a pathogenic variant of MAP2K1 (F53L), the patient was treated with trametinib and showed an excellent response prior to treatment interruption due to severe adverse events (PMID: 30361829).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2023-02-15 14:54:24',NULL,'LEVEL_3A','NO','NO','658a788e-390c-41c6-8081-0376b6121bb0',673,NULL),(2787,NULL,'The MEK-targeted inhibitors cobimetinib and trametinib are NCCN-listed as monotherapy for the treatment of patients with Erdheim-Chester Disease with MAPK pathway alterations, including [[gene]][[mutation]].','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2021-10-20 10:51:43',NULL,NULL,NULL,NULL,'e95d9545-8b3b-480e-9222-bddc0869dba2',673,NULL),(2788,NULL,'Trametinib and cobimetinib are MEK1/2 kinase inhibitors that are FDA-approved for patients with unresectable or metastatic melanoma with BRAF V600E or V600K mutations and both are NCCN-listed for patients with Erdheim-Chester Disease (ECD) harboring MAPK pathway mutations. In an open-label phase II trial (NCT02649972) of cobimetinib in eighteen adult patients with histiocytoses (n = twelve patients with ECD) of any mutational status, the overall response rate was 89% (90% CI: 73–100), 100% of responses were ongoing at one year, and 94% of patients remained progression-free (PMID: 30867592).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2023-02-15 14:54:05',NULL,'LEVEL_2','NO','NO','f85c5ffd-a7dc-4769-acdc-012ff3b7ac5d',673,NULL),(2789,NULL,'The MEK-targeted inhibitors cobimetinib and trametinib are NCCN-listed as monotherapy for the treatment of patients with Langerhans Cell Histiocytosis with MAPK pathway alterations, including [[gene]][[mutation]].','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2021-10-20 10:53:50',NULL,NULL,NULL,NULL,'7e539aa7-e805-4ac4-827e-a7a552199d1f',673,NULL),(2790,NULL,'Trametinib and cobimetinib are MEK1/2 kinase inhibitors that are FDA-approved for patients with unresectable or metastatic melanoma with BRAF V600E or V600K mutations and both are NCCN-listed for patients with Langerhans Cell Histiocytosis (LCH) harboring MAPK pathway mutations. In an open-label phase II trial (NCT02649972) of cobimetinib in eighteen adult patients with histiocytoses (n = two patients with LCH) of any mutational status, the overall response rate was 89% (90% CI: 73–100), 100% of responses were ongoing at one year, and 94% of patients remained progression-free (PMID: 30867592). In a study of three patients with LCH who were treated with trametinib, two patients harbored BRAF N486_P490del mutations, of which one had no reactivation and the other had a partial response, and the third patient with a MAP2K1 K57_G61del mutation had a complete response with no active disease after 22 months (PMID: 32991018).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2023-02-15 14:54:40',NULL,'LEVEL_2','NO','NO','a7ce9682-0287-4744-895c-69df4bb7792b',673,NULL),(2791,NULL,'The MEK-targeted inhibitors cobimetinib and trametinib are NCCN-listed as monotherapy for the treatment of patients with Rosai-Dorfman Disease with MAPK pathway alterations, including [[gene]][[mutation]].','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2021-10-20 10:55:24',NULL,NULL,NULL,NULL,'67779f76-43de-4ac6-8b31-27064c3ab215',673,NULL),(2792,NULL,'Trametinib and cobimetinib are MEK1/2 kinase inhibitors that are FDA-approved for patients with unresectable or metastatic melanoma with BRAF V600E or V600K mutations and are NCCN-listed for patients with Rosai-Dorfman Disease. One adult patient with Rosai-Dorfman Disease with an activating KRAS G12R mutation was treated with cobimetinib, and a follow-up CT scan two months after treatment showed a substantial response (PMID: 29236635).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2023-02-15 14:55:00',NULL,'LEVEL_2','NO','NO','6680f049-0c87-41fb-a234-09c1a2361419',673,NULL),(2793,NULL,'The RAF-targeted inhibitors encorafenib, dabrafenib and vemurafenib, alone or in combination with the MEK1/2-targeted inhibitors binimetinib, trametinib and cobimetinib respectively, are FDA-approved for the treatment of patients with BRAF V600E/K mutant melanoma and NCCN-compendium listed for the treatment of patients with BRAF V600-mutant melanoma. Additionally, the anti-PD-L1 antibody atezolizumab in combination with cobimetinib + vemurafenib is FDA-approved for the treatment of patients with unresectable or advanced BRAF V600-mutant melanoma.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2021-11-18 16:48:24',NULL,NULL,NULL,NULL,'6cbb7fd3-76a2-4d64-8332-bdb68e972b03',673,NULL),(2794,NULL,'The combination of encorafenib, an inhibitor of V600E- or V600K-mutant BRAF, and binimetinib, an inhibitor of MEK1/2, is FDA-approved in combination for patients with unresectable or metastatic melanoma with a BRAF V600E or V600K mutation. FDA approval was based on the results of the Phase III COLUMBUS trial of combined encorafenib plus binimetinib versus single agent vemurafenib in 577 patients with BRAF V600E- or V600K-mutant metastatic melanoma in which the median progression-free survival was 14.9 months (95% CI: 11.0-18.5) in the encorafenib plus binimetinib group versus 7.3 months (95% CI: 5.6-8.2) in the single agent vemurafenib group (HR= 0.54, 95% CI: 0.41-0.71; p<0·0001) (PMID: 29573941).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 14:57:31',NULL,'LEVEL_2','NO','LEVEL_3B','009d1441-ac80-4048-ae01-371ac1591c33',673,NULL),(2795,NULL,'Dabrafenib, an orally bioavailable RAF inhibitor, and trametinib, an orally bioavailable MEK1/2 inhibitor, are FDA-approved alone or in combination for the treatment of patients with metastatic melanoma harboring a V600E or V600K BRAF mutation. FDA approval of dabrafenib in combination with trametinib was based on results from an open-label Phase III study of combination therapy versus dabrafenib monotherapy in 247 patients with metastatic melanoma who were naive to treatment with BRAF inhibitors. Combined dabrafenib and trametinib, administered in full monotherapy doses, improved the response rate in patients with BRAF V600-mutant metastatic melanoma versus dabrafenib monotherapy (67% vs.51%; p<0.002). However, median progression-free survival improved by only two weeks (9.3 months vs 8.8 months; HR = 0.75) compared with dabrafenib monotherapy (PMID: 23020132). Combination therapy is associated with less cutaneous toxicity than monotherapy, but systemic toxicity may be increased (PMID: 25287827, 25399551). Follow-up trials have demonstrated that all clinical measures inclusive of overall and median progression-free survival as well as objective response rates, median duration of response and number of patients with complete response favored patients treated with combination dabrafenib and trametinib, administered in full monotherapy doses, compared to either dabrafenib or vemurafenib monotherapy, including patients who previously progressed on BRAF inhibitor monotherapy (PMID: 25287827, 25399551, 25265492). Additionally, patients with melanoma treated with dabrafenib and trametinib in both the neoadjuvant and adjuvant settings have improved survival over patients given standard of care (PMID: 29361468, 28991513, 28891408). Promising clinical data has also suggested that addition of an immunotherapy agent to combination RAF and MEK inhibitor treatment may improve rate of overall response and duration of response in melanoma patients (PMID: 31171876, 31171879, 31171878).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 14:57:46',NULL,'LEVEL_2','NO','LEVEL_3B','55f1261c-2f2c-4537-aa81-92adcb798585',673,NULL),(2796,NULL,'The combination of vemurafenib, an orally available kinse inhibitor of V600-mutant BRAF, and cobimetinib, an orally available kinase inhibitor of MEK1/2, is FDA-approved for the treatment of patients with BRAF V600-mutant metastatic or unresectable locally advanced melanoma. FDA approval was based on results from the randomized Phase III coBRIM trial of combined vemurafenib and cobimetinib versus vemurafenib and placebo in 495 patients with metastatic BRAF V600-mutant melanoma that demonstrated superior clinical benefit measures in the combination versus the control arm. Specifically, median progression-free survival was 9.9 months in the combination arm versus 6.2 months in the control arm (HR = 0.51), with a complete response rate of 10% versus 4%, respectively, and interim nine-month overall survival of 81% versus 73%, respectively (PMID: 25265494). Follow-up analysis of the coBRIM trial showed two-year overall survival was 48.3% in the combination group versus 38.0% in the monotherapy group (PMID: 27480103).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-15 14:58:00',NULL,'LEVEL_2','NO','LEVEL_3B','f9aaeb93-ca4e-49cc-8424-792f49ce9006',673,NULL),(2797,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-24 14:08:36',NULL,NULL,NULL,NULL,'2d9f2a61-bb25-4bb2-ba0d-6ebe58fd7f6c',673,NULL),(2798,NULL,'The p61BRAF(V600E) mutation is the product of alternative splicing of the BRAF mRNA transcript, which contains the V600E mutation but eliminates exons 4-8 of the gene (PMID: 22113612). This mutation encodes a truncated, 16 kDa BRAF protein that has the V600E mutation but lacks the RAS binding domain and constitutively dimerizes (PMID: 22113612). This mutation has been found in melanoma (PMID: 22113612). In concordance with its ability to constitutively dimerize, in vitro studies of this mutation suggest that it is resistant to vemurafenib, as measured by persistent MAPK pathway signaling and cell proliferation upon drug treatment (PMID: 22113612). In one study, six out of nineteen patients with melanomas that were resistant to vemurafenib harbored the p61BRAF(V600E) mutation (PMID: 22113612). In a second study, BRAF splice variants were found in several patient-derived xenografts that were generated from patients who progressed on BRAF inhibitors (PMID: 27320919).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2022-05-16 15:33:17',NULL,NULL,NULL,NULL,'540b58a0-be50-41d4-9241-ce4d8b597398',673,NULL),(2799,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2022-12-20 16:12:18',NULL,NULL,NULL,NULL,'753b067a-2371-47dd-aff5-722c63c023e0',673,NULL),(2800,NULL,'The BRAF I592_A598dup mutation is located in the kinase domain in exon 15 of the protein. This mutation has been identified in papillary thyroid carcinoma, inguinal adenopathy and primary melanoma, and is a statistically significant hotspot (PMID: 27571181, 28800030 ). This mutation has not been functionally characterized in vitro. BRAF exon 15 mutations are sensitive to treatment with combination MAPK-directed targeted therapy based on the clinical benefit of two patients with rare BRAF exon 15 insertion mutations involving the A598 residue, BRAF A598_T599insV and V600_K601delinsE (PMID: 28800030).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2022-12-20 16:12:22',NULL,NULL,NULL,NULL,'e094703b-28dd-45a1-a8c6-8f3f018fa030',673,NULL),(2801,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2024-03-12 10:30:48',NULL,NULL,NULL,NULL,'62fd5ccd-0491-4148-af9e-48bbc95dfd01',673,NULL),(2802,NULL,'The BRAF L485W mutation is located in the kinase domain of the protein (PMID: 35117215). This mutation has been identified in bladder adenocarcinoma and is a statistically significant hotspot (PMID: 28481359). The oncogenic and biologic effect of this mutation has conflicting evidence. An in vitro study with Ba/F3 and MCF10A cells expressing BRAF L485W demonstrates the mutation is inactivating as measured by decreased cellular viability in one cell line compared to wildtype (PMID: 29533785). In contrast, BRAF L485W has been cited as an activating class II BRAF mutation and is suggested to be an atypical activating mutation due to sensitivity to MAPK targeting inhibitors (PMID: 35977349, 35117215, 31015311). Clinical studies suggest that BRAF L485W is sensitive to MAPK pathway inhibition as measured by a patient with gallbladder cancer harboring the mutation demonstrating sensitivity to the ERK1/2 kinase inhibitor ulixertinib as measured by a year-long complete response to treatment (PMID: 29247021).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2024-03-12 16:29:08',NULL,NULL,NULL,NULL,'8322f1de-86af-4e6f-8a96-b05f246d1b16',673,NULL),(2803,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2023-02-01 16:54:38',NULL,NULL,NULL,NULL,'888eef19-2da3-4810-94b0-5f2e48293460',673,NULL),(2804,NULL,'The class II BRAF G469S mutation is located in the kinase domain in exon 11 of the protein (PMID: 31470866). This mutation has been identified in malignant melanoma and is a statistically significant hotspot (PMID: 16096377). In vitro studies with HEK293T cells expressing BRAF G469S demonstrate that the mutation is activating as measured by increased phosphorylated MEK and ERK levels compared to wildtype (PMID: 28947956). In a case report, a patient with metastatic melanoma harboring BRAF G469S was treated with a combination therapy of trametinib plus dabrafenib and demonstrated stable disease with a progression-free survival of three months (PMID: 31569065). In a Phase II trial, a patient with melanoma harboring BRAF G469S was treated with combination therapy of binimetinib and encorafenib and demonstrated an unconfirmed partial response (Abstract: Rose et al. Abstract# 531P, Annals of Oncology 2021. https://www.annalsofoncology.org/article/S0923-7534%2821%2903282-8/fulltext).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-15 14:47:02',NULL,NULL,NULL,NULL,'926f93dc-c93f-42cb-b07d-fef65da7985a',673,NULL),(2805,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2023-02-01 16:59:25',NULL,NULL,NULL,NULL,'3c8deca4-ab8f-4724-8503-d513c1d9080b',673,NULL),(2806,NULL,'The class III BRAF N581T mutation is located in the kinase domain of the protein (PMID: 31515458). This mutation has been identified in diffuse large B-cell lymphoma and is a statistically significant hotspot (PMID: 32187361). In vitro studies with Ba/F3 and MCF10A cells expressing BRAF N581T demonstrate that the mutation is likely neutral as measured by cell viability and proliferation comparable to wildtype (PMID: 29533785). In a case report, a patient with metastatic colorectal cancer harboring BRAF N581T was treated with a combination therapy of cetuximab plus FOLFOX and demonstrated partial response with a progression-free survival of 1.4 months (PMID: 31515458).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2023-03-08 16:02:42',NULL,NULL,NULL,NULL,'7d9ab560-2699-413a-9758-d8faab353cd4',673,NULL),(2807,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2023-02-02 15:39:47',NULL,NULL,NULL,NULL,'19aa6810-e3ad-4768-bcd1-eb3e988abba1',673,NULL),(2808,NULL,'The class III BRAF G596S mutation is located in the kinase domain of the protein and is a statistically significant hotspot (PMID: 33198372). In vitro studies with Ba/F3 cells expressing BRAF G596S demonstrate that the mutation is activating as measured by increased transformation ability compared to wildtype (PMID: 29533785). In silico analysis suggests that BRAF G596S is resistant to vemurafenib (PMID: 35215249).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-03-08 14:36:27',NULL,NULL,NULL,NULL,'776007fd-a78b-4c5d-8aa2-4d557760ffac',673,NULL),(2809,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2023-03-28 09:48:49',NULL,NULL,NULL,NULL,'3cc907ca-954a-4ed8-89d2-4b5207ed1077',673,NULL),(2810,NULL,'The BRAF G606W mutation is located in the kinase domain of the protein. This mutation has been identified in lung adenocarcinoma (PMID: 28481359). In vitro studies with MCF10A cells expressing BRAF G606W demonst