horylated ERK levels compared to vector control (PMID: 29156677). Preclinical studies with NIH3T3 cells expressing the fusion demonstrated sensitivity to treatment with trametinib as measured by inhibition of colony formation (PMID: 29156677).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-04-04 15:23:34',NULL,NULL,NULL,NULL,'036538d2-4a0f-4a70-869d-eaee537fa0e3',673,NULL),(2931,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2023-04-04 15:25:38',NULL,NULL,NULL,NULL,'2d32fafb-1395-4195-b20f-24766f8449bc',673,NULL),(2932,NULL,'The CLCN6-BRAF fusion results from a chromosomal rearrangement fusing exon 2 of CLCN6 and exon 11 of BRAF, retaining the BRAF kinase domain. This fusion has been identified in pilocytic astrocytoma (PMID: 23817572). In vitro studies with NIH3T3 cells expressing CLCN6-BRAF demonstrate that the fusion is activating as measured by increased phosphorylated ERK levels compared to vector control (PMID: 29156677). Preclinical studies with NIH3T3 cells expressing the fusion demonstrated sensitivity to treatment with trametinib as measured by inhibition of colony formation (PMID: 29156677).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-04-11 18:31:19',NULL,NULL,NULL,NULL,'f17ba4d6-8c93-4010-8e0b-4996e43ed556',673,NULL),(2933,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2023-04-04 15:27:11',NULL,NULL,NULL,NULL,'b510f68a-e682-4207-b814-4830e295b120',673,NULL),(2934,NULL,'The BRAF T470P mutation is located in the kinase domain of the protein. In silico analysis suggests that the mutation is damaging and activating (PMID: 24037001).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2023-04-04 15:27:13',NULL,NULL,NULL,NULL,'3da02e00-69cb-48fd-904a-32bf20bfa6c4',673,NULL),(2935,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2023-04-04 15:29:41',NULL,NULL,NULL,NULL,'92f96e90-5b2d-48ec-ae66-c3b752ff624c',673,NULL),(2936,NULL,'The BRAF M517I mutation is located in the kinase domain of the protein. In vitro studies with MCF10A cells expressing BRAF M517I demonstrate that the mutation is inactivating as measured by decreased cell proliferation and viability comparable to wildtype (PMID: 29533785).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2023-04-04 15:29:44',NULL,NULL,NULL,NULL,'0626731d-71e8-48cd-9e0d-8ef190e46b9c',673,NULL),(2937,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2023-04-11 18:32:33',NULL,NULL,NULL,NULL,'d2f65940-007d-407b-9d70-1320ada739d9',673,NULL),(2938,NULL,'The CSTF3-BRAF fusion results from a chromosomal rearrangement that retains the full kinase domain of BRAF. Although not functionally characterized per se, a patient with metastatic melanoma harboring BRAF V600E was treated with dabrafenib plus trametinib and acquired CSTF3-BRAF as a secondary resistance mutation following disease progression (PMID: 28539463).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-04-11 18:32:34',NULL,NULL,NULL,NULL,'1df85571-f803-4389-88c0-675a3500e905',673,NULL),(2939,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2023-04-04 15:31:57',NULL,NULL,NULL,NULL,'ad532864-471e-4a40-92e7-f56678fed421',673,NULL),(2940,NULL,'The SEPT3-BRAF fusion results from chromosomal rearrangement fusing exon 10 of SEPT3 and exon 8 of BRAF, retaining the full kinase domain and losing the inhibitory RBD domain of BRAF. In vivo studies with patient-derived xenograft models expressing SEPT3-BRAF demonstrate that the fusion is activating as measured by increased cellular proliferation and invasion compared to wildtype (PMID: 30254212).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-04-04 15:31:59',NULL,NULL,NULL,NULL,'4fc7feb3-cbcd-4ab0-951a-f14bdbaf7b13',673,NULL),(2941,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2023-04-04 15:54:21',NULL,NULL,NULL,NULL,'8d032552-13af-43b5-8eba-5b0cb0aed0a6',673,NULL),(2942,NULL,'The SLC45A3-BRAF fusion results from inter-chromos