355b-4142-b48c-6baa4018aae2',6098,NULL),(26075,NULL,'The ROS1 gene encodes a transmembrane protein with intracellular tyrosine kinase activity (PMID: 18778756). ROS1 is a member of the sevenless subfamily of tyrosine kinase insulin receptor genes (PMID: 27256160). The normal physiological role and ligand of this protein in humans is currently unknown (PMID: 23814043). ROS1 rearrangements where the kinase domain is retained (PMID: 22327623) are implicated in a range of human epithelial cancers including cholangiocarcinoma (PMID: 21253578), ovarian carcinoma (PMID: 22163003), gastric carcinoma (PMID: 23400546), angiosarcoma (PMID: 23637631) and most commonly non-small cell lung cancer (PMID: 22215748). Although ROS1 rearrangements were first discovered in a human glioblastoma cell line (PMID: 2827175), there is a paucity of ROS1 rearrangements in human gliomas (PMID: 24999209). The mechanism by which ROS1 rearrangements leads to dysregulated kinase activity is not clear, as its ligand has not yet been deciphered; however, it is hypothesized to occur through constitutive kinase activation (PMID: 18083107).','GENE_BACKGROUND',NULL,_binary '\0',NULL,'2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'6ab05933-cfea-46bb-a467-998f93a46f77',6098,NULL),(26076,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'aeb5989e-4867-4046-8c60-d724510de642',6098,NULL),(26077,NULL,'Fusions of ROS1 arise from chromosomal translocations that fuse the N-terminal portion of a partner protein with the C-terminal kinase-domain-containing portion of ROS1. These fusion proteins are found in a variety of cancer types and result in constitutive activation of ROS1 kinase activity. Biological characterization of specific ROS1 fusion proteins demonstrates that they are activating as shown by enhanced proliferation and colony formation and that they are sensitive to treatment with the tyrosine kinase inhibitors crizotinib and entrectinib (PMID: 23719267, 22919003, 22215748, 28465216). Preliminary clinical data suggests that lorlatinib may also be efficacious in patients with ROS1 fusion-positive non-small cell lung cancer, including those with central nervous system disease (PMID: 31669155).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2020-01-06 00:53:53',NULL,NULL,NULL,NULL,'e8113bd5-9371-4afc-a563-3c8db56bb3d8',6098,NULL),(26078,NULL,'The tyrosine kinase inhibitors crizotinib, entrectinib, repotrectinib and taletrectinib are FDA-approved for the treatment of patients with ROS1 fusion-positive non-small cell lung cancer.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2025-06-13 17:40:48',NULL,NULL,NULL,NULL,'3aa7655f-3fd3-41d8-a883-43bfccc6d2a2',6098,NULL),(26079,NULL,'Crizotinib, an inhibitor of ALK, ROS1 and MET tyrosine kinases, is FDA-approved for the treatment of patients with metastatic non-small cell lung cancer (NSCLC) whose tumors are ROS1-positive. FDA approval is based on the results of a Phase I trial of crizotinib in 53 patients with advanced NSCLC positive for ROS1 rearrangements in which the objective response rate was 72% (95% CI= 58-84), including six complete responses, 32 partial responses (66%) and a median progression-free survival (PFS) of 19.3 months (95% CI= 15.2-39.1)(PMID: 25264305, 30980071). In a Phase II trial of crizotinib in 127 East Asian patients with ROS1-positive NSCLC, the overall response rate was 71.1% (95% CI= 63.0-79.3), including seventeen of 127 patients with complete responses (13.4%), 74 of 127 patients with partial responses (58.3%), and a median PFS of 15.9 months (95% CI= 12.9-24.0) (PMID: 29596029).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-23 11:33:59',NULL,'LEVEL_1','NO','LEVEL_3B','c89514ef-b096-442a-828d-6ed357e12d57',6098,NULL),(26080,NULL,'Entrectinib is a potent, orally available, ATP-competitive tyrosine kinase inhibitor that is highly effective against NTRK1/2/3, ROS1 and ALK and is FDA-approved for patients with ROS1-fusion-positive non-small cell lung cancer (NSCLC). FDA approval was based on the results of three multicenter, single-arm clinical trials (ALKA, STARTRK-1 and STARTRK-2) in which of 51 evaluable patients with ROS1-fusion-positive NSCLC who were treated with entrectinib, the overall response rate was 78% (95% CI = 65-89) and response duration was more than one year for 55% of patients (PMID: 28183697)(Abstract: Drilon et al. Abstract# CT060, AACR 2017. https://cancerres.aacrjournals.org/content/77/13_Supplement/CT060)(Abstract: Braud et al. Abstract# 64P, ESMO 2019. https://academic.oup.com/annonc/article/30/Supplement_9/mdz420.003/5638397).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-23 11:34:10',NULL,'LEVEL_1','NO','LEVEL_3B','3dbaf733-ca83-47d3-b8d6-f15162c4055f',6098,NULL),(26081,NULL,'Repotrectinib, an orally administered next-generation ROS1/TRK tyrosine kinase inhibitor (TKI), is FDA-approved for the treatment of patients with ROS1 fusion positive non-small cell lung cancer (NSCLC). FDA-approval is based on the results of the Phase I/II TRIDENT-1 trial of repotrectinib in patients with ROS1 fusion positive NSCLC that are ROS1-inhibitor-naive or pre-treated. ROS1-inhibitor-naive patients (n=71) demonstrated an objective response rate of 79% (95% CI=68%-88%), with a 6% complete response rate and a 73% partial response rate, and a median duration response of 34.1 months (95% CI=25.6-NE) whereas ROS1-inhibitor pre-treated patients (n=56) demonstrated an objective response rate of 38% (95% CI=25%-52%), with a 5% complete response rate and a 32% partial response rate, and a median duration response of 14.8 months (95% CI=7.6-NE) (Abstract: Cho et al. Abstract# OA03.06, J. of Thoracic Oncol. Nov. 2023. https://www.jto.org/article/S1556-0864%2823%2900837-7/fulltext).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-12-01 15:30:17',NULL,'LEVEL_1','NO','LEVEL_3B','8c2ac63c-bdc2-471f-8beb-89b57b36cf16',6098,NULL),(26082,NULL,'Ceritinib is a small molecule inhibitor of ALK that also binds to and inhibits ROS1 and is NCCN-listed as a category 2A treatment recommendation for patients with non-small cell lung cancer (NSCLC) who have ROS1 rearrangements. In a Phase II study of ceritinib in 32 patients with NSCLC harboring ROS1 rearrangement, the overall response rate in 28 evaluable patients was 62% (95% CI= 45 - 77) with one patient having a complete response and nineteen patients having a partial response (PMID: 28520527).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-24 13:16:49',NULL,'LEVEL_2','NO','LEVEL_3B','a24c4391-adab-4b50-9df2-5d4253e243e6',6098,NULL),(26083,NULL,'Lorlatinib is a third-generation small molecule inhibitor of ALK and ROS1 that is NCCN-listed as a category 2A recommended subsequent therapy option for patients with ROS1-rearrangement-positive non-small cell lung cancer (NSCLC) who progressed on entrectinib, crizotinib or ceritinib. In a phase I/II trial of lorlatinib in patients with ROS1-fusion-positive NSCLC, thirteen of 21 tyrosine kinase inhibitor-naive patients had a response to lorlatinib for an overall response rate of 62% (95% CI= 38-82), while fourteen of 40 crizotinib pre-treated patients had a response to lorlatinib with an overall response rate of 35% (95% CI= 21-52)(PMID: 31669155).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2023-02-23 11:34:32',NULL,'LEVEL_2','NO','LEVEL_3B','88b15a8c-c63f-4b50-a0ae-b0c1e08180a9',6098,NULL),(26084,NULL,'Taletrectinib is an orally available, small-molecule ROS1/ NTRK tyrosine kinase inhibitor (TKI) that is FDA-approved for the treatment of adult patients with locally advanced or metastatic ROS1-positive non-small cell lung cancer (NSCLC). FDA approval was based on the results of the Phase I TRUST-I (NCT04395677) and TRUST-II (NCT04919811) trials of taletrectinib in patients with ROS1-positive NSCLC. \nIn the Phase II TRUST-I (NCT04395677) and TRUST-II (NCT04919811) trials, TKI-naїve patients (n=160) demonstrated an objective response rate (ORR) of 88.8% (95% CI=82.8-93.2), with eight complete responses (CR), 134 partial responses (PR) and ten patients demonstrating stable disease (SD), a disease control rate (DCR) of 95.0% (95% CI=90.4-97.8) and a median duration of response (DOR) of 44.2 months (95% CI=30.4-NR) (PMID: 40179330). Patients that were pretreated with a ROS1 TKI (n=113) demonstrated an ORR of 55.8% (95% CI=46.1-65.1), with five CRs, 58 PRs and 36 patients demonstrating stable disease, a DCR of 87.6% (95% CI=80.1-93.1) and a median DOR of 16.6 months (95% CI=10.6-27.3) (PMID: 40179330).','STANDARD_THERAPEUTIC_IMPLICATIONS_FOR_DRUG_SENSITIVITY','LEVEL_Fda2',_binary '\0','Sensitive','2025-06-13 17:47:40',NULL,'LEVEL_1','NO','LEVEL_3B','9682534d-aaea-4f23-9fb7-40e71fc32a44',6098,NULL),(26085,NULL,'While the tyrosine kinase inhibitors crizotinib, entrectinib, repotrectinib and taletrectinib are FDA-approved for the treatment of patients with ROS1 fusion-positive non-small cell lung cancer, the clinical utility of these agents in patients with ROS1 fusion-positive [[tumor type]] is unknown.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2025-06-13 17:47:54',NULL,NULL,NULL,NULL,'25c05c7e-a64e-4eec-8206-4a198462879f',6098,NULL),(26086,NULL,'While the tyrosine kinase inhibitors crizotinib, entrectinib, repotrectinib and taletrectinib are FDA-approved for the treatment of patients with ROS1 fusion-positive non-small cell lung cancer, the clinical utility of these agents in patients with [[variant]] is unknown.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2025-06-18 19:09:00',NULL,NULL,NULL,NULL,'df602908-e466-4f95-b006-c65382ca083a',6098,NULL),(26087,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2023-02-15 11:35:00',NULL,NULL,NULL,NULL,'9d636c58-c0f6-40f4-9b100-d61369f2d563',6098,NULL),(26088,NULL,'The FIG-ROS1 fusion is characterized by the fusion of the 3\' region of ROS1 (exon 35) to the 5\' region of FIG (exon 7); this fusion results from an intra-chromosomal deletion in chromosome 6 (PMID: 12661006). The FIG-ROS1 fusion results in a constitutively active ROS1 kinase (PMID: 2827175, 12661006).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-02-15 11:35:56',NULL,NULL,NULL,NULL,'9151ba5c-e692-49a5-b13f-b7ee0875eb8a',6098,NULL),(26089,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'e866e555-f8c5-44cd-9354-67152a0b84e6',6098,NULL),(26090,NULL,'CD74-ROS1 is a rearrangement mutation characterized by the fusion of CD74 (exon 6) and ROS1 (exon 34). This fusion generates a protein with constitutive kinase activity (PMID: 22215748, 22919003, 22327623, 18083107). CD74-ROS1 demonstrated transforming capabilities when tested in foci forming assays in vitro, and also demonstrated the ability to form subcutaneous tumors in nude mice (PMID: 22327623). A patient with non-small cell lung cancer harboring a CD74-ROS1 fusion responded to treatment with brigatinib and ceritinib after progressing on crizotinib (Abstract: Hegde et al. JCO PO, 2018. https://ascopubs.org/doi/full/10.1200/PO.18.00267).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2019-05-20 19:36:32',NULL,NULL,NULL,NULL,'bc796f57-eb77-4434-a67b-c83f986ccd53',6098,NULL),(26091,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'b5d0a7be-8f5d-48ca-8dc7-fccc54485b44',6098,NULL),(26092,NULL,'LRIG3-ROS1, a rearrangement mutation that results in the fusion of exon 16 of EZR with exon 35 of ROS1, results in a constitutively active protein containing the ROS1 kinase domain. This fusion demonstrated transforming capabilities when tested in foci forming assays in vitro, and also demonstrated the ability to form subcutaneous tumors in nude mice (PMID: 22327623).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'4192b084-39f0-4e6e-baed-2f099ebc5e3a',6098,NULL),(26093,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'5c3d5d86-c7ef-4a5f-ad33-02414d7a37ba',6098,NULL),(26094,NULL,'KDELR2-ROS1, a rearrangement mutation that results in the fusion of the 5\' end of KDELR2 with the 3\' end of with ROS1 (PMID: 22980976). The oncogenic potential of this fusion has not been functionally tested.','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'47a2ab73-a141-4768-8b29-205a346d447b',6098,NULL),(26095,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'c243f6b3-8a77-488a-b446-ae6d349aebe0',6098,NULL),(26096,NULL,'SLC34A2-ROS1 is a rearrangement mutation that results in the fusion of SLC34A2 (exon 4) and ROS1 (exon 32 and 34), creating a short and long transcript, respectively. This in-frame mutation generates a protein with constitutively active kinase activity (PMID: 22215748, 22919003). This fusion demonstrated transforming capabilities when tested in foci forming assays in vitro, and also demonstrated the ability to form subcutaneous tumors in nude mice (PMID: 22327623).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'19cbcfdb-7220-41f7-9db5-519c7aba7d14',6098,NULL),(26097,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'8bd71a92-568f-4a02-b316-68c6fc3f4a19',6098,NULL),(26098,NULL,'TPM3-ROS1, a rearrangement mutation that results in the fusion of exon 8 of TPM3 with exon 35 of ROS1, results in a constitutively active protein containing the ROS1 kinase domain (PMID: 22327623). This fusion demonstrated transforming capabilities when tested in foci forming assays in vitro, and also demonstrated the ability to form subcutaneous tumors in nude mice (PMID: 22327623).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'99fc9f8c-568d-48ea-a6a9-cd00e11509d6',6098,NULL),(26099,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'9c1e1dea-f7b5-4819-bb0a-2c14226842cb',6098,NULL),(26100,NULL,'SDC4-ROS1, a rearrangement mutation that results in the fusion of exon 2 of SDC4 with exon 33 or 34 of ROS1, results in a constitutively active protein containing the ROS1 kinase domain (PMID: 22327623). This fusion demonstrated transforming capabilities when tested in foci forming assays in vitro, and also demonstrated the ability to form subcutaneous tumors in nude mice (PMID: 22327623).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'f139c10b-60e3-4a9a-98e4-8c4059ebf637',6098,NULL),(26101,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'4829f927-214f-4cad-8e03-f865f2388eea',6098,NULL),(26102,NULL,'EZR-ROS1 is a rearrangement mutation that results in the fusion of exon 10 of EZR with exon 34 of ROS1, results in a constitutively active protein containing the ROS1 kinase domain (PMID: 22327623). This fusion demonstrated transforming capabilities when tested in foci forming assays in vitro, and also demonstrated the ability to form subcutaneous tumors in nude mice (PMID: 22327623).','MUTATION_EFFECT',NULL,_binary '\0','Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'223971d5-6d75-429c-8ee6-ff87292c52ba',6098,NULL),(26103,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'e11e0f79-6dbd-4662-90e1-f511b46f1bd9',6098,NULL),(26104,NULL,'The CCDC6-ROS1 fusion is a rearrangement resulting in the fusion of the 3\' region of ROS1 (exon 34) to the 5\' region of CCDC6 (exon 6). This fusion retains the coiled-coil domain of CCDC6 and the kinase domain of ROS1 (PMID: 22975805, 25870798). The oncogenic potential of this fusion has not been functionally tested.','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2024-10-21 18:23:30',NULL,NULL,NULL,NULL,'5bec6cce-2d4e-4d27-9435-e82c1c5afb4e',6098,NULL),(26105,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'1f433934-e5ee-4521-b22c-813311f97682',6098,NULL),(26106,NULL,'The CEP85L-ROS1 fusion protein combines the N terminal of CEP85L until exon 8 with the C-terminal of ROS1 starting at exon 36 and is found in CNS tumors, angiosarcoma and glioblastoma (PMID: 23637631, 25204415, 30171048). The breakpoint preserves the coiled-coil domain of CEP85L and the tyrosine kinase domain of ROS1, and is predicted to possess transforming abilities (PMID: 23637631, 25204415, 30171048). Expression of this fusion protein in BaF3, NIH3T3, and immortalized human astrocyte cells demonstrated that it is activating as shown by IL3 independent growth, pathway activation and increased colony formation compared to ectopic expression of wildtype ROS1. Expression of this fusion in BaF3 cells also demonstrated that it is sensitive to multiple TKIs including crizotinib, foretinib, cabozantinib, ceritinib, brigatinib, AZD3463, lorlatinib, and entrectinib proliferation, pathway activation and colony formation (PMID: 30171048).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2019-04-22 01:54:49',NULL,NULL,NULL,NULL,'2efa77d7-fce2-4db2-9a47-efd2d37a8442',6098,NULL),(26107,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'56ca090e-c0bb-4513-8807-d51bc9c88a9c',6098,NULL),(26108,NULL,'TFG-ROS1 is a rearrangement mutation that results in the fusion of TFG (exon 4) to ROS1 (exon 36) (PMID: 24875859). The oncogenic potential of this fusion has not been functionally tested.','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'189ca680-c125-47ce-a56b-8475d18ed537',6098,NULL),(26109,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'8912c735-23c3-4d05-9523-eac31ed076e0',6098,NULL),(26110,NULL,'YWHAE-ROS1 is a rearrangement mutation that results in the fusion of YWHAE (exon 4) to ROS1 (exon 36) (PMID: 24875859). The oncogenic potential of this fusion has not been functionally tested.','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'e877496a-b1bb-4cef-95ec-7dbf01296343',6098,NULL),(26111,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'d36eed89-50ac-4f42-841c-1020fe8b559a',6098,NULL),(26112,NULL,'LIMA1-ROS1 is a rearrangement mutation that results in the fusion of LIMA1 (exon 10) to ROS1 (exon 36). This novel fusion has been identified in a tumor sample from a patient with non-small cell lung cancer (NSCLC) treated with crizotinib (PMID: 25264305).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-02-24 13:21:30',NULL,NULL,NULL,NULL,'2526d944-55a3-407d-ae39-80db14f9ce98',6098,NULL),(26113,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'42b26a42-224d-4eed-a458-c9749f402c19',6098,NULL),(26114,NULL,'MSN-ROS1 is a rearrangement mutation that results in the fusion of MSN (exon 9) to ROS1 (exon 34). This novel fusion has been identified in a tumor sample from a patient with non-small cell lung cancer (NSCLC) treated with crizotinib (PMID: 25264305).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-02-24 13:21:39',NULL,NULL,NULL,NULL,'363f218b-1836-413c-bdc9-58212a6060f0',6098,NULL),(26115,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2023-10-16 13:59:45',NULL,NULL,NULL,NULL,'86467f41-2065-463d-9db7-c86f7d5a94ed',6098,NULL),(26116,NULL,'The ROS1 G2032R mutation is located in the protein\'s kinase domain and is associated with acquired resistance to crizotinib in ROS1-rearranged non-small cell lung cancer (PMID: 25688157, 24047073, 23724914). In vitro studies with A549 cells expressing ROS1 G2032R demonstrate that the mutation is activating as measured by increased cellular invasion and migration, increased expression of MMP-9 and TWIST1 and induced epithelial-mesenchymal transition compared to wildtype (PMID: 29477381). Preclinical studies and structural analysis of ROS1 G2032R demonstrate that the mutation confers resistance by interfering with crizotinib binding (PMID: 25351743, 23724914, 25033171). This mutation corresponds to the G1202R ALK kinase domain mutant (PMID: 23724914, 27401242). Preclinical studies of ROS1 G2032R demonstrate sensitivity to combination treatment of TWIST1 siRNA and crizotinib as measured by reduced cellular viability and invasion (PMID: 29477381).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2024-09-25 15:20:27',NULL,NULL,NULL,NULL,'aa803d57-5855-4e90-a480-c4362b3b482a',6098,NULL),(26117,NULL,'The ROS1 G2032R mutation has been identified in ROS1-mutant non-small cell lung cancer (NSCLC) collected following disease progression on the tyrosine kinase inhibitors crizotinib and lorlatinib. There are promising clinical data in patients with ROS1 G2032R mutant NSCLC treated with the ROS1/NTRK tyrosine kinase inhibitor taletrectinib.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2024-09-25 14:45:58',NULL,NULL,NULL,NULL,'2516a3d9-b233-4440-b634-cb8b25796e39',6098,NULL),(26118,NULL,'Taletrectinib is an orally available, small molecule ROS1/ NTRK tyrosine kinase inhibitor. There are promising clinical data in patients with ROS1 G2032R mutant non-small cell lung cancer (NSCLC) treated with taletrectinib. In the Phase II TRUST-I (NCT04395677) trial of taletrectinib in 173 patients with ROS1-positive NSCLC, patients with ROS1 G2023R mutant NSCLC (n=12) demonstrated an objective response rate of 66.7% (95% CI=34.89-90.08) (PMID: 38822758). In vivo studies with ROS1 fusion-positive xenograft models expressing ROS1 G2023R demonstrate sensitivity to taletrectinib as measured by tumor regression and inhibition of ROS1 autophosphorylation (PMID: 31399568).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2024-09-25 15:00:14',NULL,'LEVEL_3A','NO','LEVEL_3B','e7caa0a1-9ee3-45dc-a71c-21d57bdbc3f7',6098,NULL),(26119,NULL,'Crizotinib is an orally available, small molecule multitarget kinase inhibitor that is FDA-approved for treatment of patients with metastatic non-small cell lung cancer (NSCLC) whose tumors are ALK or ROS1-positive, as detected by an FDA-approved test. ROS1-rearrangement for treatment with crizotinib were detected by the Oncomine Dx Target Test. ROS1 G2032R has been identified as an acquired resistance mutation in patients with ROS1-mutant NSCLC upon disease progression with crizotinib treatment. In multiple clinical studies, ROS1 G2032R was identified in 22 patients with ROS1 fusion-positive NSCLC following crizotinib treatment (PMID: 33685866, 29333528, 23724914). In vitro studies with ROS1 fusion-positive Ba/F3 cells expressing ROS1 G2032R demonstrate resistance to crizotinib as measured by sustained kinase activity (PMID: 32918045). In vitro enzymatic assays demonstrate that the crizotinib concentration needed to achieve 50% enzyme inhibition was increased by a factor of 270 for ROS1 G2032R compared to wildtype ROS1 (PMID: 23724914).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_RESISTANCE','LEVEL_Fda3',_binary '\0','Resistant','2024-09-25 15:42:34',NULL,'LEVEL_R2',NULL,NULL,'14ec85c2-12a8-4e75-8d89-0370fce464f4',6098,NULL),(26120,NULL,'Lorlatinib is an orally available, small molecule multi-targeted kinase inhibitor that is listed in the NCCN Non-Small Cell Lung Cancer Guidelines (v10.2024) under \"Subsequent therapy\" for patients with ROS1-rearranged non-small cell lung cancer (NSCLC). ROS1 G2032R has been identified as an acquired resistance mutation in patients with ROS1-mutant NSCLC upon disease progression with lorlatinib treatment. In multiple clinical studies, ROS1 G2032R was identified in ten patients with ROS1 fusion-positive NSCLC following lorlatinib treatment (PMID: 36135089, 33685866). In vitro studies with ROS1 fusion-positive Ba/F3 cells expressing ROS1 G2032R demonstrate moderate resistance to lorlatinib as measured by the IC50 values for lorlatinib increasing by a factor of 281 for ROS1 G2032R compared to wildtype ROS1 (PMID: 33685866).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_RESISTANCE','LEVEL_Fda3',_binary '\0','Resistant','2024-09-25 15:43:19',NULL,'LEVEL_R2',NULL,NULL,'86c0b34f-ac48-4ead-b6b2-e56aacc23c81',6098,NULL),(26121,NULL,'While there are promising clinical data in patients with ROS1 G2032R mutant non-small cell lung cancer treated with the ROS1/NTRK tyrosine kinase inhibitor taletrectinib, the clinical utility of this inhibitor in patients with [[variant]] is unknown.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2024-10-22 21:13:35',NULL,NULL,NULL,NULL,'2d79fca6-25d3-4232-8c71-28d6632ddb5f',6098,NULL),(26122,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Resistance','2022-12-09 12:52:29',NULL,NULL,NULL,NULL,'a98d8d63-c524-4fec-8aba-6e79097123f5',6098,NULL),(26123,NULL,'The ROS1 L1951R mutation lies in the tyrosine kinase domain of the ROS1 protein. In vitro studies in a CD74-ROS1-transformed cell line demonstrated that L1951R confers resistance to crizotinib and ceritinib as measured by cell viability and pathway activation assays. This effect is likely due to steric hindrance (PMID: 25351743).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'2b2b259b-8e00-4bf4-ad6d-079ad7a9cc6d',6098,NULL),(26124,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'9bf7d605-86c1-4fe3-b1de-700e4079c29b',6098,NULL),(26125,NULL,'The ROS1 D2033N mutation lies in the tyrosine kinase domain of the ROS1 protein. It has been detected in a patient with CD74-ROS1-fusion positive lung cancer with acquired resistance to crizotinib. In a murine B-cell line a D2033N-mutated CD74-ROS1 construct conferred reduced sensitivity to crizotinib while cabozantinib was equally effective as against the unmutated CD74-ROS, as measured in growth and downstream signaling assays. Experiments also supported the notion that D2033N confers resistance to ceritinib, brigatinib and lorlatinib. The analogous mutation in ALK (D1203N) confers crizotinib resistance in vitro and molecular studies indicate that mutations at these residues are important due to their being located at binding surface for ATP (PMID: 26673800).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'26191541-33bd-46d7-834b-288cf0f9a380',6098,NULL),(26126,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'5cc8c16c-c571-48dc-9448-0cb47a29623d',6098,NULL),(26127,NULL,'The ROS1 C2060G mutation lies in the tyrosine kinase domain of the ROS1 protein. In a murine B-cell line a C2060G-mutated FIG-ROS1 construct conferred increased resistance to crizotinib, as compared to the unmutated construct in cell-growth assays. The mutated construct showed slightly reduced sensitivity to the inhibitor foretinib (PMID: 24218589).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'ba413320-b38d-4bed-9dce-2cfd6c64f434',6098,NULL),(26128,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'990fad2a-aa8d-4650-9455-430979acdb9f',6098,NULL),(26129,NULL,'The ROS1 E1935G mutation occurs in an uncharacterized region ten amino acid residues prior to the tyrosine kinase domain of the ROS1 protein. In a murine B-cell line a E1935G-mutated FIG-ROS1 construct conferred increased resistance to crizotinib, as compared to the unmutated construct in cell-growth assays. The mutated construct showed slightly reduced sensitivity to the inhibitor foretinib (PMID: 24218589).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'55739fa0-b5b6-4f08-a975-e1769dfdf13e',6098,NULL),(26130,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'21bd828d-75e5-480e-ba46-f9c44f74205d',6098,NULL),(26131,NULL,'The ROS1 G1971E mutation lies in the tyrosine kinase domain of the ROS1 protein. In a murine B-cell line a G1971E-mutated FIG-ROS1 construct conferred increased resistance to crizotinib, as compared to the unmutated construct in cell-growth assays. The mutated construct showed slightly reduced sensitivity to the inhibitor foretinib (PMID: 24218589).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'9ab26a40-7f6f-4ffd-b850-74576f925345',6098,NULL),(26132,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'912e61e9-f663-4532-adf8-3fce18e85ac9',6098,NULL),(26133,NULL,'The ROS1 L1947R mutation occurs in the protein\'s kinase domain and is often identified in the context of a ROS1 fusion protein. FIG-ROS1 Ba/F3 cells expressing the L1947R mutation demonstrated increased resistance to crizotinib compared to control FIG-ROS1 Ba/F3 cells, as measured by sustained cell growth and protein activation upon drug treatment (PMID: 24218589).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'93af185b-5b37-4c69-b631-b40c9168468d',6098,NULL),(26134,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'890afecb-328f-42fe-9f35-0ded40d95c9e',6098,NULL),(26135,NULL,'The ROS1 V2098I mutation occurs in the tyrosine kinase domain of the ROS1 protein at a site implicated in inhibitor binding. In a murine B-cell line a V2098I -mutated FIG-ROS1 construct conferred increased resistance to crizotinib, as compared to the unmutated construct in cell-growth assays. The mutated construct showed slightly reduced sensitivity to the inhibitor foretinib (PMID: 24218589).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'89a9587b-402b-409d-8c46-f4c7c83d883e',6098,NULL),(26136,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'278e7a1f-c695-4df6-ad75-869b8462aec0',6098,NULL),(26137,NULL,'The ROS1 G2101A mutation lies in the tyrosine kinase domain of the ROS1 protein. In a murine B-cell line a G2101A-mutated CD74-ROS1 construct conferred increased resistance to crizotinib, as compared to the unmutated construct in cell-growth assays. The mutated construct showed slightly reduced sensitivity to the inhibitor foretinib. The variants is analogous to the previously described ALK G1269A resistance mutation (PMID: 25688157, 24675041, 22235099).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'a05a2f36-dfef-4578-a479-e291ed0355a7',6098,NULL),(26138,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'385c8437-b18a-4819-beab-20ae3cb25ae6',6098,NULL),(26139,NULL,'The ROS1 S1986Y mutation lies in tyrosine kinase domain the of the ROS1 protein. It has been detected in a patient with ROS1-fusion positive lung cancer in concert with mutation S1986F. The two alterations at the same residue were associated with resistance to crizotinib but subsequent sensitivity to lorlatinib. In a murine B-cell line expression of individual S1986F- and S1986Y-mutated ROS1-fusion constructs were resistant to crizotinib and ceritinib but not lorlatinib, as assessed by cell viability and pathway activation assays (PMID: 27401242).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'2e14998d-6a5e-4d9d-982d-90d7d47e51d8',6098,NULL),(26140,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'bcd08c5b-9fe6-46e6-aace-af80088b9703',6098,NULL),(26141,NULL,'The ROS1 S1986F mutation lies in the tyrosine kinase domain of the ROS1 protein. It has been detected in a patient with ROS1-fusion-positive lung cancer in concert with the S1986Y mutation. The two alterations at the same residue were associated with resistance to crizotinib but subsequent sensitivity to lorlatinib. In a murine B-cell line expression of individual S1986F- and S1986Y-mutated ROS1-fusion constructs were resistant to crizotinib and ceritinib but not lorlatinib, as assessed by cell viability and pathway activation assays (PMID: 27401242).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2022-12-07 17:31:30',NULL,NULL,NULL,NULL,'19acaaee-d519-4577-9b10-2ea228c116b3',6098,NULL),(26142,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'1d70db26-7ecb-4039-c0dc-4c97bd823c89',6098,NULL),(26143,NULL,'Amplification of ROS1 has been shown to result in an increase in ROS1 transcript and ROS1 protein levels in cancer cell lines that is sensitive to ROS1 inhibition demonstrating that ROS1 amplification is likely activating (PMID: 25978031). Studies in cancer cell lines have demonstrated that ROS1 amplification can lead to resistance to EGFR inhibitors in cells that are otherwise sensitive to EGFR inhibition (PMID: (PMID: 25978031).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-10 14:55:05',NULL,NULL,NULL,NULL,'58511c90-26db-438e-b897-0bdea61f61af',6098,NULL),(26144,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2019-04-22 01:53:11',NULL,NULL,NULL,NULL,'f34c6773-0f41-42b0-866d-8a7c3b3b694b',6098,NULL),(26145,NULL,'The GOPC-ROS1 fusion protein combines the N terminus of GOPC until exon 7 with the C-terminus of ROS1 starting at exon 35 and is found in CNS tumors (PMID: 30171048). This is the most frequent ROS1 fusion found in glioblastomas (GBMs). Expression of this fusion protein in BaF3 and immortalized human astrocyte cells demonstrated that it is activating as shown by IL3 independent growth and increased colony formation compared to ectopic expression of wildtype ROS1 (PMID: 30171048). Expression of this fusion in BaF3 cells also demonstrated that it is sensitive to multiple TKIs including crizotinib, foretinib, cabozantinib, ceritinib, brigatinib, AZD3463, lorlatinib, and entrectinib as measured by proliferation, pathway activation and colony formation with lorlatinib having the highest potency (PMID: 30171048). In a case report, a patient with ER-positive HER2-negative breast cancer harboring GOPC-ROS1 demonstrated an exceptionally response to crizotinib therapy and a subsequent modest response to cabozantinib after development of crizotinib resistance (PMID: 37487149).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2023-12-05 13:16:33',NULL,NULL,NULL,NULL,'a95bd9a0-ce83-4a4b-8782-c9cdff1175b1',6098,NULL),(26146,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2019-10-02 21:39:48',NULL,NULL,NULL,NULL,'21c81568-8f05-4de9-bed2-749a8b6bf283',6098,NULL),(26147,NULL,'The ROS1 F2004V mutation is located in the kinase domain of the protein. This mutation was found as a secondary mutation in a patient with lung adenocarcinoma who had progressive disease in the brain and bones after treatment with crizotinib, entrectinib and brigatinib but who had a dramatic response to treatment with lorlatinib (Abstract: Dimou et al. JCO PO, 2019. https://ascopubs.org/doi/full/10.1200/PO.19.00013). This mutation may confer resistance to entrectinib and brigatinib but remains sensitive to lorlatinib. Structural studies based on homology to ALK predict that ROS1 F2004V would confer resistance to ceritinib (PMID: 27401242).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2021-01-14 00:21:45',NULL,NULL,NULL,NULL,'c74bbb3d-42fc-42f1-b262-d02131bf4837',6098,NULL),(26148,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2021-01-14 00:57:23',NULL,NULL,NULL,NULL,'fbc05162-1285-449a-a3b7-54a791068d3f',6098,NULL),(26149,NULL,'The ROS1 F2004C mutation is located in the kinase domain of the protein. This mutation has been found in lung cancer (Abstract: Doebele et al. Abstract# LBA-28, ESMO 2019. https://www.sciencedirect.com/science/article/pii/S0923753419603777). Expression of this mutation in the context of a ROS1 fusion in Ba/F3 cells demonstrated decreased sensitivity to ROS1 inhibition (PMID: 26372962). Structural studies based on homology to ALK predict that ROS1 F2004C would confer resistance to ceritinib (PMID: 27401242). At least one patient with ROS1-fusion-positive non-small cell lung cancer acquired the ROS1 F2004C mutation upon disease progression on treatment with entrectinib (Abstract: Doebele et al. Abstract# LBA-28, ESMO 2019. https://www.sciencedirect.com/science/article/pii/S0923753419603777).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2021-02-02 23:45:06',NULL,NULL,NULL,NULL,'e558dfec-5cdb-431e-8f7a-9a3d30be0f41',6098,NULL),(26150,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Resistance','2024-10-21 16:11:40',NULL,NULL,NULL,NULL,'1b04cf14-2faf-41ea-b753-c45bec17b043',6098,NULL),(26151,NULL,'The ROS1 L2086F mutation is located in the kinase domain of the protein. This mutation has been identified in non-small cell lung cancer (NSCLC), and is associated with acquired resistance to lorlatinib and repotrectinib in ROS1-rearranged NSCLC (PMID: 32321774, 33685866, 39091594). Although this mutation has not been functionally characterized, patients with ROS1-rearranged NSCLC harboring ROS1 L2086F have demonstrated sensitivity to cabozantinib (PMID: 33685866, 37291202, 39117775, 39091594).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2025-03-19 12:25:29',NULL,NULL,NULL,NULL,'d796b0a7-6a7e-4a7d-bbad-37282de9abc7',6098,NULL),(26152,NULL,'The ROS1 L2086F mutation has been identified in ROS1-mutant non-small cell lung cancer (NSCLC) collected following disease progression on the tyrosine kinase inhibitors lorlatinib and repotrectinib. There are promising clinical data in patients with ROS1 L2086F mutant NSCLC treated with the tyrosine kinase inhibitor cabozantinib.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2024-09-25 16:06:24',NULL,NULL,NULL,NULL,'7e1f0e76-4191-4cac-8c3a-636a31e3efa3',6098,NULL),(26153,NULL,'Cabozantinib is an orally available, small molecule multi-kinase inhibitor. There are promising clinical data in patients with ROS1 L2086F mutant non-small cell lung cancer (NSCLC) treated with cabozantinib. Across multiple case studies, patients with ROS1 fusion-positive NSCLC expressing ROS1 L2086F were treated with cabozantinib and achieved responses ranging from partial response (PR) (n=2) (PMID: 39117775, 39091594) to stable disease (n=2) (PMID: 33685866, 37291202). For the 2 PR, one patient was previously treated with entrectinib and one patient was previously treated with repotrectinib, at which time the ROS1 L2086F mutation was detected and cabozantinib treatment was started (PMID: 39117775, 39091594). In vitro studies with ROS1 fusion-positive patient-derived cells expressing ROS1 L2086F demonstrate sensitivity to cabozantinib as measured by inhibition of cellular proliferation and ROS1 autophosphorylation (PMID: 33685866, 39117775, 39091594).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2024-10-10 15:09:44',NULL,'LEVEL_3A','NO','LEVEL_3B','13a6f1ba-3659-4324-9840-a69b20add57d',6098,NULL),(26154,NULL,'Lorlatinib is an orally available, small molecule multi-targeted kinase inhibitor that is listed in the NCCN Non-Small Cell Lung Cancer Guidelines (v10.2024) under \"Subsequent therapy\" for patients with ROS1-rearranged non-small cell lung cancer (NSCLC). ROS1 L2086F has been identified as an acquired resistance mutation in patients with ROS1-mutant NSCLC upon disease progression with lorlatinib treatment. In multiple clinical studies, ROS1 L2086F was identified in four patients with ROS1 fusion-positive NSCLC following lorlatinib treatment (PMID: 37291202, 33685866). In vitro studies with ROS1 fusion-positive Ba/F3 cells expressing ROS1 L2086F demonstrate resistance to lorlatinib as measured by the IC50 values for lorlatinib increasing by a factor of over 4286 for ROS1 L2086F compared to wildtype ROS1 (PMID: 33685866).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_RESISTANCE','LEVEL_Fda3',_binary '\0','Resistant','2024-09-25 16:27:42',NULL,'LEVEL_R2',NULL,NULL,'5504977a-2135-4f69-89e2-8c5c51829046',6098,NULL),(26155,NULL,'Repotrectinib is an orally available, small molecule next-generation ROS1/TRK tyrosine kinase inhibitor (TKI) that is FDA-approved for the treatment of adult patients with locally advanced or metastatic ROS1-positive non-small cell lung cancer (NSCLC). In a clinical study, ROS1 L2086F was identified in a patient with ROS1 fusion-positive NSCLC following repotrectinib treatment (PMID: 39091594). The patient had previously received crizotinib, ceritinib, carboplatin plus pemetrexed, and lorlatinib, with no other ROS1 mutations detected at the time of disease progression on repotrectinib (PMID: 39091594). In vitro studies with ROS1 fusion-positive Ba/F3 cells expressing ROS1 L2086F demonstrate resistance to repotrectinib as measured by the IC50 values for repotrectinib increasing by a factor of 840 for ROS1 L2086F compared to wildtype ROS1 (PMID: 33685866).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_RESISTANCE','LEVEL_Fda3',_binary '\0','Resistant','2024-10-10 15:20:55',NULL,'LEVEL_R2',NULL,NULL,'cb7f1965-25a7-4d7e-8be5-f841d75d4248',6098,NULL),(26156,NULL,'While there are promising clinical data in patients with ROS1 L2086F mutant non-small cell lung cancer treated with the tyrosine kinase inhibitor cabozantinib, the clinical utility of this inhibitor in patients with [[variant]] is unknown.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2024-10-22 21:15:30',NULL,NULL,NULL,NULL,'2a40401e-384f-45c9-b7ad-29a6c8d4d96f',6098,NULL),(26157,NULL,NULL,'VUS',NULL,_binary '\0',NULL,'2017-03-09 12:22:22',NULL,NULL,NULL,NULL,NULL,6098,NULL),(26158,NULL,NULL,'VUS',NULL,_binary '\0',NULL,'2017-03-10 11:25:28',NULL,NULL,NULL,NULL,NULL,6098,NULL),(26159,NULL,NULL,'VUS',NULL,_binary '\0',NULL,'2017-03-10 11:26:19',NULL,NULL,NULL,NULL,NULL,6098,NULL),(26160,NULL,NULL,'VUS',NULL,_binary '\0',NULL,'2017-03-17 08:00:32',NULL,NULL,NULL,NULL,NULL,6098,NULL),(26161,NULL,NULL,'VUS',NULL,_binary '\0',NULL,'2017-04-07 14:31:34',NULL,NULL,NULL,NULL,NULL,6098,NULL),(26162,NULL,NULL,'VUS',NULL,_binary '\0',NULL,'2017-04-10 14:54:54',NULL,NULL,NULL,NULL,NULL,6098,NULL),(26163,NULL,NULL,'VUS',NULL,_binary '\0',NULL,'2017-05-01 16:08:19',NULL,NULL,NULL,NULL,NULL,6098,NULL),(26164,NULL,NULL,'VUS',NULL,_binary '\0',NULL,'2019-04-22 01:58:40',NULL,NULL,NULL,NULL,NULL,6098,NULL),(26165,NULL,NULL,'VUS',NULL,_binary '\0',NULL,'2020-06-10 00:28:04',NULL,NULL,NULL,NULL,NULL,6098,NULL),(28517,NULL,'TP53, a tumor suppressor in the DNA damage pathway, is the most frequently mutated gene in cancer.','GENE_SUMMARY',NULL,_binary '\0',NULL,'2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'1238efb3-3419-4254-a8ca-c810ff7b2696',7157,NULL),(28518,NULL,'TP53 encodes the p53 tumor suppressor protein, a transcription factor that responds to cellular stresses, including DNA damage and oncogenic activation, by inducing downstream anti-tumor responses such as DNA repair and apoptosis (PMID: 11099028). p53 levels are kept low in healthy cells due to negative regulation by MDM2/4, Cop1 and Trim24 and constant degradation by the ubiquitin-proteasome system (PMID: 36859359, 36207426). When DNA is damaged, a network of pathways is activated to detect and repair lesions in a cell- and context-specific manner (PMID: 36207426). p53 is rapidly phosphorylated by upstream regulators such as ATM, ATR, and CHL1/2, which results in the accumulation of stable p53 (PMID: 36207426). p53 then binds to specific DNA sequences to direct the expression of a wide variety of genes, including those involved in apoptosis, cell cycle arrest, DNA repair, senescence, stem cell differentiation, autophagy, cellular metabolism, and others (PMID: 27141080, 36859359, 36207426). Oncogenic mutations of TP53 often result in the dysregulation of p53 function, usually due to structural changes in the DNA binding domain (PMID: 36859359). Loss of p53 function can have various outcomes including tumorigenesis, invasion and metastasis, drug resistance, metabolic reprogramming, immune evasion and overall genomic instability (PMID: 36859359). TP53 is the most commonly mutated gene in human cancers, and germline mutations occur in the cancer predisposition syndrome Li-Fraumeni (PMID: 22713868, 21765642). Clinical and preclinical research into drugs that target TP53 is ongoing, notably with MDM2 inhibitors that aim to restore p53 function and are being tested in combination with other cancer therapies (PMID: 36859359, 37818252).','GENE_BACKGROUND',NULL,_binary '\0',NULL,'2024-06-05 14:33:01',NULL,NULL,NULL,NULL,'24a179db-26d2-45e2-80b9-71b1eb49a491',7157,NULL),(28519,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2018-12-12 12:41:44',NULL,NULL,NULL,NULL,'dd554ea2-478a-4ff5-c094-c2c74fa2032a',7157,NULL),(28520,NULL,'The TP53 P322R mutation is located in the oligomerization domain of the protein. In vitro studies have demonstrated that this mutation is likely neutral, as evidenced by its ability to oligomerize and transactivate downstream targets comparable to wildtype TP53 (PMID: 16007150).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2022-08-21 20:27:41',NULL,NULL,NULL,NULL,'682b6f29-3299-48fb-9d56-4449fb6aab66',7157,NULL),(28521,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2023-05-09 15:34:57',NULL,NULL,NULL,NULL,'cdcc69c1-9be4-4f56-a7d0-5e2c392561c9',7157,NULL),(28522,NULL,'The TP53 H214R mutation is located in the protein\'s DNA binding domain and is a known hotspot mutation (PMID: 26619011). This mutation has been found in breast cancers, among others (PMID: 20407015). In vivo studies with yeast expressing TP53 H214R demonstrated that the mutation is inactivating as measured by the loss of transactivational activity as compared to wildtype (PMID: 27328919, 12826609). Other in vivo studies with yeast expressing TP53 H214R demonstrate that the mutation is also inactivating as measured by partial loss of transactivational function compared to wildtype (PMID: 11920959). In vitro studies with various human cancer cell lines expressing TP53 H214R also demonstrated the mutation is inactivating as measured by reduced growth suppression activity as compared to wildtype (PMID: 29979965, 30224644). In contrast, in vitro studies have demonstrated that this mutation is likely activating, as evidenced by increased TP53 transactivation activity compared to wildtype (PMID: 20407015).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2023-05-09 15:34:59',NULL,NULL,NULL,NULL,'1d39ff8b-94cf-4c03-8a82-61886e2b9046',7157,NULL),(28523,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'10e5d16d-6ee4-4985-a46b-366b821f1ae8',7157,NULL),(28524,NULL,'The TP53 R175H mutation is located in the protein\'s DNA binding domain. This mutation has been found in acute myeloid leukemia (PMID: 31068365). In vitro and in vivo studies have demonstrated that this mutation is inactivating and oncogenic, as measured by the reduced ability to induce apoptosis and form colonies, as well as increased cell migration and faster progression of hematopoietic malignancy of the mutant compared to TP53 wildtype or deletion (PMID: 15781620, 25584008, 31068365). Structural studies have also shown that this mutant is defective in protein folding and DNA binding (PMID: 10713666, 21445056).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-08-09 21:59:59',NULL,NULL,NULL,NULL,'41c4e951-4d83-4e4a-9843-3f64039400ea',7157,NULL),(28525,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2023-02-15 12:21:38',NULL,NULL,NULL,NULL,'afc0e256-7933-4e36-9933-50e32b8a77d5',7157,NULL),(28526,NULL,'The TP53 S121F mutation is located in the protein\'s DNA binding domain. This mutation has been found in lymphoma (PMID: 22955915). In vitro studies have demonstrated that this mutation is likely activating, as evidenced by enhanced transcriptional activity, increased apoptosis and inhibition of cell cycle progression in the mutant compared to wildtype (PMID: 15781620).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2022-08-24 14:21:19',NULL,NULL,NULL,NULL,'1a110d13-bfb1-4080-b89e-e1da6d04bb87',7157,NULL),(28527,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2023-02-15 11:41:41',NULL,NULL,NULL,NULL,'e5eb8bf2-4c0f-4432-b6f9-f9efc1020164',7157,NULL),(28528,NULL,'The TP53 H214Q mutation is located in the DNA binding domain of the protein. This mutation has been found in colorectal carcinoma and is a statistically significant hotspot (PMID: 26619011, 11044641). In vitro studies have demonstrated that this mutation is likely activating, as evidenced by significantly increased apoptosis, decreased cell viability and altered transcription of TP53 target genes in the mutant compared to wildtype (PMID: 15781620).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2024-07-23 13:32:49',NULL,NULL,NULL,NULL,'204f9e50-8e83-45a7-a3ba-64c847535564',7157,NULL),(28529,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2022-09-29 11:15:05',NULL,NULL,NULL,NULL,'3a9cc731-75b8-4639-84d7-853aa820d2a1',7157,NULL),(28530,NULL,'The TP53 K291E mutation is located in the DNA binding domain of the protein. This mutation has been found in non-small cell lung cancer and is a statistically significant hotspot mutation (PMID: 26619011, 9416838). In vitro studies have demonstrated that this mutation is likely activating, as evidenced by significantly increased apoptosis, decreased cell viability and altered transcription of TP53 target genes in the mutant compared to wildtype (PMID: 15781620).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2024-07-23 13:26:07',NULL,NULL,NULL,NULL,'5fc85227-bb09-490f-8adc-cbc68fa48ac1',7157,NULL),(28531,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2022-10-03 11:59:23',NULL,NULL,NULL,NULL,'d1b01d13-6e1d-4aee-a800-d70b602d3247',7157,NULL),(28532,NULL,'The TP53 K292T mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is likely activating, as evidenced by significantly increased apoptosis, decreased cell viability and altered transcription of TP53 target genes in the mutant compared to wildtype (PMID: 15781620).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2022-10-03 11:59:34',NULL,NULL,NULL,NULL,'8698b568-758c-4318-8054-28515ca884c8',7157,NULL),(28533,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2022-10-03 12:02:33',NULL,NULL,NULL,NULL,'96f664ad-8758-4b98-9a1e-7648ce877649',7157,NULL),(28534,NULL,'The TP53 Q144R mutation is located in the protein\'s DNA binding domain and is a known hotspot mutation (PMID: 26619011). However, in vitro studies have demonstrated that this mutation is likely activating, as evidenced by significantly increased apoptosis, decreased cell viability and altered transcription of TP53 target genes in the mutant compared to wildtype (PMID: 15781620).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2022-10-03 12:02:34',NULL,NULL,NULL,NULL,'e113fd62-9072-4307-9b2c-3f42dac5e306',7157,NULL),(28535,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2022-08-21 22:48:37',NULL,NULL,NULL,NULL,'3a8903db-dc5d-47e8-8962-98d13cdf24e8',7157,NULL),(28536,NULL,'The TP53 I162M mutation is located in the protein\'s DNA binding domain. This mutation has been found in lymphoma (PMID: 27101868). In vitro studies have demonstrated that this mutation has inconclusive effect, as evidenced by altered transcription of TP53 target genes as well as an insignificant increased apoptosis and cell cycle arrest in the mutant compared to wildtype TP53 (PMID: 15781620).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2022-08-21 22:50:26',NULL,NULL,NULL,NULL,'a84c15a9-c0ef-4a97-a7bd-a737fecb67c4',7157,NULL),(28537,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2022-09-29 11:14:57',NULL,NULL,NULL,NULL,'48f340e6-0711-4a50-996a-f0c8d403b9c4',7157,NULL),(28538,NULL,'The TP53 R290G mutation is located in the protein\'s DNA binding domain (PMID: 26619011). In vitro studies have demonstrated that this mutation is likely activating, as evidenced by significantly increased apoptosis, decreased cell viability and altered transcription of TP53 target genes in the mutant compared to wildtype (PMID: 15781620).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2022-10-03 14:28:10',NULL,NULL,NULL,NULL,'7e7a3ae5-6c0c-45a4-85c9-d3bc9042a818',7157,NULL),(28539,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'8fb3a0c0-971c-445b-ab06-23c6d7b58f14',7157,NULL),(28540,NULL,'The TP53 L344P mutation is located in the protein\'s oligomerization domain. This mutation has been found in Li-Fraumeni syndromes (PMID: 9704930). In vitro and structural studies have demonstrated that this mutation is inactivating, as evidenced by the mutant\'s inability to oligomerize and form TP53 tetramers, leading to decreased transactivation of TP53 target genes, decreased TP53 acetylation and decreased recruitment of p300 in the mutant compared to wildtype (PMID: 19454241, 19106109, 20978130).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-09-14 21:16:52',NULL,NULL,NULL,NULL,'b4f92878-cffd-4450-bfd4-7a584ef43fbc',7157,NULL),(28541,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'c6d759ed-e514-4b33-9b60-28fd926b6ab1',7157,NULL),(28542,NULL,'The TP53 R337C mutation is located in the protein\'s oligomerization domain (PMID: 17311302). In vitro and structural studies have demonstrated that this mutation is inactivating, as evidenced by the mutant\'s ability to inhibit transcriptional activity by destabilizing the p53 tetramer, as well as its inability to oligomerize, leading to decreased transactivation of TP53 target genes, decreased TP53 acetylation and decreased recruitment of p300 in the mutant compared to wildtype (PMID: 19454241, 11753428, 16007150, 19106109).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-09-14 22:14:00',NULL,NULL,NULL,NULL,'65c2d4a3-1211-4f05-9543-d8c5173e0996',7157,NULL),(28543,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'48b1d3a6-c7c3-45b5-a3b9-a7c1dc912f34',7157,NULL),(28544,NULL,'The TP53 L330H mutation is located in the protein\'s oligomerization domain. In vitro and structural studies have demonstrated that this mutation is likely inactivating, as evidenced by decreased transcriptional activity, decreased protein stability and decreased p53 tetramer formation in the mutant compared to wildtype (PMID: 19454241, 20978130).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-09-14 21:38:00',NULL,NULL,NULL,NULL,'a0a3bd7b-79bd-4176-a99c-c5ea8aebdbcc',7157,NULL),(28545,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'78f23675-e3a1-4f6b-9d75-d413f954312a',7157,NULL),(28546,NULL,'The TP53 L330P mutation is located in the protein\'s oligomerization domain. Structural studies have demonstrated that this mutation is likely inactivating, as evidenced by the mutant\'s inability to form p53 tetramers, which is required for TP53 DNA binding activity (PMID: 20978130).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-09-14 22:04:04',NULL,NULL,NULL,NULL,'ea95c3b8-e97a-43c8-9dba-216a2853477f',7157,NULL),(28547,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'5c990d0d-c6e1-4dc6-95f9-330aa3a1b01b',7157,NULL),(28548,NULL,'The TP53 L330R mutation is located in the protein\'s tetramerization domain. In vitro and structural studies have demonstrated that this mutation is likely inactivating, as evidenced by the decreased transcriptional activity and protein stability in the mutant compared to wildtype, as well as by the mutant\'s inability to form p53 tetramers, which is required for TP53 DNA binding activity (PMID: 19454241, 20978130).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-09-14 22:15:57',NULL,NULL,NULL,NULL,'13f49980-7683-47d3-992e-27ce5f82dd57',7157,NULL),(28549,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-07 12:44:54',NULL,NULL,NULL,NULL,'cc8ff4ec-c683-47e6-8e65-2545188bf3bf',7157,NULL),(28550,NULL,'The TP53 R337P mutation is located in the protein\'s oligomerization domain. This mutation has been found in the germline of patients with Li-Fraumeni syndrome and adrenocortical carcinoma (PMID: 11481490). In vitro and structural studies have demonstrated that this mutation is likely inactivating, as evidenced by decreased transcriptional activity and protein stability in the mutant compared to wildtype, as well as the mutant\'s inability to form p53 tetramers, which is required for TP53 DNA binding activity (PMID: 19454241, 20978130).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-09-16 14:52:48',NULL,NULL,NULL,NULL,'f87dbe53-d8b1-4367-95f4-6bb3dd657587',7157,NULL),(28551,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'9ce55e0f-9b63-4c75-9b13-11c230da8d2f',7157,NULL),(28552,NULL,'The TP53 R342P mutation is located in the protein\'s oligomerization domain. In vitro and structural studies have demonstrated that this mutation is likely inactivating, as evidenced by the decreased transcriptional act