has been found in the germline of patients with pediatric adrenocortical carcinoma (PMID: 25584008). In vitro studies have demonstrated that this mutation is likely neutral, as evidenced by similar levels of colony formation and TP53 transactivation activity in the mutant compared to wildtype (PMID: 25584008).','MUTATION_EFFECT',NULL,_binary '\0','Neutral','2022-09-16 14:56:26',NULL,NULL,NULL,NULL,'0d1f4bb9-af36-433b-8a35-3eca8f862227',7157,NULL),(28569,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2023-02-15 11:39:08',NULL,NULL,NULL,NULL,'2815bd4b-1619-4f67-8856-b5bfe65d1d94',7157,NULL),(28570,NULL,'The TP53 F134Y mutation is located in the protein\'s DNA binding domain and occurs at a known hotspot residue (PMID: 26619011). In vitro studies have demonstrated that this mutation has inconclusive effect, as evidenced by similar levels of colony formation and TP53 transactivation activity in the mutant compared to wildtype, even though its position at a hotspot residue suggests that it is likely oncogenic (PMID: 25584008, 26619011).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2023-02-15 11:39:09',NULL,NULL,NULL,NULL,'4bc2942b-10c2-4f3f-babe-bc76bbdb2b7d',7157,NULL),(28571,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'00393141-cdd1-4ab5-9741-1bb9feb5ece8',7157,NULL),(28572,NULL,'The TP53 P152L mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by loss of p53-mediated transactivation and reduced colony formation in the mutant compared to wildtype (PMID: 10229196, 25584008).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-09-14 22:56:46',NULL,NULL,NULL,NULL,'cb67c3e4-a16b-416c-a5ee-4a1a89cfcb19',7157,NULL),(28573,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'39b8f59b-cd28-402d-ab72-8b7e6fa4700a',7157,NULL),(28574,NULL,'The TP53 R158H mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by loss of p53-mediated transactivation, decreased ability to induce apoptosis and increased oncogenic colony transformation of the mutant compared to wildtype (PMID: 10229196, 25584008).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-10-03 14:29:52',NULL,NULL,NULL,NULL,'94bb01ea-f180-4306-8cd9-cab503e1bbcd',7157,NULL),(28575,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'8536d498-deef-47ed-a102-1b94647aeb32',7157,NULL),(28576,NULL,'The TP53 R158L mutation is located in the protein\'s DNA binding domain. This mutation has been found in lung cancer (PMID: 31067569). In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by loss of TP53-mediated transactivation, decreased ability to reduce colony formation and aberrant transcriptional regulation in the mutant compared to wildtype (PMID: 25584008, 16861262, 31067569).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-10-03 15:23:58',NULL,NULL,NULL,NULL,'e833d643-3b09-43c2-ba46-3c342042ddcf',7157,NULL),(28577,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'8a3f9e27-ab57-4697-9fa4-97a1239fa9e6',7157,NULL),(28578,NULL,'The TP53 Y163C mutation is located in the protein\'s DNA-binding domain. In vitro studies have demonstrated that this mutation is inactivating, as measured by increased cellular growth, decreased levels of apoptosis and decreased transactivation of downstream p53 target genes in the mutant compared to wildtype (PMID: 23246812,15077194, 25584008, 15037740).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-09-15 22:34:19',NULL,NULL,NULL,NULL,'5d765c01-7b4d-40dc-a5a6-ad5f2eebeea9',7157,NULL),(28579,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-