nary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'bc631aad-1012-40e9-bc63-4a2182c94274',7157,NULL),(28586,NULL,'The TP53 N235D mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by increased p53-mediated transactivation and increased colony formation in the mutant compared to wildtype (PMID: 25584008).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-09-15 22:54:55',NULL,NULL,NULL,NULL,'87426af5-e84a-4ed0-a5e1-6f2a394868c9',7157,NULL),(28587,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'4cd0dde0-3a2a-4e83-b1c5-fc852493ae90',7157,NULL),(28588,NULL,'The TP53 R248W mutation is located in the protein\'s DNA binding domain. This mutation has been found in Li-Fraumeni syndrome (PMID: 25584008). In vitro studies have demonstrated that this mutation is inactivating, as evidenced by increased p53-mediated transactivation and failure to suppress colony growth in the mutant compared to wildtype (PMID: 18762571, 10229196, 25584008).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-09-16 15:03:51',NULL,NULL,NULL,NULL,'2416b4ed-b136-4f3a-9fda-8a2f17032146',7157,NULL),(28589,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'b1d7458b-5abc-4467-a834-a83dc126f0cf',7157,NULL),(28590,NULL,'The TP53 I254T mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by the loss of p53-mediated transactivation and increased colony formation in the mutant compared to wildtype (PMID: 25584008).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-09-15 22:58:19',NULL,NULL,NULL,NULL,'4afa0c35-0e9f-410e-8507-4dcc93431988',7157,NULL),(28591,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'41f37360-eee1-4f3a-bb83-76ff7f62d897',7157,NULL),(28592,NULL,'The TP53 R267Q mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by increased levels of p53-mediated transactivation (suggesting loss of negative feedback) and increased colony formation in the mutant compared to wildtype (PMID: 25584008, 10435620).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-09-28 18:30:24',NULL,NULL,NULL,NULL,'c9ef7cfc-1216-4d66-ba5b-32c44a642b4f',7157,NULL),(28593,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'94b57c4a-5bb1-44d1-9819-4b0fd48c34b6',7157,NULL),(28594,NULL,'The TP53 R273H mutation is located in the protein\'s DNA binding domain. This mutation has been found in triple-negative breast cancer and Li-Fraumeni syndrome (PMID: 31776133, 25584008). Expression of this mutant resulted in cell survival by activating AKT signaling and suppressing the expression of BCL-modifying factor (BMF) (PMID: 26181206). Expression of this mutant in TP53-null cells resulted in decreased transactivation of p53 target genes, as measured by a luciferase reporter assay (PMID: 25584008, 15037740). Expression of this mutation in osteosarcoma and breast cancer cell lines demonstrated that it is inactivating as measured by moderately increased cell proliferation and failure to suppress colony growth compared to wildtype (PMID: 25584008, 31776133).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-09-28 18:32:56',NULL,NULL,NULL,NULL,'b54d2ced-283e-49fa-bfe2-8d3c01d34c73',7157,NULL),(28595,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'0b69cc7e-f05c-4306-9b34-f7620ad43bde',7157,NULL),(28596,NULL,'The TP53 E285V mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by the loss of p53-mediated transactivation as well as defective growth suppression and apoptosis in the mutant compared to wildtype (PMID: 25584008, 18762572).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-09-15 23:05:17',NULL,NULL,NULL,NULL,'181e1d31-6d2e-49ee-bb6c-386b07892aea',7157,NULL),(28597,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'10cc2308-482b-41ad-8554-2a19e84a6a03',7157,NULL),(28598,NULL,'The TP53 R175L mutation is located in the protein\'s DNA binding domain and occurs at a hotspot residue (PMID: 26619011). In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by colony formation and reduced ability to induce apoptosis in the mutant compared to wildtype (PMID: 25584008, 15781620, 18762572).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-09-16 15:54:52',NULL,NULL,NULL,NULL,'a288827a-589c-4f83-94a1-15027bd2329d',7157,NULL),(28599,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2022-09-15 23:14:17',NULL,NULL,NULL,NULL,'a2803d54-e3a5-4ae4-9f14-e290f9cfa059',7157,NULL),(28600,NULL,'The TP53 R175C mutation is located in the protein\'s DNA binding domain and occurs at a hotspot residue (PMID: 26619011). In vitro studies have demonstrated that this mutation has inconclusive effect, as evidenced by cell cycle arrest and apoptosis comparable to that of the wildtype (PMID: 22955915).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2022-09-16 15:56:08',NULL,NULL,NULL,NULL,'f1612c40-9be7-4d4b-9ee4-881ddc4dc72a',7157,NULL),(28601,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'f67b970c-6d59-42ba-91d8-d178dc63659c',7157,NULL),(28602,NULL,'The TP53 R248Q mutation is located in the protein\'s DNA binding domain. Expression of this mutation in TP53-null cell lines resulted in aggregation of unfolded mutant proteins, likely leading to destabilization of TP53 and upregulation of heat shock proteins (PMID: 21445056). Expression of this mutation in osteosarcoma cell lines led to a reduced apoptotic response, including reduced expression of pro-apoptotic proteins (PMID: 16778209). In biochemical assays, this mutation was found to bind DNA with a lower affinity than wildtype TP53 (PMID: 24814347).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'4482b15e-4ec4-4d3b-8818-533d02e248ae',7157,NULL),(28603,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'7cec6549-39de-4936-a81f-7462dc6cb172',7157,NULL),(28604,NULL,'The TP53 R273C mutation is located in the protein\'s DNA binding domain. Expression of this mutant in TP53 null mouse embryonic fibrobalsts (MEFs) resulted in a significant increase in cell migration relative to TP53 null cells (PMID: 23612969). Structural studies demonstrated that the R273C mutation leads to a dramatic reduction in the DNA binding affinity of p53, although the protein retains wildtype stability (PMID: 23863845, 11900253). Expression of this mutation in cell lines that lack TP53 expression did not enhance TP53-mediated transcriptional activity in reporter assays, as compared to expression of wildtype TP53 (PMID: 15037740).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'1795102b-8bb7-4343-999c-44e20f282c49',7157,NULL),(28605,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2025-03-12 14:45:47',NULL,NULL,NULL,NULL,'3a9e6f10-5522-4a50-b939-26727c5abba6',7157,NULL),(28606,NULL,'The TP53 R273G mutation is located in the protein\'s DNA binding domain and occurs at a hotspot residue (PMID: 26619011). In vitro studies have demonstrated that the TP53 R273G is likely neutral as measured by similar levels of proliferation, colony formation and invasion in the mutant compared to wildtype (PMID: 24677579, 37697151).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2025-03-12 14:45:49',NULL,NULL,NULL,NULL,'8997fe78-40db-4812-8ead-2635615747c1',7157,NULL),(28607,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'88122f71-b84f-4681-bb49-6447aa9180cb',7157,NULL),(28608,NULL,'The TP53 R213Q mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is inactivating, as measured by reduced ability to induce cell cycle arrest and apoptosis, as well as increased induction of MDM2 expression (PMID: 10871862).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-09-15 23:21:16',NULL,NULL,NULL,NULL,'ca3a45e9-ba06-4bdf-8ff8-4cb85c1eb250',7157,NULL),(28609,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'2798f6db-abab-48cf-af47-c72abcc3894a',7157,NULL),(28610,NULL,'The TP53 G245S mutation is located in the protein\'s DNA binding domain. Expression of this mutation in cell lines that lack TP53 expression did not enhance TP53-mediated transcriptional activity in reporter assays, as compared to expression of wildtype TP53 (PMID: 15037740). A mouse model harboring the TP53 G245S mutation displayed lack of p53 tumor suppressor abilities including cell cycle arrest, senescence and apoptosis. TP53 G245S-mutant mice display rapid tumor onset and accelerated death in comparison to p53-null mice (PMID: 2358418).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'25888452-3f91-4dfb-9ffa-b910ee02be2e',7157,NULL),(28611,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'d334264d-fd19-4147-ac6c-73aed2517c29',7157,NULL),(28612,NULL,'The TP53 G245D mutation is located in the protein\'s DNA binding domain. Structural studies have shown that this mutation results in differences in conformational flexibility of the DNA-binding domain of p53 (PMID: 22803791). Expression of this mutant in hepatocellular carcinoma cell lines resulted in association with the transcription factor ZBP-89 in the cytoplasm. The ZBP-89/mutant TP53 interaction abrogated induction of the cell cycle gene p21 and other apoptotic proteins, leading to reduced apoptosis (PMID: 22214764). Additionally, expression of this mutation in head and neck cancer cell lines was associated with the inability of TP53 to suppress colony growth, as compared to wildtype TP53 and is associated with reduced expression of p21 suggesting that the G245D mutation inactivates the function of p53 (PMID: 25119136).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-05-18 18:39:34',NULL,NULL,NULL,NULL,'b1e75857-639f-4ad4-bf91-8819ae1925c7',7157,NULL),(28613,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2022-09-15 23:24:59',NULL,NULL,NULL,NULL,'5d65bf5b-ce94-495a-817d-ffcfe4d851fe',7157,NULL),(28614,NULL,'The TP53 G245C mutation is located in the protein\'s DNA binding domain. In vitro and structural studies have demonstrated that this mutation has inconclusive effect, as evidenced by the similar levels of TP53-mediated transcriptional activity in the mutant compared to wildtype, even though the mutant results in differences in conformational flexibility of the DNA-binding domain of p53 (PMID: 15037740, 22803791).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2022-09-28 18:35:52',NULL,NULL,NULL,NULL,'13d74785-c4da-4a68-b468-5773a14a5412',7157,NULL),(28615,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'633c047f-3593-41bd-9c66-d39f5be99226',7157,NULL),(28616,NULL,'The TP53 G245A mutation is located in the protein\'s DNA binding domain. This mutation destabilizes p53-DNA binding. However, acetylation was shown to restore the DNA-binding ability and growth-suppressive activity of this mutation (PMID: 20589832).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'d26ce914-72cf-4652-905e-3f81efa3c871',7157,NULL),(28617,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'1ed8e010-a253-402f-b9fb-72c72ebd5f7a',7157,NULL),(28618,NULL,'The TP53 Y220C mutation is located in the protein\'s DNA binding domain. Structural studies demonstrated that this mutation destabilizes p53 due the loss of five electrostatic interactions with key residues (PMID: 23315175). A small molecule compound, PK7088, raises the melting temperature of this mutation, triggering cell-cycle arrest and apoptosis. This compound also increases the amount of correctly folded p53 in Y220C mutant cells and increases the expression of p53 target genes such as p21 and Noxa (PMID: 23630318). Expression of this mutation in cell lines that lack TP53 expression did not enhance TP53-mediated transcriptional activity in reporter assays, as compared to expression of wildtype TP53 (PMID: 15037740).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'e4c8f539-c654-4e1b-8b94-ca11569ef178',7157,NULL),(28619,NULL,'There is promising clinical data in patients with TP53 Y220C-mutant solid tumors treated with the TP53 structural corrector rezatapopt.','TUMOR_TYPE_SUMMARY',NULL,_binary '\0',NULL,'2024-07-24 12:37:06',NULL,NULL,NULL,NULL,'58cfdce6-2588-49a9-8f3c-76534fd4951c',7157,NULL),(28620,NULL,'Rezatapopt is an orally available, small-molecule structural corrector specific for the Y220C-mutant p53 protein. In the Phase I PYNNACLE (NCT04585750) trial of rezatapopt in 29 patients with advanced solid tumors harboring a TP53 Y220C mutation, one patient with small cell lung cancer and one patient with breast cancer each had a partial response to treatment (Abstract: Dumbrava et al. Abstract# 3003, ASCO 2022. https://ascopubs.org/doi/abs/10.1200/JCO.2022.40.16_suppl.3003). In an updated analysis of the Phase I/II PYNNACLE (NCT04585750) trial of rezatapopt in 61 patients with TP53 Y220C solid tumors, the overall response rate was 33.3% (n=12) in patients with TP53 Y220C and KRAS wildtype tumors, including ovarian, breast, prostate, small-cell lung and endometrial cancer, and the median duration of confirmed response was 7 months (Abstract: Schram et al. Abstract# LB_A25, AACR 2023. https://aacrjournals.org/mct/article/22/12_Supplement/LB_A25/730549/Abstract-LB-A25-Updated-Phase-1-results-from-the). The results of an updated subgroup analysis of the Phase I/II PYNNACLE (NCT04585750) trial of rezatapopt in heavily pretreated patients with advanced ovarian cancer (n=22), specifically those with TP53 Y220C and KRAS wildtype tumors, demonstrated that among fifteen evaluable patients, seven patients achieved partial response, seven had stable disease, and one had progressive disease, with an overall response rate of 47% and median duration of confirmed response of 7.0 months (Abstract: Schram et al. Abstract# LBA_26, SGO 2024. https://www.gynecologiconcology-online.net/article/S0090-8258(24)00453-0/fulltext). In vivo xenograft studies with TP53 Y220C-mutant gastric cancer cell line NUGC3 and Y220C-mutant patient-derived xenografts demonstrated sensitivity to rezatapopt treatment as measured by dose-dependent tumor shrinkage and conversion of TP53 Y220C to the wildtype conformation (Abstract: Dumble et al. Abstract# LB006, AACR 2021. https://aacrjournals.org/cancerres/article/81/13_Supplement/LB006/669897/Abstract-LB006-PC14586-The-first-orally).','INVESTIGATIONAL_THERAPEUTIC_IMPLICATIONS_DRUG_SENSITIVITY','LEVEL_Fda3',_binary '\0','Sensitive','2025-03-19 13:05:12',NULL,'LEVEL_3A','NO','NO','495ba473-e137-4343-b248-04acbea470bd',7157,NULL),(28621,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'5afc6808-9dfc-4408-bbb3-2175f1c98cd1',7157,NULL),(28622,NULL,'The TP53 Y220S mutation is located in the protein\'s DNA binding domain. This mutation has been identified as a germline mutation and is commonly found in patients with Li-Fraumeni syndrome (LFS). Cells expressing TP53 Y220S displayed angiogenetic properties, andibroblasts expressing this mutation exhibited resistance to doxorubicin hydrochloride (DX) (PMID: 15977174).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'bbdc7145-4b24-441d-8dbb-8100078c9759',7157,NULL),(28623,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'5efbee72-241e-487a-b2e2-940bea3a256f',7157,NULL),(28624,NULL,'The TP53 R282Q mutation is located in the protein\'s DNA binding domain. This mutation has been identified as a statistically significant hotspot (PMID: 26619011). Structural studies have demonstrated that this mutation is likely inactivating, as evidenced by the decreased flexibility of the L1 DNA-binding loop and two novel conformations of the L3 DNA-binding loop in the mutant compared to wildtype, all of which are predicted to deactivate the tumor suppressor functions of p53 (PMID: 18453682).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-10-03 14:34:31',NULL,NULL,NULL,NULL,'42c10a9f-79bc-4300-87bb-dc024eff1ef4',7157,NULL),(28625,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'7d717015-2e80-46dc-bcaf-5c79cdf42a67',7157,NULL),(28626,NULL,'The TP53 H179R mutation is located in the protein\'s DNA binding domain. Expression of this mutant failed to induce expression of genes involved in apoptosis or cell cycle arrest (PMID: 17361096). Additionally, this mutation exhibited aberrant regulation of the p53 target gene, BTG2, resulting in elevated HRAS and a unique expression pattern of a cancer-related gene signature (PMID: 22427690).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'d37c6c5b-21b8-47b4-a98a-8fae8955f01b',7157,NULL),(28627,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'12012306-2551-40fd-ba51-4967a0101d4a',7157,NULL),(28628,NULL,'The TP53 H179Y mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is inactivating, as evidenced by the increased G1 to S phase transition, enlarged cell size, as well as increased expression of cyclin A1 and CDK4 in the mutant compared to wildtype (PMID: 17530187).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-09-15 23:48:56',NULL,NULL,NULL,NULL,'4900f3b0-5437-4553-a4b8-b7a9978c107c',7157,NULL),(28629,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'900bfaea-0b3a-4a6a-a739-3562a76d32a9',7157,NULL),(28630,NULL,'The TP53 H179L mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is inactivating, as evidenced by enhanced adhesion to extracellular matrix and increased growth in suspension culture in the mutant compared to wildtype (PMID: 23150443).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-09-15 23:57:11',NULL,NULL,NULL,NULL,'5b08abf9-5d6f-499f-8c90-378c1a899f37',7157,NULL),(28631,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'bc045567-d397-42de-a75c-dda7444199e5',7157,NULL),(28632,NULL,'The TP53 H179Q mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is inactivating and behaves as a dominant-negative allele, as evidenced by reduced expression of p21 and increased G1 to S phase cell cycle progression in the mutant compared to wildtype (PMID: 22540896).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-09-15 23:59:54',NULL,NULL,NULL,NULL,'4ee72828-764c-4310-90a1-4719796682ca',7157,NULL),(28633,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'fd6aa90a-36c5-48f7-a943-b7cb7fb0bfe9',7157,NULL),(28634,NULL,'The TP53 H179N mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by reduced DNA binding activity and similar exonuclease activity in the mutant compared to wildtype (PMID: 19462533).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-09-16 00:04:54',NULL,NULL,NULL,NULL,'89391554-fcfb-436b-9903-c4982afcaf7e',7157,NULL),(28635,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'58a24041-73ee-499e-91b0-cdf0fca27d79',7157,NULL),(28636,NULL,'The TP53 H193R mutation is located in the protein\'s DNA binding domain. This mutation has been found in sarcoma (PMID: 25669829). In vitro studies have demonstrated that this mutation is likely inactivating, as measured by decreased DNA binding and decreased transactivaction of TP53, likely leading to reduced p21 activation (PMID: 9627118). In a phase I clinical trial of pazopanib, a VEGF inhibitor, and vorinostat, a histone deacetylase inhibitor, eleven patients with sarcoma and colorectal cancer who harbor the TP53 H193R mutation as well as other TP53 mutations in exons 5-8 had longer median progression-free and overall survival compared to patients without TP53 mutations in response to treatment (PMID: 25669829).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-09-28 19:04:03',NULL,NULL,NULL,NULL,'19981225-8861-4254-8a15-b38ad0176529',7157,NULL),(28637,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'e0acc9c2-c214-44b1-b98e-30e699ceead2',7157,NULL),(28638,NULL,'The TP53 H193N mutation is located in the protein\'s DNA binding domain. In vitro studies have suggested that this mutation is likely inactivating, as evidenced by increased exonuclease activity and significantly reduced DNA binding activity compared to the wildtype (PMID: 19462533).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-11-04 12:46:13',NULL,NULL,NULL,NULL,'a4c0defb-5dde-4e3c-86b4-514e487bbcbd',7157,NULL),(28639,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'41f3b0e6-56b8-4f6b-84fd-181f55838535',7157,NULL),(28640,NULL,'The TP53 C176F mutation is located in the protein\'s DNA binding domain. This mutation has been found in head and neck cancer (PMID: 22090360). In vitro studies have demonstrated that this mutation is inactivating, as evidenced by decreased transactivation of p21, decreased production of reactive oxygen species and decreased cell death when the mutant is treated with radiation compared to wildtype, suggesting an inhibition of radiation-induced senescence that results in treatment failure (PMID: 22090360).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-11-04 14:27:17',NULL,NULL,NULL,NULL,'d6a9728c-480b-4a9a-a8b2-48c3fd855b33',7157,NULL),(28641,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'31896bf1-ca99-4d2c-b09c-964af0ee3fa6',7157,NULL),(28642,NULL,'The TP53 C176R mutation is located in the protein\'s DNA binding domain. In vitro studies have suggested that this mutation is inactivating and acts as a dominant negative, as evidenced by the ability of mutant yeasts coexpressing both wild-type and C176R-mutated p53 to survive on Foa plates compared to wildtype (PMID: 8633021).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-11-04 14:49:52',NULL,NULL,NULL,NULL,'8be2e6a2-755f-4bd6-ab7d-88b448c6171a',7157,NULL),(28643,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'446fc820-d97c-445b-ae45-bcadb8d2331f',7157,NULL),(28644,NULL,'The TP53 I195T mutation is located in the protein\'s DNA binding domain. Structural studies have suggested that this mutation is likely inactivating as evidenced by the decreased half-life time, faster aggregation and faster unfolding time at body temperature of the mutant compared to wildtype protein, suggesting that the mutant is highly destabilized and could result in loss of p53 tumor suppressor function (PMID: 12700230).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-11-04 16:25:55',NULL,NULL,NULL,NULL,'9c47ac79-0f93-4901-8709-3d2666850fcf',7157,NULL),(28645,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'790f5f5e-b15a-449e-a777-cc631aa83b60',7157,NULL),(28646,NULL,'The TP53 G266E mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by decreased transcriptional transactivation of p53 target genes in the mutant compared to the wildtype, suggesting a loss of function to regulate transactivation of p53 target genes (PMID: 17724467).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-11-04 16:34:32',NULL,NULL,NULL,NULL,'a37213f6-cf16-40a6-b0bc-368d8530366f',7157,NULL),(28647,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'343aedad-e7f2-4766-97c6-e2b1d89249f0',7157,NULL),(28648,NULL,'The TP53 R249S mutation is located in the protein\'s DNA binding domain. Structural and in vitro studies have demonstrated that this mutation is likely inactivating as evidenced by distortion of the local binding surface and increased aggregation of the mutant proteins compared to wildtype, reduced TP53 transactivation activity as measured by luciferase reporter assays, defective cell cycle progression, and aberrant expression of apoptosis proteins in cells expressing the mutant protein compared to wildtype (PMID: 14741214, 21445056, 18996393).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-11-04 16:27:28',NULL,NULL,NULL,NULL,'9c07e707-9d36-4a29-90f3-c27a187e03da',7157,NULL),(28649,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'0102b352-c961-4002-a011-30f5682ef93d',7157,NULL),(28650,NULL,'The TP53 R249M mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by the mutant\'s inability to inhibit the transcriptional activity of the p21 promoter and enhance TP53-mediated transcriptional activity in reporter assays compared to wildtype (PMID: 17999388, 15037740).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-11-04 16:18:29',NULL,NULL,NULL,NULL,'131c7f95-88bd-4981-a4c7-727fae35bef8',7157,NULL),(28651,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'34064c08-acba-4723-8dbb-cf91b2c70392',7157,NULL),(28652,NULL,'The TP53 R249W mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by increased colony formation and greater migration in the mutant compared to wildtype (PMID: 23612969).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-11-04 16:30:56',NULL,NULL,NULL,NULL,'ed12f229-01c9-4abd-9750-7d75ea473d06',7157,NULL),(28653,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'6110b319-851e-494d-902a-298390b81b6d',7157,NULL),(28654,NULL,'The TP53 Y234C mutation is located in the protein\'s DNA binding domain. This mutation has been found in ovarian cancer (PMID: 26748848). In vitro studies have demonstrated that this mutation is inactivating, as evidenced by decreased transactivation of p53 target genes, increased cytoplasmic localization and increased apoptosis when treated with an amyloid aggregate TP53 inhibitor in the mutant compared to wildtype, suggesting that this mutation may cause amyloid aggregate formation that inactivates the p53 protein (PMID: 10229196, 16861262, 26748848).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-11-07 12:49:06',NULL,NULL,NULL,NULL,'96e2befc-af08-41f6-9e7c-1756b7ed3e47',7157,NULL),(28655,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'8da5c56f-54ce-4e1e-aa44-bddeecd51b9c',7157,NULL),(28656,NULL,'The TP53 Y234H mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by the reduced ability to transactivate p53 target genes of the mutant compared to wildtype (PMID: 22710932).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-11-05 11:23:01',NULL,NULL,NULL,NULL,'27311c4f-ae10-4f10-b49f-113d790baa00',7157,NULL),(28657,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'55add0c9-1b2d-4f4a-c019-260bcb83dd20',7157,NULL),(28658,NULL,'The TP53 C238F mutation is located in the protein\'s DNA binding domain. This mutation has been found in breast cancer (PMID: 20407015). In vivo and structural studies have demonstrated that this mutation is inactivating, as evidenced by the structural prediction that the mutation interferes with the histidine or cysteine side chains that are known to be involved in the coordination of the zinc ion, as well as the mutant\'s inability to transactivate p53 target genes compared to wildtype (PMID: 20407015).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-11-07 12:49:39',NULL,NULL,NULL,NULL,'f651d617-a45b-4abb-92ea-e0b8ae80cf0f',7157,NULL),(28659,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'dbc135d1-8807-4a56-ac84-a2a9563d2ff5',7157,NULL),(28660,NULL,'The TP53 C238S mutation is located in the protein\'s DNA binding domain. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by decreased transactivation of p53 target genes in the mutant compared to wildtype (PMID: 19681600).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-11-05 11:32:40',NULL,NULL,NULL,NULL,'49e1b7b9-d9d6-440c-b0a8-ac813f3a2740',7157,NUL