nction','2022-11-07 12:50:54',NULL,NULL,NULL,NULL,'1151e72c-dc3c-4a2c-ba52-c825b76238c2',7157,NULL),(28667,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'3dbaa0fa-0c07-43a7-b18f-507cfeb27c1f',7157,NULL),(28668,NULL,'The TP53 P151H mutation is located in the DNA binding domain of the protein. In vivo studies have demonstrated that this mutation is likely inactivating, as evidenced by decreased transactivation of p53 target genes in the mutant compared to wildtype (PMID: 22908277).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:12:31',NULL,NULL,NULL,NULL,'b88eb62c-c5da-4c01-8525-9e907028360a',7157,NULL),(28669,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'cfa0a2ab-09bb-4c97-ba4a-30f701297160',7157,NULL),(28670,NULL,'The TP53 P151A mutation is located in the DNA binding domain of the protein. In vivo studies have demonstrated that this mutation is likely inactivating, as evidenced by the complete lack of transactivation of p53 target genes in the mutant compared to wildtype (PMID: 20407015).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:13:53',NULL,NULL,NULL,NULL,'89c7e0cc-517a-4bfd-a4db-20384cc53bb0',7157,NULL),(28671,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'5460b591-1ea9-493e-a8ad-6cb2f5285272',7157,NULL),(28672,NULL,'The TP53 Y236C mutation is located in the DNA binding domain of the protein. This mutation has been found in colon cancer  (PMID: 16827139). In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by increased cytoplasmic localization of the mutant, leading to reduced transcriptional activity in the mutant compared to wildtype (PMID: 16827139).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:14:15',NULL,NULL,NULL,NULL,'ee2e9c0c-5c03-4700-bfd2-07ae5859bead',7157,NULL),(28673,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'b652862c-9b8d-4cbf-8a89-b3e3bcb0bfe4',7157,NULL),(28674,NULL,'The TP53 Y236D mutation is located in the DNA binding domain of the protein. In vivo studies have demonstrated that this mutation is likely inactivating, as evidenced by the loss of binding ability of the p53 protein to its consensus sequence in the mutant compared to wildtype (PMID: 8633021).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:14:49',NULL,NULL,NULL,NULL,'0d29d38e-250f-4c6c-9b79-371450932c17',7157,NULL),(28675,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'52cd1643-06bb-4ac4-9f04-e05f0f602a66',7157,NULL),(28676,NULL,'The TP53 Y236S mutation is located in the DNA binding domain of the protein. In vivo studies have demonstrated that this mutation is likely inactivating, as evidenced by the loss of transcriptional activity for p53 target genes, p21 and RGC, in the mutant compared to wildtype (PMID: 11429705).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:15:19',NULL,NULL,NULL,NULL,'dbc51820-a8b0-4383-b1e3-8880dfaecd8f',7157,NULL),(28677,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'502cefa0-d28c-4506-a108-1035f51d8fe4',7157,NULL),(28678,NULL,'The TP53 P278S mutation is located in the DNA binding domain of the protein. In vitro and in vivo studies have demonstrated that this mutation is inactivating, as evidenced by failure to activate the p21 promoter in the mutant compared to wildtype (PMID: 22989750).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-12-07 18:15:41',NULL,NULL,NULL,NULL,'833b1afa-c712-4d02-ae7d-2fa94464b10d',7157,NULL),(28679,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'4c4e6134-e407-43f2-9485-7b7fc2865c9e',7157,NULL),(28680,NULL,'The TP53 P278L mutation is located in the DNA binding domain of the protein. In vivo studies have demonstrated that this mutation is likely inactivating, as evidenced by failure to transactivate p53 target genes in the mutant compared to wildtype (PMID: 16861262).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:16:01',NULL,NULL,NULL,NULL,'71cdbaeb-4d9a-422c-93be-3963b82b154d',7157,NULL),(28681,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'efbdd2eb-04d8-4744-9188-7e0541eef00f',7157,NULL),(28682,NULL,'The TP53 P278A mutation is located in the DNA binding domain of the protein. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by failure to transactivate p53-dependent genes in the mutant compared to wildtype (PMID: 24076587).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:17:55',NULL,NULL,NULL,NULL,'c75da0cb-1d2f-42be-9869-bfd46052d9c3',7157,NULL),(28683,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'32202420-35e5-4bd4-b05c-99a0ec5b4654',7157,NULL),(28684,NULL,'The TP53 P278R mutation is located in the DNA binding domain of the protein. This mutation has been found in hepatocellular carcinoma (PMID: 21760996). In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by the loss of transactivation activity of p53 target genes in the mutant compared to wildtype (PMID: 21760996).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:20:19',NULL,NULL,NULL,NULL,'f5736b95-d9c0-47d3-a5d3-bc56948d72ca',7157,NULL),(28685,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'64951c47-fa12-4c80-82bf-0a7e60644559',7157,NULL),(28686,NULL,'The TP53 C135Y mutation is located in the DNA binding domain of the protein. In vitro studies with p53-null endometrial cancer cells expressing TP53 C135Y have demonstrated that this mutation is inactivating as measured by loss of miRNA expression regulation, specifically the microRNA miR-130b and miR-200c, resulting in increased epithelial to mesenchymal transition and cell invasion in the mutant compared to wildtype (PMID: 22847613). In vivo studies with yeast expressing TP53 C135Y demonstrated that the mutation is inactivating as measured by the loss of transactivational activity as compared to wildtype (PMID: 27328919, 12826609). In vitro studies with various human cancer cell lines expressing TP53 C135Y also demonstrated the mutation is inactivating as measured by reduced growth suppression activity as compared to wildtype (PMID: 29979965, 30224644).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-19 14:35:45',NULL,NULL,NULL,NULL,'58ac6d98-c731-4ae6-adf3-fa75457ce195',7157,NULL),(28687,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'6715ed2d-1b0b-4556-bb8d-e29a218e2d75',7157,NULL),(28688,NULL,'The TP53 C135R mutation is located in the DNA binding domain of the protein. This mutation has been found in non-small cell lung cancer (PMID: 17914575). Structural and in vitro studies have demonstrated that this mutation is inactivating, as evidenced by its predicted negative effect on p53-DNA interaction and the mutant protein\'s inability to bind to the TP53 response element from the p21 gene in an electrophoretic mobility shift assay compared to wildtype (PMID: 17914575).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:22:15',NULL,NULL,NULL,NULL,'47bcf836-b853-4dc6-8446-91840ffe30be',7157,NULL),(28689,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'c611c09b-1c1b-4a04-9e2e-86211924af5f',7157,NULL),(28690,NULL,'The TP53 C135S mutation is located in the DNA binding domain of the protein. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by reduced binding capacity to TP53 response elements in the mutant compared to wildtype (PMID: 12034820).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:22:44',NULL,NULL,NULL,NULL,'927a3833-3c85-4286-bdb9-74a8cdeef3d6',7157,NULL),(28691,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'ddca5b22-8975-42c7-8261-ce9212412460',7157,NULL),(28692,NULL,'The TP53 C275S mutation is located in the DNA binding domain of the protein. Structural and in vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by decreased affinity for the Gadd45 promoter site and increased attenuation of oxidative dissociation in the mutant compared to wildtype, suggesting that this mutation affects p53\'s function through altering p53-DNA contact (PMID: 25584637).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-12-07 18:23:25',NULL,NULL,NULL,NULL,'b19da370-891e-48e9-bf54-1b6d7b3e4bff',7157,NULL),(28693,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'8932cc30-946c-4dcf-9b18-0ec6fd2f6c41',7157,NULL),(28694,NULL,'The TP53 M237K mutation is located in the DNA binding domain of the protein. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by the transactivation of some p53 target genes, including bax and MDM2, but not p21 in the mutant compared to wildtype, suggesting that the mutant is partially but not fully functional (PMID: 20505364).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:24:28',NULL,NULL,NULL,NULL,'f633f499-f3cc-4229-874e-ff248e29efd0',7157,NULL),(28695,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'52522d39-f779-465b-b75c-ae42eaf5ee0a',7157,NULL),(28696,NULL,'The TP53 S241F mutation is located in the DNA binding domain of the protein. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by decreased co-immunoprecipitation of p53 with the tumor suppressor BARD1 and the 3\' processing factor cleavage-stimulation factor 1 (CstF1), respectively, as well as decreased formation of the p53/BARD1/CstF1 complex, resulting in reduced inhibition of 3\' cleavage (PMID: 21383700).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:24:59',NULL,NULL,NULL,NULL,'dde9b7ee-3377-4b66-8840-abba2b97b783',7157,NULL),(28697,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'926c73a5-ef20-4e9e-b171-166a28553cf2',7157,NULL),(28698,NULL,'The TP53 S241T mutation is located in the DNA binding domain of the protein. In vitro studies have demonstrated that this mutation is inactivating and exhibits a dominant-negative phenotype, as evidenced by the lack of transcription of p53 target genes when both mutant and wildtype proteins are present, suggesting the mutant\'s ability to inhibit wildtype p53\'s transactivation ability (PMID: 11896595).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:25:23',NULL,NULL,NULL,NULL,'4fa7669a-0569-4358-898b-6cbaac8c2d03',7157,NULL),(28699,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'707351b7-2efe-4dad-9bae-38852823e1f7',7157,NULL),(28700,NULL,'The TP53 V272M mutation is located in the DNA binding domain of the protein. This mutation has been found in esophageal cancer (PMID: 9096669). In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by the mutant\'s reduced reactivity with the wildtype conformation-specific antibody PAb1620, suggesting the adoption of a mutant conformation, as well as reduced accumulation in cells exposed to DNA-damaging agents and inability to rescue TP53-mediated transcriptional activity in TP53-null cells of the mutant compared to wildtype (PMID:15037740, 9096669, 11870884).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:25:50',NULL,NULL,NULL,NULL,'ea2f157e-44b1-4866-a2d6-31ab37cea043',7157,NULL),(28701,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-02-23 16:22:10',NULL,NULL,NULL,NULL,'348124be-1c9c-4f7f-9fde-07b0c77ac89c',7157,NULL),(28702,NULL,'The TP53 V272L mutation is located in the DNA binding domain of the protein. In silico and in vitro studies have demonstrated that this mutation has inconclusive effect, as evidenced by comparable levels of p53 target gene transactivation in the mutant compared to wildtype, despite its position at a hotspot residue which suggests that it is likely oncogenic (PMID: 20407015, 26619011).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2022-12-07 18:27:36',NULL,NULL,NULL,NULL,'bcadaf27-fa17-4978-bc4c-1efd42db3f0a',7157,NULL),(28703,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'f75ff833-43d2-4a6a-954e-de1da2b6d03c',7157,NULL),(28704,NULL,'The TP53 V157F mutation is located in the DNA binding domain of the protein. In vitro and structural studies have demonstrated that this mutation is likely inactivating, as evidenced by the mutant protein\'s rearranged DNA-binding surface and reduced DNA-binding activity compared to wildtype, as well as reduced expression of pro-apoptotic proteins, reduced apoptotic response and impaired transcriptional activity in cells expressing the mutant compared to wildtype (PMID: 21561095, 16778209, 15037740).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-07 18:27:45',NULL,NULL,NULL,NULL,'b771c2bb-6b11-4575-83bb-63339f53b154',7157,NULL),(28705,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'4d5e948f-ead3-4b0b-a207-e93f30e4011e',7157,NULL),(28706,NULL,'The TP53 V157D mutation is located in the DNA binding domain of the protein. This mutation has been found in the germline of patients with familial cancer syndromes (PMID: 23981578). In vitro and in vivo studies have demonstrated that this mutation is inactivating, as evidenced by increased colony formation in soft agar assays and increased tumor formation in a transgenic Drosophila system expressing the mutant compared to wildtype (PMID: 23981578).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-12-07 18:28:17',NULL,NULL,NULL,NULL,'e139ddd4-b683-4b90-97ff-520a0e2eb969',7157,NULL),(28707,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'2bf5a097-e62a-4e22-a62d-64cfabb6e576',7157,NULL),(28708,NULL,'The TP53 R280K mutation is located in the DNA binding domain of the protein. In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by decreased apoptosis and increased migration in TP53-null cells expressing the mutant compared to wildtype (PMID: 24714748).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2022-12-07 18:28:37',NULL,NULL,NULL,NULL,'e3cc7c18-1e4e-4911-8127-79b267f757c8',7157,NULL),(28709,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'66bf4f84-ee70-498f-9803-abb7e70b4497',7157,NULL),(28710,NULL,'The TP53 R280T mutation is located in the DNA binding domain of the protein. This mutation has been found in glioma (PMID: 22999923). In vitro studies have demonstrated that this mutation is likely inactivating, as evidenced by increased proliferation of cells expressing the mutant compared to wildtype, as well as increased p-GSK-3 levels, reduced PTEN and Akt phosphorylation and reduced cell growth upon knockdown of the mutant protein compared to wildtype, suggesting that this mutation promotes cell growth through GSK-3beta-PTEN pathway (PMID: 22999923).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2023-02-01 16:48:23',NULL,NULL,NULL,NULL,'dc9b6b17-0643-4fb9-bd35-26ee22eb93cf',7157,NULL),(28711,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'643a4091-2dcf-40cc-a97c-2825d661a41b',7157,NULL),(28712,NULL,'The TP53 C242F mutation is located in the protein\'s DNA binding domain. Structural studies have elucidated that this mutant is inactivating as it directly affects the zinc coordination sphere by substituting one of the zinc ligands and thus affects the DNA binding capabilities of p53 (PMID: 17401432).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2023-03-16 15:50:11',NULL,NULL,NULL,NULL,'d43188f4-7503-42c5-a155-6a0ec1b14000',7157,NULL),(28713,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'074c9875-1183-46a7-8c16-5cad43f53e90',7157,NULL),(28714,NULL,'The TP53 N239S mutation is located in the protein\'s DNA binding domain. This mutant has lost the wild type p53 tumor suppresive function because this mutant is unable to bind to DNA and p53 target promoters. Moreover, it fails to regulate the transcription of p21. Additionally, xenografts studies have shown that this mutant promotes tumorigenesis in p53 null MEFs (PMID: 22553460).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'73e866a2-4701-46a6-9f19-ba5eda7316f5',7157,NULL),(28715,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'55ee798d-973d-458c-93d1-fb0b4bd68c74',7157,NULL),(28716,NULL,'The TP53 S215C mutation is located in the protein\'s DNA binding domain. Expression of this mutant resulted in transactivation of p53 target genes comparable to wildtype p53, as a measured by yeast-based functional assay (PMID: 12917626). Expression of this mutation in human osteosarcoma cell lines resulted in slightly increased apoptosis, as evidenced by cell cycle progression studies, though the result was not statistically significant (PMID: 15781620). However, this mutation is a hotspot, suggesting that it is likely oncogenic (PMID: 26619011).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'e6026de0-a248-4b16-a2b5-b46bd49f18da',7157,NULL),(28717,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'3398e46b-20a4-4486-811d-eab0ddccd483',7157,NULL),(28718,NULL,'The TP53 C242S mutation is located in the protein\'s DNA binding domain. This mutation is known to interfere with the histidine or cysteine side chains involved in coordination of the zinc ion. This structural change makes this mutant protein nonfunctional in terms of transactivation (PMID: 20407015).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'80b18f71-f2e7-4f63-afe5-5d153f40afe2',7157,NULL),(28719,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'a512b538-7474-49e2-9b80-ef6a9db53d95',7157,NULL),(28720,NULL,'The TP53 C242Y mutation is located in the protein\'s DNA binding domain. This mutation is known to interfere with the histidine or cysteine side chains involved in coordination of the zinc ion. This structural change makes this mutant protein nonfunctional in terms of transactivation (PMID: 20407015).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'eea40f25-bcab-4be0-b0aa-06a6e3d2cc78',7157,NULL),(28721,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'c04bb5bd-ddf6-4414-8970-2bb58ffb8333',7157,NULL),(28722,NULL,'The TP53 G244D mutation is located in the protein\'s DNA binding domain. When studied in a yeast model, this mutation acted as a dominant negative suggesting a loss of function mutation of p53 (PMID: 12901798).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'fee8e0dc-7b6a-410e-b3ce-e2b8d5010538',7157,NULL),(28723,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'9fc7be5a-633c-49ca-a774-dea88e50cf25',7157,NULL),(28724,NULL,'The TP53 G244S mutation is located in the protein\'s DNA binding domain. This mutation was frequently found in patients with Lii Fraumeni syndrome (LFS). Functional analysis have indicated that this mutant is unable to transactivate, does not bind to DNA and does not inhibit cell growth like wild type p53 does (PMID: 26818906).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'06dd9563-c8d2-46b8-86f0-ccdfcea83b1c',7157,NULL),(28725,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'595be5b5-8c99-40ca-bef1-f19323553624',7157,NULL),(28726,NULL,'The TP53 G244R mutation is located in the protein\'s DNA binding domain. When tested in transactivation assays, this mutant displayed lower (1.8 to 3 fold) levels than wild type p53 indicating a loss of function. Additionally, this mutant was also deficient in inhibiting cell growth in proliferation assays (PMID: 11160722).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'0f17d51e-970d-4457-b9da-d48614774198',7157,NULL),(28727,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'a83fc154-023e-426c-a0a3-a5b16078595b',7157,NULL),(28728,NULL,'The TP53 V274F mutation is located in the protein\'s DNA binding domain. In cell line studies this mutation exhibited decreased transactivation of p53 target genes and an increase in colony formation (PMID: 12782597). Additionally, overexpression of this mutant increased the resistance of prostate cells to DNA damage-induced cell death (http://www.dtic.mil/dtic/tr/fulltext/u2/a447626.pdf).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'1a7c6f6b-efb4-4fdc-a843-4e7e56a00ac6',7157,NULL),(28729,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'5efabdab-3081-4014-8fca-30138d16503a',7157,NULL),(28730,NULL,'The TP53 S121A mutation is located in the protein\'s DNA binding domain. Expression of this mutation in human osteosarcoma cell lines resulted in increased apoptosis compared to wildtype TP53, as evidenced by cell cycle progression studies (PMID: 15781620).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'6c1a04aa-198f-4254-b724-a635bce1b553',7157,NULL),(28731,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'eaa9c697-4f97-4644-8370-4bdac3e8c2ad',7157,NULL),(28732,NULL,'The TP53 S121Y mutation is located in the protein\'s DNA binding domain. While expression of this mutation in human osteosarcoma cell lines resulted in increased apoptosis compared to wildtype TP53, (PMID: 15781620), this experimental result was not statistically significant.','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'16487a38-70dd-4eff-9bda-83ebd4f9b1cd',7157,NULL),(28733,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'7dbc66fd-09d0-4725-80b4-60466e86c744',7157,NULL),(28734,NULL,'The TP53 S121C mutation is located in the protein\'s DNA binding domain. Expression of this mutation in human osteosarcoma cell lines resulted in a significant increase in apoptotic ability compared to wildtype TP53 (PMID: 15781620).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'6e290257-712b-4c12-b00d-eb3e3c863db1',7157,NULL),(28735,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'4108b6dd-d774-46dc-83fb-f4e4c6181123',7157,NULL),(28736,NULL,'The TP53 P153H mutation is located in the protein\'s DNA binding domain. Changes in the DNA binding domain result in altered contact of p53 with its target DNA sequences, thereby altering its transcriptional function (PMID: 8023157, 11900253). Expression of this mutation in human osteosarcoma cell lines resulted in increased apoptosis compared to wildtype TP53 (PMID: 15781620), though this experimental result was not statistically significant. TP53 P153H also had altered transcriptional activity of target genes in a luciferase assay compared to wildytype TP53 (PMID: 15781620).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'d051edb6-4619-4a26-8121-d09734c31c87',7157,NULL),(28737,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2025-03-12 14:38:30',NULL,NULL,NULL,NULL,'64b2e934-78aa-444c-9abf-eeaedb929eb5',7157,NULL),(28738,NULL,'The TP53 R156C mutation is located in the protein\'s DNA binding domain. There is conflicting evidence on the oncogenic effect of this mutation. Mutations in the DNA binding domain result in altered contact of p53 with its target DNA sequences, thereby affecting transcriptional function (PMID: 8023157, 11900253). Expression of TP53 R156C in human osteosarcoma cell lines resulted in increased apoptosis compared to wildtype TP53, though this experimental result was not statistically significant (PMID: 15781620). TP53 R156C demonstrated altered transcriptional activity of target genes in a luciferase assay compared to wildtype TP53 (PMID: 15781620). Conversely, in vitro studies with HCT116 and U2OS cells expressing TP53 R156C demonstrate a gene expression phenotype similar to wildtype, suggesting minimal impact on the p53 pathway (PMID: 37697151).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2025-03-12 14:38:30',NULL,NULL,NULL,NULL,'e6fe0c84-a907-4043-ae0b-3fc85008535c',7157,NULL),(28739,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'3fca7877-4ff0-4c29-a614-62a4f48062a9',7157,NULL),(28740,NULL,'The TP53 F212Y mutation is located in the protein\'s DNA binding domain. While expression of this mutation in human osteosarcoma cell lines resulted in increased apoptosis compared to wildtype TP53, (PMID: 15781620), this experimental result was not statistically significant.','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'c75e621f-6f4c-4812-844a-185ceba92676',7157,NULL),(28741,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'c79e17dd-a29c-4522-9182-20d32adfbecd',7157,NULL),(28742,NULL,'The TP53 E221Q mutation is located in the protein\'s DNA binding domain. While expression of this mutation in human osteosarcoma cell lines resulted in increased apoptosis compared to wildtype TP53, (PMID: 15781620), this experimental result was not statistically significant.','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'81e878e9-b8b8-41e3-a17d-3c1f4732f1ad',7157,NULL),(28743,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'63631662-6129-4033-985f-ed3cb10d6021',7157,NULL),(28744,NULL,'The TP53 K291Q mutation is located in the protein\'s DNA binding domain. Changes in the DNA binding domain result in altered contact of p53 with its target DNA sequences, thereby altering its transcriptional function (PMID: 8023157, 11900253). Expression of this mutation in human osteosarcoma cell lines resulted in increased apoptosis compared to wildtype TP53 (PMID: 15781620), though this experimental result was not statistically significant. TP53 K291Q also had altered transcriptional activity of target genes in a luciferase assay compared to wildytype TP53 (PMID: 15781620).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'19f9bd96-2a87-4477-b545-a03e2a37563c',7157,NULL),(28745,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2024-07-23 14:54:52',NULL,NULL,NULL,NULL,'1a702d75-9979-4c4f-9def-be858dac644c',7157,NULL),(28746,NULL,'The TP53 K292I mutation is located in the DNA binding domain of the protein. Changes in the DNA binding domain result in altered contact of p53 with its target DNA sequences, thereby altering its transcriptional function (PMID: 8023157, 11900253). In vitro studies have demonstrated that this mutation is likely activating, as evidenced by significantly increased apoptosis, decreased cell viability and altered transcription of TP53 target genes in the mutant compared to wildtype (PMID: 15781620).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2024-07-23 14:54:45',NULL,NULL,NULL,NULL,'39359a77-de12-40bf-a17b-557674374b58',7157,NULL),(28747,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'983ffafd-6427-4bcb-a07b-1bd4b7059780',7157,NULL),(28748,NULL,'The TP53 F328V mutation occurs in the protein\'s tetramerization domain. Expression of this mutation in human lung cancer cell lines resulted in decreased transcriptional activity and protein stability, as evidenced by a reporter assay (PMID: 19454241).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'f70a5690-e28a-4629-a69b-7720bcabecec',7157,NULL),(28749,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'8ea5737f-8374-4c12-8a4d-a7e6bac479d4',7157,NULL),(28750,NULL,'The TP53 L348F mutation occurs in the protein\'s tetramerization domain. Expression of this mutation in human lung cancer cell lines resulted in decreased transcriptional activity and protein stability compared to wildtype TP53, as evidenced by a reporter assay (PMID: 19454241).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'8c18e082-f43c-47c6-afcd-7c3a3c42fd73',7157,NULL),(28751,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'95d899f6-b753-41fc-ba17-c10354abeb60',7157,NULL),(28752,NULL,'The TP53 S241Y mutation is located in the protein\'s DNA binding domain. Expression of this mutant in TP53-null cells resulted in decreased transactivation of p53 target genes, as a measured by a luciferase report assay (PMID: 25584008). Additionally, the TP53 S241Y mutation failed to suppress colony growth in a colony reduction assay (PMID: 25584008).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'62868117-37d1-4152-b4d5-b80cf493a2f7',7157,NULL),(28753,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'07a9a978-1806-4d47-b748-7c50e9dfd4be',7157,NULL),(28754,NULL,'The TP53 R248L mutation is located in the protein\'s DNA binding domain. Expression of this mutant in TP53-null cells resulted in decreased transactivation of p53 target genes, as a measured by a luciferase reporter assay (PMID: 25584008). Additionally, the TP53 R248L mutation failed to suppress colony growth in a colony reduction assay compared to wildtype TP53 (PMID: 25584008). Ovarian cancer patient samples and mouse models expressing this mutation were sensitive to an amyloid aggregate TP53 inhibitor as evidenced by apoptosis assays. Some TP53 mutations have been shown to form amyloid aggregates that leads to inactivation of the TP53 protein. Responsiveness of this variant to amyloid aggregate inhibitors suggest that this is a loss-of-function mutation (PMID: 26748848).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'de24f368-de4c-41f1-8c8d-9559e23bff2b',7157,NULL),(28755,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2022-04-11 16:03:28',NULL,NULL,NULL,NULL,'6bda7bec-479c-42c6-bf32-97df8bb7e15b',7157,NULL),(28756,NULL,'The TP53 G334R mutation occurs in the protein\'s oligomerization domain and has been found as a germline low-penetrance founder mutation in individuals of Ashkenazi Jewish descent who have evidence of Li-Fraumeni syndrome (PMID: 32675277). Expression of this mutation in TP53-null cells did not alter TP53 transactivation in luciferase assays or colony growth as compared to expression of wildtype TP53 (PMID: 25584008). However, in a separate study, cells expressing TP53 G334R demonstrated impaired suppression ability in a colony reduction assay compared to wildtype cells. Additionally, immortalized G334R-mutant lymphoblastoid cell lines demonstrated impaired activation of a subset of TP53 target genes (including PCLO, PLTP, PLXNB3 and LCN15) following treatment with Nutlin-3A.  Further analysis showed TP53 G334R had reduced thermal stability compared to wild type cells (PMID: 32675277).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2022-04-18 12:43:42',NULL,NULL,NULL,NULL,'bd776b5a-dfb1-4314-a8d3-5ef37e793e24',7157,NULL),(28757,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2024-07-23 11:34:32',NULL,NULL,NULL,NULL,'c8bbc98a-d6f3-4120-81eb-c92c3fdb212b',7157,NULL),(28758,NULL,'The TP53 R282W mutation is located in the DNA binding domain of the protein. This mutation has been identified in glioma and colorectal cancer and is a statistically significant hotspot (PMID: 25078279, 21458303, 26619011). There is conflicting evidence of the functional effect of this mutation. In vitro studies of TP53-null cell lines expressing TP53 R282W demonstrate that the mutation is likely inactivating as measured by destabilization of TP53, inhibited AMPK activation in response to glucose deprivation and increased cellular growth and invasion compared to wildtype (PMID: 17401432, 31395785, 24857548, 21445056). In contrast, other in vitro studies of TP53-null cell lines expressing TP53 R282W demonstrate that the mutation could be likely activating as measured by upregulated CYP3A4 levels, increased transactivation of p21, increased protein stability, increased MIR155HG expression and increased cellular growth and invasion compared to wildtype (PMID: 24603336, 15077194, 37030635, 22797073).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2024-07-23 11:35:22',NULL,NULL,NULL,NULL,'1e75a314-3d89-4e02-9292-5f3a5e1bc2f5',7157,NULL),(28759,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'30e07ac9-9569-4563-ab13-29d8d7c74d59',7157,NULL),(28760,NULL,'The TP53 P250L mutation is located in the protein\'s DNA binding domain. Expression of this mutation in TP53-null cell lines resulted in aggregation of mutant unfolded proteins, likely leading to inactivation of TP53 and upregulation of heat shock proteins (PMID: 21445056).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'506e75cd-a2e9-42bb-b2b4-67a6966c572f',7157,NULL),(28761,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'e66907cb-2c8d-4177-8fa5-5384f62831c7',7157,NULL),(28762,NULL,'The TP53 E258V mutation is located in the protein\'s DNA binding domain. Expression of this mutation in TP53-null cell lines resulted in aggregation of mutant unfolded proteins, likely leading to inactivation of TP53 and upregulation of heat shock proteins (PMID: 21445056).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'f6bc0d78-5a1d-4d01-ad6b-956b3592df46',7157,NULL),(28763,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'34a8e91b-0b5f-470a-aa87-0fdc8af3b9e7',7157,NULL),(28764,NULL,'The TP53 R110L mutation is located in the protein\'s DNA binding domain. Expression of this mutation in TP53-null cell lines resulted in aggregation of mutant unfolded proteins, likely leading to inactivation of TP53 and upregulation of heat shock proteins (PMID: 21445056). Breast cancer cell lines expressing this mutation were dependent of the expression of GEF-H1, a guanidine nucleotide exchange factor (PMID: 16778209).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'6e3b9ea7-4819-4573-ab6a-42897c1f12c7',7157,NULL),(28765,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'f12818a2-8ef1-42e9-912e-5e4d8bcf2209',7157,NULL),(28766,NULL,'The TP53 R110P mutation is located in the protein\'s DNA binding domain. Expression of this mutation in TP53-null cell lines resulted in aggregation of mutant unfolded proteins, likely leading to inactivation of TP53 and upregulation of heat shock proteins (PMID: 21445056).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'9dbab568-5e51-425b-a92c-74e4e763b85b',7157,NULL),(28767,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'6d42a140-887f-4685-a040-f4f6bcd1cc39',7157,NULL),(28768,NULL,'The TP53 H168R mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in TP53-null lung cancer cell lines results in reduced TP53 transactivation activity, as evidenced by luciferase reporter assays. Cell lines expressing this mutation also have a defect in cell cycle progression and aberrant expression of apoptosis proteins, as compared to cells expressing wildtype TP53 (PMID: 18996393).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'57cc120f-bba4-45da-952a-c728c064e5c7',7157,NULL),(28769,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'81e84053-bb4f-4799-aad0-4ec03e4a39b1',7157,NULL),(28770,NULL,'The TP53 T123A mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in TP53-null lung cancer cell lines did not significantly alter TP53-induced transactivation activity, apoptosis, or cell cycle progression as compared to cells expressing wildtype TP53 (PMID: 18996393). Other reports suggest that this mutation results in a gain-of-function, leading to enhanced apoptosis (PMID: 16687402).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'3ab614df-855d-45dc-bef9-b9940929c473',7157,NULL),(28771,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'473e1586-aee3-40ac-b278-ccb486b9a7ed',7157,NULL),(28772,NULL,'The TP53 H168N mutation occurs in the protein\'s DNA binding domain. In biochemical assays, this mutation had DNA binding ability approximately 70% of that of wildtype P53, but no difference in exonuclease activity (PMID: 19462533). Further functional assays need to be completed to determine if this alteration is oncogenic.','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'896cbb36-59a2-4d4c-bd85-92f94a52591c',7157,NULL),(28773,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-02-23 16:16:27',NULL,NULL,NULL,NULL,'fa2463e4-3c5e-4877-a352-6d0434cad166',7157,NULL),(28774,NULL,'The TP53 H233N mutation occurs in the protein\'s DNA binding domain. In biochemical assays, this mutation did not alter the DNA binding ability of TP53 compared to wildtype TP53 (PMID: 19462533). However, this mutation is a hotspot, suggesting that it is likely oncogenic (PMID: 26619011).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'cec92b8a-1cb2-4db1-996e-7c896ce1d025',7157,NULL),(28775,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'89e26112-9021-49f1-8a9b-1e4ebb985344',7157,NULL),(28776,NULL,'The TP53 H297N mutation occurs in the protein\'s DNA binding domain. In biochemical assays, this mutation did not alter the DNA binding ability of TP53 (PMID: 19462533). Further functional assays need to be completed to determine if this alteration is oncogenic.','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'3a70d2c9-cad1-447c-b723-4d37b83dcdb6',7157,NULL),(28777,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'487a1829-f2f5-430e-c070-c21914273612',7157,NULL),(28778,NULL,'The TP53 H214N mutation occurs in the protein\'s DNA binding domain. In biochemical assays, this mutant protein has reduced DNA binding activity, suggesting it is loss-of-function. Further functional assays are required to determine if this alteration is oncogenic (PMID: 19462533).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'8d1e100f-e8d1-47fa-92f3-8bcbfa7341d8',7157,NULL),(28779,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'40665770-9057-44fc-841e-8592998a1b1f',7157,NULL),(28780,NULL,'The TP53 H115N mutation is located in the protein\'s DNA binding domain. In biochemical assays, this mutation has an enhanced ability to bind DNA compared to wildtype TP53, but reduced exonuclease activity. Expression of this mutation in lung cancer cell lines results in cell cycle arrest but this mutation cannot induce TP53-mediated apoptosis (PMID: 19462533).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'183c70aa-2587-44e9-923d-88efd0e1408c',7157,NULL),(28781,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'c2c4b2c5-99bd-4df1-9318-540401b18d4e',7157,NULL),(28782,NULL,'The TP53 A161T mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in TP53-null cell lines suggested that this mutation is inactivating as measured by increased protein expression compared to wildtype p53, which suggests lack of negative regulation characteristic of TP53 inactivating mutations (e.g., R175H) (PMID: 21232794, 16827139).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'cb0a7e75-bea1-4f82-b539-14d1f97a5e0a',7157,NULL),(28783,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'d92d9394-98d2-4a67-9dbf-ca95437df6a4',7157,NULL),(28784,NULL,'The TP53 G266R mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in TP53-null cell lines resulted in decreased TP53-induced transactivation, as evidenced by luciferase assays (PMID: 16827139).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'85b319f4-43ac-48b5-9846-3e25c8dd0ec5',7157,NULL),(28785,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'66bc592d-7d16-49d1-90dd-4141eb37b932',7157,NULL),(28786,NULL,'The TP53 A161S mutation is located in the protein\'s DNA binding domain. Expression of this mutation in head and neck cancer cell lines results in the inability of TP53 to suppress colony growth, as compared to wildtype TP53. In addition, this alteration leads to reduced expression of p21 with implications for apoptosis (PMID: 25119136).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'f110691a-6247-4b25-be7a-ba9c97938b7c',7157,NULL),(28787,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'12191136-e015-4953-8744-7c7dfa6c3c99',7157,NULL),(28788,NULL,'The TP53 V197E mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in TP53-null cells resulted in an increased interaction with PBF, an oncogene implicated in the regulation of TP53 target genes, such as p21 (PMID: 25408419).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'15c2897e-fc8d-4b79-8a2f-7076876796b0',7157,NULL),(28789,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'587e949b-673e-4f92-974e-e105135873ae',7157,NULL),(28790,NULL,'The TP53 M133K mutation occurs in the protein\'s DNA binding domain and likely confers loss of function to the expressed p53 protein. The TP53 M133K mutation is associated with loss of p53 transcriptional activity. Moreover, expression of this mutation in TP53-null cells was associated with an aberrant increased interaction with PBF, an oncogene that interferes in p53 transcriptional activity and consequent deregulation of its target genes, such as p21 (PMID: 25408419).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-05-18 19:36:09',NULL,NULL,NULL,NULL,'ca002c0f-42bc-4ac9-b9c9-eee83096a9e9',7157,NULL),(28791,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'8339d09f-c7a8-4db0-b3f1-298a69f81ea2',7157,NULL),(28792,NULL,'The TP53 I255F mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in TP53-null cells resulted in an increased interaction with PBF, an oncogene implicated in the regulation of TP53 target genes, such as p21 (PMID: 25408419).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'2b8cee54-b7ba-4e4c-b45e-b25824b8f695',7157,NULL),(28793,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'ad0d09f8-70be-414a-9ee6-87e3bb76dc89',7157,NULL),(28794,NULL,'The TP53 V197L mutation occurs in the protein\'s DNA binding domain. Endogenous expression of this mutation in a glioblastoma cell line resulted in decreased apoptosis and aberrant cell cycle progression, likely due to decreased TP53 transactivation (PMID: 11668476)','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'de75d745-2950-4466-aaa3-8dc2c2fbf549',7157,NULL),(28795,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'334f8e20-24e5-4a30-b2d7-dca0c275cf3f',7157,NULL),(28796,NULL,'The TP53 M133T mutation occurs in the protein\'s DNA binding domain. Endogenous germline expression of this mutation in breast cancer cells results in increased expression of the anti-apoptotic gene BIRC3, likely due to alerted TP53 transcriptional activation. Expression of this mutation also unregulated the inflammatory response, including increased expression of IL-1beta (PMID: 21311097).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'ea618d9d-5503-4381-8eb4-f3ee19b20fc2',7157,NULL),(28797,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'087e4522-ac70-41d1-bb2c-961fa38cb050',7157,NULL),(28798,NULL,'The TP53 C141Y mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in cell lines that lack TP53 expression did not enhance TP53-mediated transcriptional activity in reporter assays, as compared to expression of wildtype TP53 (PMID: 15037740).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'2b6e32cb-8db4-4dac-8bc7-110737b520fe',7157,NULL),(28799,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'5b0c5073-9772-4497-98d8-3ce215950ab2',7157,NULL),(28800,NULL,'The TP53 V173L mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in cell lines that lack TP53 expression did not enhance TP53-mediated transcriptional activity in reporter assays, as compared to expression of wildtype TP53 (PMID: 15037740).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'de48d259-cb71-42e1-87fe-5f46d1b47935',7157,NULL),(28801,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'e635bb54-cf10-481c-ba9a-b74a65f4174a',7157,NULL),(28802,NULL,'The TP53 V173M mutation occurs in the protein\'s DNA binding domain and likely confers loss of function to the expressed p53 protein. When TP53 V173M was expressed in p53-null cells, a transient reporter gene assays demonstrated mutant p53 was impaired from binding to the promoters of its target genes and consequent lowered transcriptional activity, as compared to expression of wildtype TP53 (PMID: 15037740).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-05-18 19:24:57',NULL,NULL,NULL,NULL,'e6705b65-cad4-47ce-8106-c2ec8e4ee65f',7157,NULL),(28803,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'b2d63dac-4119-4c87-a295-cb1d5da7be27',7157,NULL),(28804,NULL,'The TP53 Y205C mutation occurs in the protein\'s DNA binding domain and likely confers loss of function to the expressed p53 protein. When TP53 Y205C was expressed in p53-null cells, a transient reporter gene assays demonstrated mutant p53 was impaired from binding to the promoters of its target genes and consequent lowered transcriptional activity, as compared to expression of wildtype TP53 (PMID: 15037740).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-05-18 19:24:01',NULL,NULL,NULL,NULL,'43d62edb-4151-466d-86cd-3c2055e93fd1',7157,NULL),(28805,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'868609a3-c2ff-430e-9927-676f426b3c00',7157,NULL),(28806,NULL,'The TP53 R273L mutation occurs in the protein\'s DNA binding domain (DBD). Mutations in the DBD result in altered contact of p53 with its target DNA sequences, thereby altering its transcriptional function (PMID: 8023157, 11900253). Given that p53 directs the transcription of proteins that enable apoptosis (PMID: 11900253), its inactivation results in cells harboring damaged DNA and overall genomic instability (PMID: 11900253). Expression of the R273L mutation in cell lines that lack p53 expression did not enhance p53-mediated transcriptional activity in reporter assays, as compared to expression of wildtype TP53 (PMID: 15037740).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'cb4e3b94-9457-4208-b286-87908f41f6e8',7157,NULL),(28807,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'bf7eadb3-637c-47f1-9e59-cdda77d7eb0d',7157,NULL),(28808,NULL,'The TP53 E286K mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in cell lines that lack TP53 expression did not enhance TP53-mediated transcriptional activity in reporter assays, as compared to expression of wildtype TP53 (PMID: 15037740).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'9b80ab13-f126-40c6-bc44-98dc7fd22a90',7157,NULL),(28809,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'e40a0483-c475-4af3-9f8b-c621def6afe8',7157,NULL),(28810,NULL,'The TP53 I251S mutation occurs in the protein\'s DNA binding domain. Ovarian cancer patient samples expressing this mutation were sensitive to an amyloid aggregate TP53 inhibitor, as evidenced by apoptosis assays. Some TP53 mutations have been shown to form amyloid aggregates that lead to inactivation of the TP53 protein. Responsiveness of this variant to amyloid aggregate inhibitors suggest that this is a loss-of-function mutation (PMID: 26748848).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'f64f1d16-1bb7-4a21-8321-b41b971cc019',7157,NULL),(28811,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'bc7d3729-c0f3-46a7-a742-a3a6bf468b54',7157,NULL),(28812,NULL,'The TP53 E326L mutation occurs in the protein\'s DNA binding domain. Ovarian cancer patient samples expressing this mutation were sensitive to an amyloid aggregate TP53 inhibitor as evidenced by apoptosis assays. Some TP53 mutations have been shown to form amyloid aggregates that lead to inactivation of the TP53 protein. Responsiveness of this variant to amyloid aggregate inhibitors suggest that this is a loss-of-function mutation (PMID: 26748848).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-05-02 15:56:53',NULL,NULL,NULL,NULL,'1cdf7555-cb23-4b2f-875f-0e187e1bfe89',7157,NULL),(28813,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'6701ca7c-9543-44a6-847a-084a82ccced7',7157,NULL),(28814,NULL,'The TP53 R181C mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in osteosarcoma cell lines that lack wildtype TP53 results in decreased transactivation of genes important for the cell cycle and apoptosis, including p21 and MDM2. Cell lines expressing this mutation exhibited decreased apoptosis and decreased DNA binding ability as compared to cell lines expressing wildtype TP53 (PMID: 10229196, 20471942).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'8abe3752-f25a-47dc-9e3a-450a580e2f8b',7157,NULL),(28815,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'d9d4aa47-93cf-4d98-8451-89cc44ad7ee1',7157,NULL),(28816,NULL,'The TP53 R202S mutation is located in the protein\'s DNA binding domain. Expression of this mutation in TP53-null osteosarcoma cell lines demonstrated that TP53 R202S is inactivating as measured by decreased transactivation of genes important in cell cycle and apoptosis, including p21 and BAX, compared to cell lines that express wildtype TP53 (PMID: 10229196).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2023-03-24 11:36:40',NULL,NULL,NULL,NULL,'e4790ef9-3603-44bc-aa7f-d07d1c34c324',7157,NULL),(28817,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'8dcd4c8c-88b9-48e8-8328-0112ce40365f',7157,NULL),(28818,NULL,'The TP53 T150I mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in osteosarcoma cell lines that lack wildtype TP53 results in decreased transactivation of genes important in cell cycle and apoptosis, including p21 and Bax. Cell lines expressing this mutation have decreased apoptosis as compared to cell lines that express wildtype form of TP53 (PMID: 10229196).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'31eeba79-dd25-4024-85f2-564d6f862c1e',7157,NULL),(28819,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'7c310f91-960c-410d-bf87-03e8aa8d8102',7157,NULL),(28820,NULL,'The TP53 S240R mutation occurs in the DNA binding domain of the protein. Expression of this mutation in osteosarcoma cell lines that lack wildtype p53 demonstrated that this mutation is likely inactivating as measured by decreased transactivation of genes important for cell cycle regulation and apoptosis, including p21 and Bax, as well as decreased apoptosis compared to cells expressing wildtype p53 (PMID: 10229196).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'f3b9ec06-6ec6-404a-8789-db95f5809e6e',7157,NULL),(28821,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'59d77dea-2f64-4eaf-9270-551432c9aba1',7157,NULL),(28822,NULL,'The TP53 G199R mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in osteosarcoma cell lines that lack wildtype TP53 results in decreased transactivation of genes important in cell cycle and apoptosis, including p21 and Bax. Cell lines expressing this mutation have decreased apoptosis as compared to cell lines that express wildtype form of TP53 (PMID: 10229196).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'bad89955-4825-4219-803b-6f11d4d016f1',7157,NULL),(28823,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'dbf32171-2b62-4a45-8ff3-ee8cbe0647f2',7157,NULL),(28824,NULL,'The TP53 Q144P mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in osteosarcoma cell lines that lack wildtype TP53 results in decreased transactivation of genes important in cell cycle and apoptosis. Cell lines expressing this mutation have decreased apoptosis and enhanced cell growth as compared to cell lines that express wildtype form of TP53 (PMID: 10229196).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'1b3bda9d-0a5f-4721-9fe2-41d430c8e859',7157,NULL),(28825,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'053f67d8-ad36-423d-b3c3-7787304d7d20',7157,NULL),(28826,NULL,'The TP53 Y163N mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in osteosarcoma cell lines that lack wildtype TP53 is associated with decreased transcriptional activation of the p53 target gene p21. Additionally, cell lines expressing this mutation have decreased apoptosis and enhanced cell growth as compared to cell lines that express wildtype form of TP53 (PMID: 10229196) suggesting that this mutation confers loss of p53 function.','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-05-18 19:16:45',NULL,NULL,NULL,NULL,'d039e7b7-0731-481b-8e82-9ba69812def5',7157,NULL),(28827,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'1f66b84a-d75d-489b-bec8-e6fa2652f374',7157,NULL),(28828,NULL,'The TP53 H168Y mutation occurs in the protein\'s DNA binding domain and likely confers loss of function to the p53 protein. Expression of this mutation in osteosarcoma cell lines that lack wildtype TP53 was associated with decreased transcription of p53 target genes. Cell lines expressing this mutation have decreased apoptosis and enhanced cell growth as compared to cell lines that express wildtype form of TP53 (PMID: 10229196).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-05-18 19:28:03',NULL,NULL,NULL,NULL,'17a2a1b1-4a50-4190-a8ee-4c4cc6736ca0',7157,NULL),(28829,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'2fed257c-1ac2-4e09-9def-2ff0e1f3b16d',7157,NULL),(28830,NULL,'The TP53 R181H mutation occurs in the protein\'s DNA binding domain. In biochemical assays, this TP53 mutant was found to have defective DNA binding activity compared to wildtype TP53. Expression of this mutation in osteosarcoma cell lines resulted in decreased transactivation of TP53 target genes and reduced apoptosis (PMID: 20471942).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'f25a8db0-d6db-4f12-9868-3257e32db0d5',7157,NULL),(28831,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'001f2b88-fb31-4d3e-a0d2-dea646391c92',7157,NULL),(28832,NULL,'The TP53 R181P mutation occurs in the protein\'s DNA binding domain and likely confers loss of function to the p53 protein. In biochemical assays, this TP53 mutant was found to completely lose DNA binding activity. Expression of this mutation in osteosarcoma cell lines resulted in decreased transactivation of TP53 target genes and reduced apoptosis (PMID: 20471942).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-05-18 19:40:42',NULL,NULL,NULL,NULL,'7f5362d2-5cc6-4a0b-a07d-52e0b3df046e',7157,NULL),(28833,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'564683ab-c62a-46b8-ba84-910976339f36',7157,NULL),(28834,NULL,'The TP53 E180K mutation occurs in the protein\'s DNA binding domain. In biochemical assays, this TP53 mutant was found to have defective DNA binding activity compared to wildtype TP53 (PMID: 24814347). Expression of this mutation in osteosarcoma cell lines resulted in decreased transactivation of TP53 target genes and reduced apoptosis (PMID: 20471942).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'e4542676-3410-4b9a-85fa-3afc44d88a05',7157,NULL),(28835,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'7ea701e7-d356-4122-b740-c18b729170d7',7157,NULL),(28836,NULL,'The TP53 R181L mutation occurs in the protein\'s DNA binding domain. In biochemical assays, this TP53 mutant was found to have defective DNA binding activity compared to wildtype TP53. Expression of this mutation in osteosarcoma cell lines resulted in decreased transactivation of TP53 target genes and reduced apoptosis (PMID: 20471942).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'9e42d6df-dbb2-49ae-be6d-f5ffd6064262',7157,NULL),(28837,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'cb05874e-484e-4f65-bde5-6f5bec6603d0',7157,NULL),(28838,NULL,'The TP53 K120R mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in lung cancer cell lines demonstrated that this mutant is defective for TP53 acetylation, compared to wildtype TP53. Loss of acetylation results in defective apoptosis, without impacting cell cycle arrest (PMID: 17189187, 7651437).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'40e1aac7-b29e-44bb-a6aa-bde06b842413',7157,NULL),(28839,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'3fbb0295-0363-42be-abac-cb74f0269645',7157,NULL),(28840,NULL,'The TP53 K120M mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in lung cancer cell lines result in decreased cell cycle arrest, compared to expression of wildtype TP53 (PMID: 17189187).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2017-04-20 1