,NULL,NULL,'d7744220-e23f-4140-a619-26514d841fda',7157,NULL),(28848,NULL,'The TP53 C277Q mutation occurs in the protein\'s DNA binding domain. In biochemical assays, this TP53 mutant had a decreased ability to bind DNA compared to wildtype TP53 (PMID: 7651437).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'93b63170-5476-4728-ab27-c4617f921b46',7157,NULL),(28849,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'099645c0-c531-4b22-b6e0-f6e0a0a69630',7157,NULL),(28850,NULL,'The TP53 C277R mutation occurs in the protein\'s DNA binding domain. In biochemical assays, this TP53 mutant had a decreased ability to bind DNA compared to wildtype TP53 (PMID: 7651437).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'c331d331-6191-41ae-9730-5b0ca48ecf61',7157,NULL),(28851,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'a4d9e08e-2675-4318-869f-696e2d2faf0b',7157,NULL),(28852,NULL,'The TP53 R248K mutation occurs in the protein\'s DNA binding domain. Biochemical assays have demonstrated that this TP53 mutation is inactivating as measured by decreased ability to bind DNA compared to wildtype TP53 (PMID: 7651437).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2023-01-13 15:41:16',NULL,NULL,NULL,NULL,'a2630e1b-9300-486c-8077-f37d23f085ba',7157,NULL),(28853,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'c2d1a9ff-f41f-4896-96ef-b68381e1ea7a',7157,NULL),(28854,NULL,'The TP53 R283Q mutation occurs in the protein\'s DNA binding domain. In biochemical assays, this TP53 mutant had a decreased ability to bind DNA compared to wildtype TP53 (PMID: 7651437).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'a4a9d1be-14a2-4cfe-843a-3a422b412940',7157,NULL),(28855,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'7b5e897c-ab0d-46d0-bc07-fe5b93fb2d57',7157,NULL),(28856,NULL,'The TP53 H178D mutation occurs in the protein\'s DNA binding domain and likely confers loss of function to the p53 protein. In biochemical assays, this TP53 mutant had a decreased ability to bind DNA of apoptosis effecters Puma and p21, but not anti-apoptotic mediators such as Bcl-xl compared to wildtype TP53 (PMID: 24814347).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-05-18 19:39:38',NULL,NULL,NULL,NULL,'adf3b436-da78-45c0-8582-fce8b3f1a868',7157,NULL),(28857,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'48494947-6086-43b6-9a57-baae32aa168f',7157,NULL),(28858,NULL,'The TP53 D186A mutation occurs in the protein\'s DNA binding domain. In biochemical assays, this TP53 mutant had a decreased ability to bind DNA compared to wildtype TP53 (PMID: 24814347).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'38fad032-750c-4204-9578-cb2c8c76b486',7157,NULL),(28859,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'9a3c3525-cce5-49c8-9d77-30e03bd577b5',7157,NULL),(28860,NULL,'The TP53 C277W mutation occurs in the protein\'s DNA binding domain. In biochemical assays, this TP53 mutant had a decreased ability to bind DNA compared to wildtype TP53 (PMID: 24814347).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'a0de3084-e532-43b3-8bc1-a14d7b990697',7157,NULL),(28861,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'18decb14-dbd7-4df7-8da2-d2b8836a7303',7157,NULL),(28862,NULL,'The TP53 K120A mutation occurs in the protein\'s DNA binding domain. In biochemical assays, this TP53 mutant had a decreased ability to bind DNA compared to wildtype TP53 (PMID: 24814347). Expression of this mutation in cell lines resulted in cell cycle defects and reduced apoptosis, consistent with loss of TP53 activity (PMID: 16687402).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'b105cd98-386a-4031-959f-ebd8b9d9a701',7157,NULL),(28863,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'f8157c54-5106-4e26-869c-77fca2f5bba5',7157,NULL),(28864,NULL,'The TP53 R280A mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in lung cancer cell lines resulted in decreased cell cycle arrest, compared to expression of wildtype TP53 (PMID: 17189187, 24814347). In colony formation assays, expression of this mutation resulted in increased cell growth compared to wildtype TP53. Expression of this mutation resulted in decreased p21 and MDM2 expression, consistent with defects in cell cycle (PMID: 18524770).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'f48417f5-975b-424d-8f8f-b77e66dab9cb',7157,NULL),(28865,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'c4a77df5-6243-487a-84b5-df937ddc7b4e',7157,NULL),(28866,NULL,'The TP53 V143A mutation occurs in the protein\'s DNA binding domain. Expression of this mutation in osteosarcoma TP53-null cell lines resulted in increased colony formation compared to cells expressing wildtype TP53 (PMID: 10435620).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'5c6716f8-583a-42ec-97bf-a9c00ccd4ebc',7157,NULL),(28867,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2024-05-30 13:33:01',NULL,NULL,NULL,NULL,'0acca871-c27a-481c-a750-f3172f195b28',7157,NULL),(28868,NULL,'The TP53 R290H mutation occurs in the protein\'s DNA binding domain. In vitro studies with TP53-null Saos-2 cells expressing TP53 R290H demonstrate inconclusive evidence of the oncogenic function of the mutation as measured by slightly lower growth suppression and reduced p21 protein expression compared to wildtype and TP53 transcriptional activity being comparable to wildtype (PMID: 10435620). In contrast, in vitro studies with TP53-null HCT116 cells and lymphocytes expressing TP53 R290H demonstrate that the mutation is likely neutral as measured by DNA-binding activity and transcriptional activity being comparable to wildtype (PMID: 24076587, 28369373).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2024-05-30 13:33:03',NULL,NULL,NULL,NULL,'baab13ee-970b-4ef1-b408-718a71f4b577',7157,NULL),(28869,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2025-07-07 11:26:56',NULL,NULL,NULL,NULL,'41656930-7b09-48a0-8b39-dbf18ff23110',7157,NULL),(28870,NULL,'The TP53 R156H mutation is located in the DNA-binding domain of the protein. There is conflicting evidence on the oncogenic effect of this mutation. In vitro studies with TP53-null osteosarcoma cell lines expressing TP53 R156H demonstrate reduced transactivation of p21 and tumor cell growth suppression that is comparable to wildtype (PMID: 10435620). In vivo studies with yeast expressing TP53 R156H demonstrate that the mutation is inactivating as measured by the partial loss of transactivational activity as compared to wildtype (PMID: 27328919, 12826609). Other preclinical studies with TP53-null cells and yeast expressing TP53 R156H demonstrate that the mutation is likely neutral as measured by induction of apoptosis, transcriptional activity and growth suppression comparable to wildtype (PMID: 30840781).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2025-07-07 11:34:55',NULL,NULL,NULL,NULL,'3dc0d794-ce11-45dd-b380-b910685fd5ad',7157,NULL),(28871,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'74dec252-1b48-4ec4-acd8-156813aad0c4',7157,NULL),(28872,NULL,'The TP53 R267P mutation occurs in the protein\'s DNA binding domain. Lung cancer cell lines that have endogenous expression of this mutation are sensitive to knockdown of TP53 in growth assays. Expression of this mutation in cell lines results in enhanced expression of the tyrosine kinase Axl (PMID: 22989750, 23264849).','MUTATION_EFFECT',NULL,_binary '\0','Likely Gain-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'8ed97575-e8de-466e-937c-44743e090b2c',7157,NULL),(28873,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-02-23 16:13:18',NULL,NULL,NULL,NULL,'e942a3c9-f18d-46af-a716-00acd11193b3',7157,NULL),(28874,NULL,'The TP53 Q331H mutation occurs in the protein\'s tetramerization domain. In biochemical assays, this TP53 mutation enhanced the formation of TP53 tetramers (PMID: 20978130). However, this mutation is a hotspot, suggesting that it is likely oncogenic (PMID: 26619011).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'d896c2aa-a20c-46b4-a0dc-8b8dd6392e70',7157,NULL),(28875,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'b8b7d2b2-3dcc-484e-a76b-31d1f0ec49d9',7157,NULL),(28876,NULL,'The TP53 T329I mutation occurs in the protein\'s tetramerization domain. In biochemical assays, this TP53 mutation enhanced the formation of TP53 tetramers (PMID: 20978130). Further functional data is required to determine if this mutation is indeed gain-of-function.','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'c19b8f02-f19f-43b5-a019-4b777367ddcf',7157,NULL),(28877,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'53587bdf-fc1e-4550-bd94-880815ec8356',7157,NULL),(28878,NULL,'The TP53 Q331R mutation occurs in the protein\'s tetramerization domain. In biochemical assays, this TP53 mutation enhanced the formation of TP53 tetramers (PMID: 20978130), which could lead to alteration of p53 function','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'5375dc0c-395c-43ff-be5a-598d1f79a658',7157,NULL),(28879,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'47ec5f61-9067-43ff-89df-d8f1df0a6786',7157,NULL),(28880,NULL,'The TP53 G356A mutation occurs in the protein\'s tetramerization domain. In biochemical assays, this TP53 mutation enhanced the formation of TP53 tetramers (PMID: 20978130). Further functional data is required to determine if this mutation is indeed gain-of-function.','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2017-05-02 15:44:33',NULL,NULL,NULL,NULL,'74c7493c-85e4-4ee9-c02b-b493955e323a',7157,NULL),(28881,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'063c9847-e0fd-47e5-9261-b7d6407615f1',7157,NULL),(28882,NULL,'The TP53 P316L mutation is located in the protein\'s most N-terminal signal (NLS1) domain. Mutation in this domain has been shown to induce the synthesis of a cytoplasmic p53 protein, thus interfering with normal p53 protein localization (PMID: 2553699, 10618702, 20010306 ).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'bd32563e-1c00-463e-a143-132858c5e3f1',7157,NULL),(28883,NULL,'This assertion is supported by (PMID: 25860933, 25412851).','PROGNOSTIC_IMPLICATION',NULL,_binary '\0',NULL,'2020-09-16 17:52:15',NULL,'LEVEL_Px1',NULL,NULL,'ee6b8c2d-0e7a-42bb-ab8f-ef29344cd081',7157,NULL),(28884,NULL,'The WHO classification of hematologic tumors list TP53 alterations as a prognostic biomarker in [[tumor type]]. Well-powered studies find that patients with a TP53 alteration such as [[gene]] [[mutation]] have a less favorable prognosis.','PROGNOSTIC_SUMMARY',NULL,_binary '\0',NULL,'2020-09-16 17:52:15',NULL,NULL,NULL,NULL,'507da72f-9996-47e7-935f-2477a4b97c40',7157,NULL),(28885,NULL,'