eration such as [[gene]] [[mutation]] have a less favorable prognosis.','PROGNOSTIC_SUMMARY',NULL,_binary '\0',NULL,'2020-09-16 17:52:15',NULL,NULL,NULL,NULL,'ee5ad677-d86e-4fb2-8324-b52072a2a559',7157,NULL),(28899,NULL,'This assertion is supported by (PMID: 28819011, 26022239, 24684350, 8639789, 7579380).','PROGNOSTIC_IMPLICATION',NULL,_binary '\0',NULL,'2020-09-16 17:52:15',NULL,'LEVEL_Px3',NULL,NULL,'e05be7f2-30ba-4b12-84ab-aeba2c0e29ab',7157,NULL),(28900,NULL,'Clinical studies suggest that patients with TP53 altered [[tumor type]] have a less favorable prognosis.','PROGNOSTIC_SUMMARY',NULL,_binary '\0',NULL,'2020-09-16 17:52:15',NULL,NULL,NULL,NULL,'6f6f4c38-43a8-4ea3-a0a7-68a3d515b009',7157,NULL),(28901,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-03-18 20:38:38',NULL,NULL,NULL,NULL,'62b6cb66-9135-4a95-9032-caedfa3fe453',7157,NULL),(28902,NULL,'The TP53 S215G mutant is located in the DNA binding domain of the protein. Mutations in the DNA binding domain are associated with altered contact of p53 with its target DNA sequences, thereby altering its transcriptional function (PMID: 8023157, 11900253). Functional studies in yeast and human cell lines suggest this mutation is temperature sensitive and inactivating, as measured by functional analysis of separated alleles in yeast (FASAY) (PMID: 17724467, 22862161). This mutation is also a hotspot, suggesting that it is likely oncogenic (PMID: 26619011).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2023-01-18 19:04:06',NULL,NULL,NULL,NULL,'a3aead6a-7ad7-4381-9b21-81c71f99515a',7157,NULL),(28903,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'daf0222b-c413-49d6-b893-eb9b1e39951e',7157,NULL),(28904,NULL,'The TP53 L145R mutation is located in the DNA-binding domain of the protein. This mutation has been identified in melanoma and is a statistically significant hotspot (PMID: 20571075). In vivo studies with yeast expressing TP53 L145R demonstrated that the mutation is inactivating as measured by the loss of transactivational activity as compared to wildtype (PMID: 27328919, 12826609). In vitro studies with various human cancer cell lines expressing TP53 L145R also demonstrated the mutation is inactivating as measured by reduced growth suppressive activity as compared to wildtype (PMID: 29979965, 30224644).','MUTATION_EFFECT',NULL,_binary '\0','Loss-of-function','2023-03-23 15:34:28',NULL,NULL,NULL,NULL,'a65bca08-1b2c-4423-ab16-eabe9e9a14f7',7157,NULL),(28905,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'2e4fa506-8016-4475-9c80-0226dc103dd0',7157,NULL),(28906,NULL,'TP53 deletions are predicted to be inactivating and associated with poor prognosis (PMID: 11900253, 20697090, 21467160, 12584563). Experimental studies have revealed that deletions result in loss of TP53 tumor suppressive function, since TP53 cannot decrease cell viability in vitro (PMID: 27759562). Additionally, deletion of TP53 in the neurons of mice, while not sufficient to cause tumor development, allows the accumulation of other oncogenic mutations leading to tumorigenesis (PMID: 19477430). Further, loss of TP53 protein during 17p deletion events in leukemia/lymphoma, enhances cancer development through cooperation of linked tumor suppressive genes such as EIF5A and ALOX15B (PMID: 26982726).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2019-07-18 15:06:42',NULL,NULL,NULL,NULL,'2e3b9a82-adcc-4067-9ebc-e394a9ca3081',7157,NULL),(28907,NULL,'This assertion is supported by (PMID: 9680348, 18337559, 17209057 Abstract: Hofste op Bruinink, D. et al. Abstract# Blood 128:3271, 2017. http://www.bloodjournal.org/content/128/22/3271?sso-checked=true; http://www.bloodjournal.org/content/122/21/1846).','PROGNOSTIC_IMPLICATION',NULL,_binary '\0',NULL,'2020-09-16 17:52:15',NULL,'LEVEL_Px1',NULL,NULL,'143077a9-08b8-4800-8c52-db80dad34385',7157,NULL),(28908,NULL,'The NCCN guidelines list deletion of TP53 as a prognostic biomarker in [[tumor type]]. Well-powered studies find that patients with deletion of TP53 have a less favorable prognosis.','PROGNOSTIC_SUMMARY',NULL,_binary '\0',NULL,'2020-09-16 17:52:15',NULL,NULL,NULL,NULL,'43ecf7b6-6d53-44b7-a99e-f47d87f9b9bc',7157,NULL),(28909,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:45:46',NULL,NULL,NULL,NULL,'74aec1d1-f984-430f-a431-fca85f5375e5',7157,NULL),(28910,NULL,'Truncating mutations of TP53 occur throughout the gene and lead to the production of several C-terminally truncated protein forms. These alterations are predicted to be inactivating and are associated with poor prognosis (PMID: 11900253, 11753428, 16007150, 21467160, 19336573). Experimental studies have revealed that truncating mutations promote cancer cell proliferation, survival and metastasis, since ectopic expression of these mutations in melanoma cells increased cell motility and tumor formation in vivo. This was due in part to aberrant localization of truncated proteins to the mitochondria, regulating genes involved in cell survival, including CypD (PMID: 27759562).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-06-13 14:53:20',NULL,NULL,NULL,NULL,'72ca72a6-e423-4ace-893e-b5e837f1c2c7',7157,NULL),(28911,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2017-04-20 17:39:17',NULL,NULL,NULL,NULL,'b459bc2f-df4e-4b37-95a1-98670b60bb2e',7157,NULL),(28912,NULL,'The exon 8 TP53 E285K mutation is located in the DNA binding domain of the protein. Expression of TP53 E285K in yeast and human cancer cells demonstrated that it is likely loss of function as evidenced by decreased expression and transactivation compared to wildtype TP53 (PMID: 20407015).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2017-07-19 09:42:12',NULL,NULL,NULL,NULL,'c5aec539-492b-4e93-aab5-901680618a0c',7157,NULL),(28913,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2018-07-24 11:03:06',NULL,NULL,NULL,NULL,'f5224470-2da2-4825-a9ca-08d8a5bcb2b7',7157,NULL),(28914,NULL,'The 3 bp in-frame deletion leading to the p53 P191del mutation arises in the DNA-binding domain of p53. Mutations in the DNA-binding domain are likely loss-of-function, associated with the loss of p53 transcriptional activity (PMID: 8023157). Additionally, this mutation was identified as a recurrent hotspot (statistically significant) in a population-scale cohort of tumor samples of various cancer types using methodology (PMID: 26619011). Lastly, immunohistochemical analysis of a stage IV adrenocortical carcinoma harboring this mutation showed absence of p53 protein (PMID: 11454518).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2018-07-24 11:11:27',NULL,NULL,NULL,NULL,'4bbfb245-8242-4c5f-8ec3-58d0eb2f8fb1',7157,NULL),(28915,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2018-08-09 16:17:55',NULL,NULL,NULL,NULL,'0efd0be7-8d9e-4660-a7cf-88d83f26739c',7157,NULL),(28916,NULL,'The TP53 R196G mutation arises in the p53 DNA-binding domain of the protein. Human H1299 cell transactivation studies have demonstrated that this mutation is inactivating as demonstrated by significantly decreased transcriptional activity of p53 downstream factors bax, p21 and RGC relative to wildtype p53 at two different experimental temperature conditions (32 and 37 degrees Celsius) (PMID: 22710932).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2023-02-01 16:25:35',NULL,NULL,NULL,NULL,'0b4f34f8-aa1c-4663-b586-eca7ddd34fa1',7157,NULL),(28917,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Inconclusive','2023-02-07 15:10:49',NULL,NULL,NULL,NULL,'ebf5de87-0bf9-43f1-bd6c-f944f1bf0d49',7157,NULL),(28918,NULL,'The TP53 R196L mutation arises in the p53 DNA-binding domain of the protein. When this mutation is expressed in human Saos cells at different experimental temperature conditions, a difference in transactivational activity of this TP53 mutant has been observed (PMID: 14559903). However, there is no specific data demonstrating whether the mutation has decreased transactivational activity relative to wildtype p53 (PMID: 14559903). Nonetheless, an alternate mutation at this position, the TP53 R196G mutation, has been demonstrated to decrease p53 transactivation activity relative to wildtype p53 (PMID: 22710932). The R196L mutation is also a 3D hotspot mutation and therefore TP53 R196L is considered likely oncogenic (PMID: 28115009).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2023-02-07 15:11:09',NULL,NULL,NULL,NULL,'e6263878-9cbb-468a-9837-ef2294db7409',7157,NULL),(28919,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2020-06-10 00:35:09',NULL,NULL,NULL,NULL,'16fba3bd-82c5-4dbf-be5f-b7952ed9f390',7157,NULL),(28920,NULL,'The TP53 C124R mutation is located in the DNA binding domain of the protein. Expression of this mutation in a yeast functional assay demonstrated that it is likely inactivating (PMID: 9115587.)','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2020-06-10 00:35:07',NULL,NULL,NULL,NULL,'1407e432-557d-49ce-b50d-ce74d65fb840',7157,NULL),(28921,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2020-06-10 00:38:38',NULL,NULL,NULL,NULL,'8cf023da-f5e8-4ade-879d-4068589d6971',7157,NULL),(28922,NULL,'The TP53 C141W mutation is located in the DNA binding domain of the protein. Expression of this mutation in biochemical assays demonstrated that it is likely inactivating as measured by function that is moderately altered compared to wildtype (PMID: 20407015).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2020-06-10 00:39:01',NULL,NULL,NULL,NULL,'794e66b7-6319-4180-a829-15f0b558b1b1',7157,NULL),(28923,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2020-06-10 00:52:33',NULL,NULL,NULL,NULL,'0b5519b6-cde0-4060-8f6d-bfdfb69b9f46',7157,NULL),(28924,NULL,'The TP53 C176W mutation is located in the DNA binding domain of the protein. Expression of this mutation in biochemical assays demonstrated that it is likely inactivating as measured by impaired ability to activate downstream target genes compared to wildtype (PMID: 19850740).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2020-06-10 00:54:39',NULL,NULL,NULL,NULL,'7b23803d-83e6-4294-9bf8-8810777a0527',7157,NULL),(28925,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2020-06-10 01:02:03',NULL,NULL,NULL,NULL,'1ec44108-57ab-498c-b1c3-768bec243758',7157,NULL),(28926,NULL,'The TP53 G154V mutation is located in the DNA binding domain of the protein. Biochemical experiments have suggested that this mutation is inactivating as it acts as a dominant-negative (PMID: 21289082).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2023-02-03 13:25:57',NULL,NULL,NULL,NULL,'58fc793e-8e9e-40ee-bc2c-b1c849a283f1',7157,NULL),(28927,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2022-12-12 14:55:31',NULL,NULL,NULL,NULL,'abe217c7-44c4-4b46-aeeb-ac64fa8a71db',7157,NULL),(28928,NULL,'The TP53 C277Y mutation is located in the DNA-binding domain of the protein. This mutation has been identified in Ewing sarcoma and myeloproliferative neoplasms and is a statistically significant hotspot (PMID: 15192123, 35030630). In vitro studies with H1299 cells ectopically expressing TP53 C277Y demonstrated the mutation is inactivating as measured by the mutant\'s significant reduction in apoptosis and downregulation of p21 and BAX expression as compared to wildtype (PMID: 34282274).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-13 18:30:24',NULL,NULL,NULL,NULL,'61d808e4-78c4-4611-b571-f87316a5c3ff',7157,NULL),(28929,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2022-12-12 14:56:20',NULL,NULL,NULL,NULL,'763ff1b3-d610-4906-a9d7-e914bffd62c6',7157,NULL),(28930,NULL,'The TP53 Y236H mutation is located in the DNA-binding domain of the protein. This mutation has been identified in breast cancer, lung cancer and basaloid pancreatic carcinoma and is a statistically significant hotspot (PMID: 20682393, 32674491, 25432630). In vivo studies with yeast expressing TP53 Y236H demonstrated that the mutation is inactivating as measured by the loss of transactivational activity as compared to wildtype (PMID: 27328919, 12826609).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-13 18:30:51',NULL,NULL,NULL,NULL,'a225696a-e751-4a12-9603-e2c980449bad',7157,NULL),(28931,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2022-12-12 14:57:14',NULL,NULL,NULL,NULL,'a9aac0c1-e239-473d-98d4-437c05c03bd1',7157,NULL),(28932,NULL,'The TP53 Y236N mutation is located in the DNA-binding domain of the protein. This mutation has been identified in B-cell precursor acute lymphoblastic leukemia, breast cancer, colon cancer and glioblastoma and is a statistically significant hotspot (PMID: 33095873, 8950983, 9301461, 10427138). In vivo studies with yeast expressing TP53 Y236N demonstrated that the mutation retains its transactivational activity as compared to wildtype (PMID: 27328919, 12826609). However, other in vitro studies with various human cancer cell lines expressing TP53 Y236N demonstrated the mutation is inactivating as measured by reduced growth suppression activity as compared to wildtype (PMID: 29979965, 30224644).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2022-12-13 18:31:26',NULL,NULL,NULL,NULL,'528eba0e-4a36-481e-be48-779287cec4d7',7157,NULL),(28933,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2022-12-12 14:57:48',NULL,NULL,NULL,NULL,'eb38de83-1cbb-472a-a5d8-17db280b3d76',7157,NULL),(28934,NULL,'The TP53 H193Q mutation is located in the DNA-binding domain of the protein.  This mutation has been identified in colorectal cancer, esophageal squamous cell carcinoma, bone sarcoma and squamous cell carcinoma and is a statistically significant hotspot (PMID: 12433709, 10414702, 1423262, 10414702). In vivo studies with yeast expressing TP53 H19