 demonstrate that the mutation is likely neutral as measured by colony growth comparable to wildtype (PMID: 33257846). Other in vitro studies with various human cancer cell lines expressing TP53 G360V also demonstrate that the mutation is likely neutral as measured by growth suppression activity comparable to wildtype (PMID: 29979965, 30224644). In vivo studies with yeast expressing TP53 G360V demonstrate that the mutation is likely neutral as measured by transactivational activity comparable to wildtype (PMID: 27328919, 12826609). In contrast, in vitro studies with H1299 cells expressing TP53 G360V demonstrate that the mutation is activating as measured by increased transactivational activity, increased apoptosis and decreased colony growth compared to wildtype (PMID: 27297285).','MUTATION_EFFECT',NULL,_binary '\0','Inconclusive','2023-07-11 18:18:53',NULL,NULL,NULL,NULL,'b3b7f8fa-2917-468e-b3f9-d14d3b0cee6c',7157,NULL),(29519,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2024-09-13 17:32:31',NULL,NULL,NULL,NULL,'34869853-1be8-4adf-840a-42d49c9cdc5a',7157,NULL),(29520,NULL,'The DNA-binding domain (DBD) of TP53 allows for contact with target DNA sequences to transactivate downstream genes. Mutations in the DBD result in conformational changes of the protein, altering contact of TP53 with its target DNA sequences and thereby altering transcriptional function (PMID: 8023157, 11900253). Given that TP53 directs the transcription of proteins that enable apoptosis, the inactivation of TP53 results in cells harboring damaged DNA and overall genomic instability (PMID: 11900253, 11900253).','MUTATION_EFFECT',NULL,_binary '\0','Likely Loss-of-function','2024-09-13 17:32:34',NULL,NULL,NULL,NULL,'5f74dc05-e878-4499-aa0d-f1b933bc7684',7157,NULL),(29521,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Oncogenic','2024-09-13 17:33:16',NULL,NULL,NULL,NULL,'7fc66870-e2bd-4ac1-9668-98540bb912bf',7157,NULL),(29522,NULL,'The DNA-binding domain (DBD) of TP53 allows for cont