532,NULL,'The TP53 V157I mutation is located in the DNA-binding domain of the protein. This mutation has been identified in vulvar squamous cell carcinoma (PMID: 17539962). In vitro studies with various human cancer cell lines expressing TP53 V157I demonstrate that the mutation is likely neutral as measured by the lack of dominant-negative function, growth suppression activity being comparable to wildtype and the gene expression profile being similar to wildtype (PMID: 29979965, 30224644, 37697151). In vivo studies with yeast expressing TP53 V157I demonstrate that the mutation retains partial functionality of transactivational activity compared to wildtype (PMID: 12826609).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2025-03-12 11:05:59',NULL,NULL,NULL,NULL,'3e31f62f-72f2-4316-b40a-07215d252020',7157,NULL),(29533,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2025-03-12 14:48:38',NULL,NULL,NULL,NULL,'add021b0-0b2f-4f86-be09-c502dfc6d7e0',7157,NULL),(29534,NULL,'The TP53 A276V mutation is located in the DNA-binding domain of the protein. This mutation has been identified in colorectal cancer (PMID: 26109429). In vitro studies with various human cancer cell lines expressing TP53 A276V demonstrate that the mutation is likely neutral as measured by the lack of dominant-negative function, growth suppression activity being comparable to wildtype and the gene expression profile being similar to wildtype (PMID: 29979965, 30224644, 37697151). In vivo studies with yeast expressing TP53 A276V demonstrate that the mutation retains partial functionality of transactivational activity compared to wildtype (PMID: 12826609).','MUTATION_EFFECT',NULL,_binary '\0','Likely Neutral','2025-03-12 14:48:43',NULL,NULL,NULL,NULL,'c12e1b67-c70a-4d50-ba21-c217d05f5156',7157,NULL),(29535,NULL,NULL,'ONCOGENIC',NULL,_binary '\0','Likely Neutral','2025-06-05 16:23:12',NULL,NULL,NULL,NULL,'e5cbbc37-aec6-4176-adca-79e435e973f4',7157,NULL),(29536,NULL,'The TP53 R290C mutation is 